INSERT INTO `aic_company_details` VALUES (1,'2015-02-03 20:30:00','Ericsson India Global Servies','<p>Ericsson India Global Services strives to connect everyone, wherever they may be.&nbsp;Their services, software and infrastructure &ndash; especially in mobility, broadband and the cloud &ndash; are enabling the communications industry and other sectors to do better business, increase efficiency, improve their users&rsquo; experience and capture new opportunities.&nbsp;</p>\r\n<p>Website Link:&nbsp;http://www.ericsson.com/in/</p>','AIC_CompanyPhotos/ericsson.png','The company has decided to offer internships to the winning team. They are planning to choose one winner across ideas but it might be offered to more than one team as well depending on the quality of solution. \r\n\r\nInternship will be offered for two months at Ericsson R&D Unit, Gurgaon.','Problem_Statements/Ericsson_Apogee_2014__BITS_Pilani.pdf',1),(2,'2014-03-15 02:57:52','Hedge Quants','<p>Hedge Quants is an alternative investment management firm that specializes in quantitative trading and investment strategies across Indian equities, commodities, currencies and interest rate derivatives. It develops proprietary trading strategies by identifying non-random patterns in financial markets data using quantitative techniques and artificial intelligence.</p>\r\n<p>Hedge Quants provides an alternative investment avenue to its clients through its purely mechanical and systematic trading systems that strive to generate superior as well as consistent investment returns.</p>\r\n<p>HQ Capital Advisory, LLP is aquatitative research firm that specializes in quatitative investment strategies across euities, commodities, currencies and interest rate derivatives.&nbsp;</p>\r\n<p><a href=\"http://www.hedgequants.com/\">Website Link:&nbsp;</a></p>\r\n<p>&nbsp;<strong style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"text-decoration: underline;\"><a style=\"color: #1155cc;\" href=\"http://www.hedgequants.com/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.hedgequants.com/&amp;source=gmail&amp;ust=1489824895793000&amp;usg=AFQjCNH6hA4-5Mx24XWPzpzTEE-uggnE-w\">http://www.hedgequants.com/</a></span></strong></p>','AIC_CompanyPhotos/hedge.png','The Computer Science Problem statement comprises of Stock Market Prediction using Machine Learning by using concept of predictive searching.\r\n\r\nThe problem for Economics-Finance category has been finalized and is based on Live prediction of Stock Prices.The evaluation criteria would be the accuracy of the prediction and the rationale(Technical Indicators, regression, etc.) being used to reach the predicted value. The time period for the problem statement would be 10 days and would start just after the Mid-Semester. The evaluation would be continuous on daily basis.','Problem_Statements/AIC_HQ.pdf',1),(3,'2014-03-16 03:04:08','Adani Powers','<p>Adani, a global conglomerate with a presence in multiple businesses across the globe, has entered the power sector to harbinger a &lsquo;power full&rsquo; India. Our comprehension of the criticality in meeting the power requirement and its crucial role in ensuring the energy security of India, spurred us to build India&rsquo;s largest and among the world&rsquo;s top 5 single location thermal power plant at Mundra.</p>\r\n<p>Along with thermal power generation, Adani power has made a paradigm shift by venturing into Solar power generation in Gujarat. It is Adani&rsquo;s endeavor to empower one and all with clean, green power that is accessible and affordable for a faster and higher socio-economic development.</p>\r\n<p><a href=\"http://www.adanipower.com/\">Website link:</a></p>','AIC_CompanyPhotos/adani.png','Problem Statements:\r\n \r\n1.“Modelling, Analysis and Mitigation of Cycling effects on Supercritical and Sub-critical Boiler in Coal Based Thermal Power Plants ”\r\n \r\n2.”Optimsing Coal Blending for minimizing Impacts on  Boiler Components”.  \r\n \r\nRequired teams that have M.Tech and B.Tech degree students.\r\n ','',1),(4,'2014-03-16 03:08:20','Exotel','<p>Exotel is a biz phone system that is reliable &amp; gives you complete control.&nbsp;</p>\r\n<p>No business today can function on the old-school phone system. Imagine running a business on your mobile phones or your landline phones. The chaos and confusion it would create is unimaginable. Enter cloud telephony! It&rsquo;s the smartest way to manage your business phone system without compromising on cost and quality.</p>\r\n<p><a href=\"http://exotel.in/\">Website Link.</a></p>','AIC_CompanyPhotos/exotel.png','Create a firefox plugin for Exotel\r\n<br />\r\n<br />\r\n1. The plugin menu should have a \'login\' option\r\n<br />\r\n<br />\r\n2. When a user clicks on login s/he should be taken to the login page (my.exotel.in)\r\n<br />\r\n<br />\r\n3. If a user is logged in \r\n<br />\r\n<br />\r\n4. When any web page is loaded the plugin must detect all phone numbers (of type 9123456789, 09123456789, +919123456789 , 08022223333)\r\n<br />\r\n<br />\r\n5. All detected phone numbers should be highlighted and a call icon placed in front of it (http://unicode-table.com/en/2706/)\r\n<br />\r\n<br />\r\n6. Clicking on the phone icon should initiate an outbound call and connect the logged in user to the number\r\n<br />\r\n<br />\r\n7. There should be a fleeting notification on the top left corner of the page indicating \"Calling <number>...\"\r\n<br />\r\n<br />\r\n8. Any error response should be shown in the notification above\r\n<br />\r\n<br />\r\n\r\nThe APIs to make outbound call can be figured out by A) Creating a trial account with Exotel and B) Trying out making calls using the Sandbox number and figuring out the network traffic that goes through the browser.','',1);
/*!40000 ALTER TABLE `aic_company_details` ENABLE KEYS */;
