INSERT INTO `database_event` VALUES (1,'events/ART.JPG',1,'<p>Research talks remain an essential part of the learning model in the most premier institutes around the world. Alumni Research Talks (ART) based on a similar idea, promises to be a novel concept with immense potential on the Indian front. It is a 3-day long student-industry-research symposium organized by the <a href=\"http://universe.bits-pilani.ac.in/pilani/computerscience/ComputerScience\">Department of Computer Science and Information Systems,</a> <a href=\"http://bits-csa.org\"> Computer Science Association</a> and <a href=\"/\"> Embryo </a>, BITS PIlani. Featuring research talks by recent BITS graduates currently in Grad schools or working in industry on some really hot research topics, the talks are broadcasted \'live\' to the Goa and Hyderabad Campuses of BITS Pilani. <br /><br /><strong>Speaker Profiles for ART 6.0 to be held in Jan 2017:</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Nitish Nair</strong></p>\r\n<p><img style=\"float: left; border: 2px solid black; margin-left: 10px; margin-right: 10px;\" src=\"http://art.bits-csa.org/5.0ART/pluton/speak/nitish.jpg\" alt=\"nitish\" width=\"100\" height=\"100\" />Mathematical modelling underpins his work in academic and industrial research. He has intensively worked on deterministic and stochastic simulations of systems from the molecular to the macroscale. Graduate training from UIUC and MIT honed his math and programming skills in the area of carbon nanotechnology. Postdoctoral research at the University of Colorado, Boulder, extended that experience to the domain of polymer science. Industrial research at GM and Shell has exposed him to real-world problems - from reactive transport in exhaust aftertreatment devices to atomistic simulations of hydrocarbons and fluid flow in porous media.<br /><br /></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Prasanta Bhattacharya</strong></p>\r\n<p><img style=\"border: 2px solid black; margin-left: 10px; margin-right: 10px; float: left;\" src=\"http://www.comp.nus.edu.sg/~prasanta/images/prasanta.jpg\" alt=\"prasanta\" width=\"100\" height=\"100\" /></p>\r\n<p>He is a PhD candidate with the Department of Information Systems at National University of Singapore (School of Computing). he is presently attached to the IS Social Network Lab where he is being advised by Prof.Tuan Q. Phan . He works in the area of Computational Social Science with a special focus on topics concerning social influence, network externalities and computational psycholinguistics. His current stream of research looks at identifying behavioral patterns from social network data.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Raghavendra Singh</strong></p>\r\n<p><img style=\"border: 2px solid black; margin-left: 10px; margin-right: 10px; float: left;\" src=\"https://media.licdn.com/mpr/mpr/shrinknp_200_200/p/3/000/0bd/082/1bc2035.jpg\" alt=\"raghavendra\" width=\"100\" height=\"100\" />Raghavendra Singh is a Research Staff member at IBM Research. He is currently a member of the Cognitive Computing group. His research interests are in in the area of information theory, signal processing and representation as applied to a spectrum of problems in neuro-science, compression and transmission of multimedia data, and monitoring of large scale data centers. He did his PhD. in Electrical Engineering from University of Southern California (2001).<br /><br /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Vaibhav Rajan</strong></p>\r\n<p><img style=\"float: left; border: 2px solid black; margin-left: 10px; margin-right: 10px;\" src=\"https://sites.google.com/site/vaibhavrajan/_/rsrc/1285668699131/home/pic5.JPG\" alt=\"vaibhav\" width=\"100\" height=\"100\" /></p>\r\n<p>Research Scientist Vaibhav Rajan joined XRCI as a Research Scientist in July 2012. He currently leads a project in predictive analytics for healthcare aimed at developing novel statistical models and algorithms for disease risk modelling, personalized treatment planning and prediction of emerging medical complications in hospitals.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','Alumni Research Talks'),(2,'events/bitsconnect2_1.jpg',0,'<p>BITSConnect 2.0 is a multi-million dollar project that envisions bringing state-of-the-art telepresence and inter-connectivity to all four campuses of BITS Pilani. It enables remote learning and participatory coursework, collaborative research and remote recruitment. BITSConnect 2.0 is a giant step for BITS Pilani in the direction of becoming a world class university.<br /> For more details about this project, visit the <a href=\"http://bitsconnect20.bitsaa.org/\">official website</a>&nbsp;.</p>','BITS Connect 2.0'),(3,'events/default.jpg',1,'<p>Home</p>','Home'),(4,'events/Kiran_Bedi.png',0,'<p><strong>Registration for \"Importance of Leadership in today\'s India\" closed.<br /><br /></strong>We have always dreamt of leading, leading in every field of society. But as we grow up, this vision is lost in the sands of time. In times like these, people like Dr. Kiran Bedi inspire us by their heroic leadership qualities and selfless service to the society. BITSEmbryo rekindles that fire in you, presenting to you Dr. Kiran Bedi, elucidating the significance of leadership in today\'s India. BITSEmbryo.&nbsp;</p>\r\n<ul>\r\n<li>Founded Navjyoti India Foundation for welfare and preventative policing.</li>\r\n<li>India Vision Foundation for prison reformation, drug abuse prevention and child welfare.</li>\r\n<li>Prominent member of the India Against Corruption (IAC) which has been actively protesting against corruption and is urging the government of India to enact a strong Lokpal Bill.</li>\r\n<li>First Woman to become IPS Officer.</li>\r\n<li>Advisor to the Lieutenant General of Chandigarh.</li>\r\n<li>Director General of Narcotics Control Bureau.</li>\r\n</ul>\r\n<p>For furthur details visit: <a href=\"http://www.kiranbedi.com/\">Dr. Kiran Bedi\'s website.</a></p>\r\n<p style=\"text-align: center;\"><strong>Date:</strong> 20th Aug, 2013.<br /><strong>Time:</strong> 8:30 P.M.<br /><strong>Venue:</strong> LTC-5103.</p>','Importance of Leadership in today\'s India'),(5,'events/bits2msphd.jpg',0,'<p>Confused between MS/PhD? BITS2MSPhD talks are back! Listen to BITS Alumni presently in Purdue University, Carnegie Mellon University and Cornell University speak discuss about MS/PhD application procedure. The entire application procedure, preparation and resources which are specific to BITSians will be discussed at length. <br /><br />If you have any queries tweet your questions with the hash tag #bits2msphd at any point during the talk.</p>\r\n<p align=\"center\"><strong>Pilani Campus:</strong></p>\r\n<p style=\"text-align: center;\">Date: <strong>31st Aug, 2013.</strong><br />Time: <strong>8:30 PM</strong><br />Venue: <strong>LTC-5103</strong><br />Speaker: <strong>Yashkumar Gandhi</strong></p>\r\n<p align=\"center\"><strong>Goa and Hyderabad Campus:</strong></p>\r\n<p style=\"text-align: center;\">Date: <strong>31st Aug, 2013.</strong><br />Time: <strong>6:30 PM</strong><br />Speakers: <strong>Adwait Gandhe, Varsha Rajashekar</strong></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p>Speaker Profile:<br /><br />1. Yashkumar Gandhi:<strong> <br /></strong>Masters student at Purdue University<br />Chemical Engineering, BITS Pilani<br /><br />2. Adwait Gandhe: <br />Masters student at Carnegie Melon University<br />Electrical and Electronics Engineering, BITS Pilani<strong><br /></strong><br />3. Varsha Rajashekar<br />PhD Student at Weill Cornell Medical College<strong><br /></strong></p>','BITS2MSPhD talks: Know your Application Process'),(6,'events/1241484_406593689440213_367587853_n.jpg',0,'<p>Civil engineering, the oldest engineering discipline, is a professional discipline that deals with the design, construction, and maintenance of the physical and naturally built environment, including works like roads, bridges, canals, dams, and buildings. Amit Mukhrejee has a lot of experience in civil companies . He has a lot of knowledge in planning , cost controling ,cost estimation,scheduling of any activity. The speaker will describe about the civil companies , their projects and what is its scope and opportunities in future. If you interested in core civil companies and its projects please don\'t miss this interactive session. You are free to ask any kind of question regarding civil companies and projects.</p>\r\n<p>Pilani Campus:</p>\r\n<ul>\r\n<li>Date: 14th Sep [Saturday], 2013.</li>\r\n<li>Time: 8:45 PM</li>\r\n<li>Venue: LTC-5106</li>\r\n<li>Speaker: AMIT MUKHERJEE</li>\r\n</ul>\r\n<p><br /> Speaker Profile:- <br /><br />1.Senior Planning Engineer, Petrofac International Limited<br /> 2.Project Control Manager and Senior Engineer, Larsen &amp; Toubro Limited <br /> 3.Senior Project Controls Engineer, Foster Wheeler India Private Limited <br /> 4.Planning Manager, Indian Oiltanking Limited</p>','Challenges and Opportunities in Civil Engineering'),(7,'events/AIC_banner.jpg',0,'<p>It\'s that time of the year again, when you feel inspired by infinite number of technical activities being organized all around the campus. It\'s that time of the year again when you feel like innovating something. It\'s that time of the year again, when you can take up any challenge. It\'s the APOGEE time of the year again. <br /><br />BITS Embryo presents to you <strong>Apogee Innovation Challenge.&nbsp;</strong>APOGEE Innovation Challenge, an exceptional technical symposium, aims at quenching your thirst for hands-on experience in real life problems plaguing the industrial world.</p>\r\n<p>Organized in collaboration with various multinational industries, this event presents before you existing challenges faced by these companies who seek their solutions from you. These problems, which happen to be discipline specific (one need not belong to that discipline), are to be scrutinized and solved by participants in teams of 2-4 in a month. Exciting Internship Offers and Cash Prizes await the winners. Needless to say, you can brag about cracking a professional challenge while still being at college.</p>\r\n<p>For the problem statemets refer to <a href=\"http://bits-apogee.org/2014/\">APOGEE, BITS Pilani.</a> The problem statements have been provided for the following disciplines:</p>\r\n<p>1. Civil Engineering - Tehri Hydro Development Corporation India Ltd, L&amp;T Power, Jindals Consortium, Skyline Consulting Engineers<br /> 2. Mechanical/Manufacturing Engineering <br />3. EEE/ENI - Bisquare Ltd., L&amp;T Engineering and Construction<br /> 4. Computer Science - Ericsson Global India Services, Exotel<br /> 5. Economics/Finance - Hedge Quants<br /> 6. Chemical Emgineering <br /><br />The holy grail of Engineering beckons. It\'s time to prove your mettle. Are you ready to Innovate, Achieve and Lead?<br /><br />For more details contact:<br />Siddharth Awasthi<br /><a style=\"font-family: RobotoThin; font-size: 18px; text-align: justify; background-color: #fdfdfd;\" href=\"mailto:siddharthawasthi.bits@gmail.com\" target=\"_blank\">siddharthawasthi.bits@gmail.com</a></p>','Apogee Innovation Challenge'),(8,'events/CAT_Champs.jpg',0,'<p>A Panel discussion program for students of all campus to enrich their concepts about CAT and can learn from experiences of seniors who have cracked it (in the year 2013) with excellent percentile.</p>\r\n<p>CAT Champs BITS Pilani is a unique opportunity for CAT aspirants learn from BITSians who have cracked the CAT.<br /><br /></p>\r\n<p>&nbsp;</p>','CAT CHAMPS'),(9,'events/interest.jpg',0,'<p><span style=\"font-family: arial, sans-serif; font-size: 13px;\">On entering college one is faced with a multitude of options so how did these people go about finding their field of interest?&rdquo; Only after finding one&rsquo;s interests can one move onto concentrating their efforts in one particular direction and then take up research or project work.</span></p>\r\n<p><span style=\"font-family: arial, sans-serif; font-size: 13px;\">The talk&rsquo;s focus will be on how exactly did the speakers work on developing their interests,the resources employed,academic collaborations with fellow students,project work under faculty,online courses etc,it will lay lesser amount of stress on their field and it&rsquo;s technicalities.</span></p>','Discussion on \"Discovering your Interest\"'),(10,'events/Pilani_To_Mussorie.jpg',0,'<p>Are you inquisitive about Civil Services? Ever wondered what it would be like to be an IAS or IPS officer?<strong> Why join the Civil Sevices</strong>? All thy queries shall be resolved! You will get to meet the BITSians who nailed it. They will introduce you to the idea of the <strong>IAS and IPS</strong>. You will get to know about <strong>preparing for the Civil Services exam</strong>, while in Pilani. Moreover, you will be enlightened about the advantages and disadvantages of <strong>being a BITSian</strong> with respect to the UPSC Civil Services Examination.</p>\r\n<p>Here are the speaker intros.</p>\r\n<p>1)&nbsp;<strong><strong>Mr. Prabhav Joshi, IAS (2007A1PS480)</strong></strong> is a bright Chemical engineering graduate of the 2007 batch. He has landed AIR 23 in Civil Services (2014) examination. He has earned several accolades as the President of BITS Embryo and Chemical Engineering Association. Being the best graduating student in chemical engineering,He has also bagged the prestigious Monali Dey award. He not only excelled at academics but also exhibited great sportsmanship spirit as the Vice captain of the hockey team.</p>\r\n<p>2) <strong><strong>Mr. Deepak Pareek, IPS (2003B1PS858, 2007H112119)</strong></strong> is a graduate in Biological sciences and has also pursued M.E. in software systems. He has bagged AIR 131 in Civil Services (2014) examination. He has proved his proficiency and ingenuity at Morgan Stanley too. While at BITS, he has held the position of the Joint Coordinator for Biological Science Association with amazing competence. He has served as an indispensable member in HAS(Hindi Activities Society).</p>','From Pilani To mussorie'),(11,'events/BITS2MSPHD_2.jpg',0,'<p>Does applying to grad school seem like a daunting task ? Are you confused whether a higher degree is for you? BITS2MSPhD presents an interactive session on applying to graduate school! Join in as BITS2MSPhD de-mystifies the app process.We provide insiders\' view on university selection, writing the Statement of Purpose and obtaining recommendation letters. This talk is aimed for students across all years. From helping you understand what an MS/PhD is, who should apply, how to build a profile for application or what you can do at your time in Pilani, we have the answers.&nbsp;</p>\r\n<p>Come! Get Enlightened!</p>\r\n<p><strong>SPEAKER INTROS:</strong></p>\r\n<p><strong>Ishaan Biswas (2007A3PS160P)</strong></p>\r\n<p>Ishaan graduated from BITS in 2011 right before the campus went into beautification overdrive. After working for a couple of years in the industry doing chip design he decided to moved on to yet another austere village at Purdue University in 2013. Ishaan joined the BITS2MSPhD team last year with an aim to help out grad school aspirants apply for grad school and demystify the application process.</p>\r\n<p><strong>Manasa Gopal(2009B3A3603P)</strong></p>\r\n<p>Manasa Gopal graduated in 2014 from the Pilani campus with a MSc(Hons.) in Economics and a B.E(Hons.) in Electrical and Electronics Engineering. She is currently pursuing a PhD in Finance from the Stern School of Business, New York University. During her time in Pilani, she worked as a research intern at the Freidrich Schiller University, Jena, Germany, Indian Institute of Management, Bangalore and the Indian School of Business, Mohali.</p>','BITS2 MSPhD : Know your University'),(12,'events/pure_science.jpg',0,'<p>BITS, Pilani has long been known for producing excellent Engineers on a consistent basis. However, when it comes to the Pure Sciences, we haven&rsquo;t done as well, even though we have great faculty and students. I personally have found research in Physics to be extremely rewarding and would like to share some of my experiences. I will also talk a bit about the diverse range of cutting edge research taking place at Caltech. Finally I will talk about how one can get started with research in pure sciences and go on to higher studies.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Bio:</p>\r\n<p>Vijay Varma is currently a Ph.D. student at the Caltech Physics department. His main research interests are Numerical Relativity and Gravitational Waves. Vijay completed his dual degree in Physics and Mechanical Engineering from the Pilani Campus in 2014. For his Master&rsquo;s thesis he worked with Prof. P Ajith at ICTS-TIFR, Bangalore on the detection of gravitational waves from binary black holes.</p>\r\n<p>&nbsp;</p>\r\n<p>Samarth:</p>\r\n<p>&nbsp;</p>\r\n<p>2009B1PS729P</p>\r\n<p>Graduate Student in Molecular Cell Biology</p>\r\n<p>Division of Biology &amp; Biomedical Sciences (DBBS)</p>\r\n<p>Washington University School of Medicine in St. Louis</p>\r\n<p>Saint Louis, Missouri (USA) &nbsp; &nbsp;</p>\r\n<p>&nbsp;</p>','Pure_science_career_option'),(14,'events/BITS2BSchool.jpg',0,'<p>Does applying to grad school seem like a daunting task ? Are you confused whether a higher degree is for you? BITS2BSchool presents an interactive session on applying to graduate school! Join in as BITS2BSchool de-mystifies the app process.We provide insiders\' view on university selection, writing the Statement of Purpose and obtaining recommendation letters. This talk is aimed for students across all years. From helping you understand the application process, who should apply, how to build a profile for application or what you can do at your time in Pilani, we have the answers.&nbsp;</p>\r\n<p>Come! Get Enlightened!</p>\r\n<p><strong>SPEAKER INTROS:</strong></p>\r\n<p><strong>Ankit Walani(2007C6PS417P)</strong></p>\r\n<p>He graduated from Pilani with an M. Sc. (Tech.) in Information Systems, Class of 2011. Currently, he is pursuing MBA at ESADE Business School, Barcelona.He worked as an R&amp;D engineer for 3 years in enterprise telephony at Avaya. He worked on and lead projects in the Unified communication BU. He was also part of the internal strategic team that worked on the improvement of the delivery process and code quality. He has also handled the furniture sector of his family business.Apart from this, he is a yoga instructor and a theater artist (Ex-Mime clubber).</p>\r\n<p><strong>Manoj Muthavarapu</strong></p>\r\n<p style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8000001907349px;\">After graduating in 2008, he joined Oracle Retail. He was there for about 3 years building several software products &ndash; primarily prodcuctivity tools and applications for the business unit.Then, he joined a startup called Bravo Lucy Analytics as a \'Product Developer\' where he spent the next 2 years. He played a key role in the design and development of a unique software platform for sports analytics there.At around the same time, he worked part time with 3 students from the Haas School of Business to build uberessays.com which is a marketplace for prospective bschool students to connect with alumni and current students who could help them with their application essays for a small fee.Now, he is working at UnitedHealth Group as a Senior Software Engineer, building a cloud based health information exchange for Optum, a subsidiary of UHG.</p>','BITS2BSchool'),(15,'events/Final_v0.1.jpg',0,'<p><br /><br /></p>\r\n<p><span style=\"font-family: \'Liberation Serif\', serif;\"><span style=\"font-size: 15pt;\"><span style=\"color: #222222;\">Th</span><span style=\"color: #222222;\">is</span><span style=\"color: #222222;\"> event </span><span style=\"color: #222222;\">conducted by Embryo Club on 10</span><span style=\"color: #222222;\"><sup>th</sup></span><span style=\"color: #222222;\"> november, 2015 was soley focused on </span><span style=\"color: #222222;\">consisted of a talk by </span><span style=\"color: #222222;\">i</span><span style=\"color: #222222;\">ntroduc</span><span style=\"color: #222222;\">ing</span><span style=\"color: #222222;\"> the area of 3D printing, giv</span><span style=\"color: #222222;\">ing</span><span style=\"color: #222222;\"> a live Demo of 3D printers and provid</span><span style=\"color: #222222;\">ing</span><span style=\"color: #222222;\"> Guidance for the career in 3D Printing.</span></span></span></p>\r\n<p><span style=\"font-family: \'Liberation Serif\', serif;\"><span style=\"font-size: 15pt;\"><span style=\"color: #222222;\">The main speakers of the event were </span><span style=\"color: #222222;\">Prudhvi Reddy (IIM Calcutta; BITS Pilani)&nbsp;and Raja Sekhar Upputuri (China Europe International Business School, Shanghai; BITS Pilani).</span></span></span></p>\r\n<p><span style=\"font-family: \'Liberation Serif\', serif;\"><span style=\"font-size: 15pt;\"><span style=\"color: #000000;\">We</span><span style=\"color: #000000;\">ve heard </span><span style=\"color: #000000;\">all</span><span style=\"color: #000000;\"> of 3D printing from newscasters and journalists, astonished at what </span><span style=\"color: #000000;\">we</span><span style=\"color: #000000;\">&rsquo;ve witnessed. A machine reminiscent of the Star Trek Replicator, something magical that can create objects out of thin air. It can &ldquo;print&rdquo; in plastic,</span><span style=\"color: #000000;\">metal</span><span style=\"color: #000000;\"> nylon, and over a hundred other materials. It can be used for making nonsensical little models like the over-printed Yoda, yet it can also print manufacturing prototypes, end user products,</span><span style=\"color: #000000;\">quasi legal guns,aircraft engine parts a</span><span style=\"color: #000000;\">nd even human organs using a person&rsquo;s own cells.</span></span></span></p>\r\n<p><span style=\"display: inline-block; border: none; padding: 0cm;\"><span style=\"color: #000000;\"><span style=\"font-family: \'Liberation Serif\', serif;\"><span style=\"font-size: 15pt;\"><strong>Fantastical? Yes. True? Yes. Here now? Yes.</strong></span></span></span></span></p>\r\n<p><span style=\"font-family: \'Liberation Serif\', serif;\"><span style=\"font-size: 15pt;\">We live in an age that is witness to what many are calling the Third Industrial Revolution. 3D printing, more professionally called additive manufacturing, moves us away from the Henry Ford era mass production line, and will bring us to a new reality of customizable, one-off production.</span></span></p>\r\n<p><span style=\"font-family: \'Liberation Serif\', serif;\"><span style=\"font-size: 15pt;\"><span style=\"color: #222222;\">Basically, </span><span style=\"color: #222222;\">3D printing or additive manufacturing is a process of making three dimensional solid objects from a digital file. The creation of a 3D printed object is achieved using additive processes. In an additive process an object is created by laying down successive layers of material until the entire object is created. Each of these layers can be seen as a thinly sliced horizontal cross-section of the eventual object.</span></span></span></p>\r\n<p><span style=\"color: #000000;\"><span style=\"font-family: \'Liberation Serif\', serif;\"><span style=\"font-size: 15pt;\">3D printers use a variety of very different types of additive manufacturing technologies, but they all share one core thing in common: they create a three dimensional object by building it layer by successive layer, until the entire object is complete. It&rsquo;s much like printing in two dimensions on a sheet of paper, but with an added third dimension: UP. The Z-axis.</span></span></span></p>\r\n<p style=\"margin-bottom: 0.4cm; border: none; padding: 0cm; line-height: 0.71cm;\"><span style=\"color: #000000;\"><span style=\"font-family: \'Liberation Serif\', serif;\"><span style=\"font-size: 15pt;\">Each of these printed layers is a thinly-sliced, horizontal cross-section of the eventual object. Imagine a multi-layer cake, with the baker laying down each layer one at a time until the entire cake is formed. 3D printing is somewhat similar, but just a bit more precise than 3D baking.</span></span></span></p>\r\n<p><span style=\"color: #000000;\"><span style=\"font-family: \'Liberation Serif\', serif;\"><span style=\"font-size: 15pt;\">This is a disruptive technology of mammoth proportions, with effects on energy use, waste, customization, product availability, art, medicine, construction, the sciences, and of course manufacturing. It will change the world as we know it. Before we know it!</span></span></span></p>\r\n<p><br /><br /></p>\r\n<p><br /><br /></p>\r\n<p><br /><br /></p>\r\n<p><br /><br /></p>\r\n<p><br /><br /></p>\r\n<p><span style=\"font-family: \'Liberation Serif\', serif;\"><span style=\"font-size: 15pt;\"><br /></span></span><br /><br /></p>','Session on 3D Printing Technology'),(16,'events/catchamps_2015.jpg',0,'<p>An MBA degree after getting &nbsp;B.Tech degree is one of the most cliched paths an Indian Engineer can ever take and like every year this year Embryo Club is organizing CAT-CHAMPS to help fellow Bitsians who are preparing for CAT. Preparation for CAT is a whole new story when compared to the preparation required for IIT-JEE or BITSAT. BITS is one college which is always known for excellent performance in CAT. CAT-Champs is a panel discussion of where the panelists discuss the various strategies which can be adopted during the preparation for CAT. The panel comprises of excellent performers in CAT of the previous year.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Panelists: This year we have Neha Manglik (100.00), Divyanshu Choudhary (99.98), Kaustav Majhi (99.72), Neeti Pokharna (99.00), Akanksha (99.22), SriHarsha (99.88) (Hyd.Campus) and also the \'TIME\' Director of Hyderabad.</p>','CatChamps_2015'),(17,'events/banner2.jpg',1,'<p class=\"MsoNormal\" style=\"text-align: center; line-height: normal;\" align=\"center\"><strong><span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\"><span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\">A&nbsp; Search for Extra-terrestrial Life in Earth&rsquo;s Atmosphere</span></span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: center; line-height: normal;\" align=\"center\"><span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\"><strong>-Dr. Jayant Narlikar</strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\">The discovery of three bacterial species beyond Earth&rsquo;s atmosphere has opened up an intriguing possibility of extraterrestrial life beyond the planet, says Emeritus professor and founder director of Inter University Centre for Astronomy and Astrophysics, Jayant Vishnu Narlikar.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\">Renowned astrophysicist, Narlikar says that there was mainly \"circumstantial evidence\" to prove that life and more importantly, intelligent life could exist beyond our planet.</span><span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\"> <br /> <span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\">\"The most classical books in astronomy, till about a century ago, just mentioned that our universe exists till the Milky Way galaxies. But, due to better evolving astronomical tools, we have now discovered groups of galaxies, clusters, and super clusters. The more we discover of our universe, the more chances we have of discovering life. Millimeter-wave astronomy has helped us discover molecules in space, so we can say that life\'s building blocks- cells, DNA- do exist in space as well. But until now, the evidence in front of astro-physicists with regard to intelligent extra-terrestrial life is mostly circumstantial,\" he says.</span></span><span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\">According to him, the number of so-called \"super-civilizations\" that may exist extraterrestrially is equally speculative.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\">The American astrophysicist Frank Drake devised an equation which tries to find out the number of these super-civilizations that might exist. It incorporates factors like the rate of star formation, which is about one per year, the fraction of stars which are good suns, the fraction of good stars with planetary systems, among other factors. Researchers have come up with figures ranging from one to several billions. But the generally agreed upon figure by researchers around the world is the possibility of around a million, existing super-civilisations.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\">Referring to Frank Drake&rsquo;s equation, Professor Narlikar says, &ldquo;There is definite circumstantial evidence to support life outside Earth. A program known as SETI (search for extraterrestrial intelligence) has been in operation for more than four decades to receive coded messages about existence of life on earth.</span><span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\"> S<span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\">ending manned missions or spaceships to find extraterrestrial life, is impracticle.</span> <span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\">\"Some of these galaxies, where we may have reason to believe intelligent life may exist, are located a few million light years away. So if we send someone in a spaceship and, by some huge advancement, we find a way to keep a man alive for lakhs of years, who will he bring the information back? Even unmanned probes do not make much sense. At the current technology, the best way to make contact with possible extra-terrestrial life is through coded radio messages, which is being done by space agencies around the world\"</span></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\">He, however, is more hopeful about the quest to find primitive forms of life. \"Comet-tails might be carriers of micro-organisms and when they brush against planets, some of those micro-organisms might be released. Their existence is still something for research for ISRO. It detected living cells upto 41 kilometres from the Earth\'s surface. The experiment, which involved something called a cryo-sampler and released into the atmosphere using a balloon, also found new bacteria, which survived UV rays. If their characteristics are found to be different from those of the earth\'s bacteria, they should be extraterrestrial. </span><span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\">The bacteria &mdash; Janibactar Hoyleis, Bacillus Aryabhatai and Bacillus Isronensis &mdash; have been discovered after years of collaborative research by the Indian Space Research Organisation (ISRO), Tata Institute of Fundamental Research (TIFR), Centre for Cellular and Molecular Biology (CCMB) and NCCS, Pune.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\">The ISRO-CRYOSAMPLER experiment has detected live micro organic cells in ultra violet light.<span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\"> With the new body of research having already opened up intriguing possibilities of life outside Earth, astrophysics scientists are now wondering if we, human beings, are after all evolved from these micro organisms.</span></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\">The procedure and the results of this experiment are the subject of his on-campus talk on 10<sup>th</sup> Feb in BITS-Pilani.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\"><strong><span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\"><span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\"><span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\">About&nbsp;J.V.Narlikar</span></span></span></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\">Narlikar is a proponent of<span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\">&nbsp;</span>steady state cosmology. He developed with<span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\">&nbsp;</span>Sir Fred Hoyle<span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\">&nbsp;</span>the<span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\">&nbsp;</span>conformal gravity<span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\">&nbsp;</span>theory, commonly known as<span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\">&nbsp;</span>Hoyle&ndash;Narlikar theory. He has received several national and international awards and honorary doctorates. India\'s second highest civilian honour,<span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\">&nbsp;</span>Padma Vibhushan, was awarded to him in 2004 for his research work.<span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\">&nbsp;</span>Prior to this, in 1965, he was conferred<span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\">&nbsp;</span>Padma Bhushan. He was once featured on<span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\">&nbsp;</span>Carl Sagan\'s TV show<span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\">&nbsp;</span><em>Cosmos: A Personal Voyage</em><span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\">&nbsp;</span>in the late 1980s. <span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\">&nbsp;</span>He is a global figure in science.</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span style=\"font-size: 9pt; font-family: \'Trebuchet MS\', sans-serif;\" lang=\"EN-US\">&nbsp;</span></p>','On Campus Talk by \'Jayant Narlikar\' '),(18,'events/oasis.jpg',1,'<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><em><span style=\"font-size: 18pt; font-family: helvetica_thin_i, serif; color: #7a0000; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-US\">&lsquo;Archetypal and stirring&hellip; Amish&rsquo;s books unfold the deepest recesses of the soul.&rsquo;</span></em><span class=\"apple-converted-space\"><em><span style=\"font-size: 18pt; font-family: helvetica_thin_i, serif; color: #333333; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-US\">&nbsp;</span></em></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; line-height: normal;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\">Described as &lsquo;India&rsquo;s first literary popstar&rsquo; by world-renowned film director Shekhar Kapur, Amish&rsquo;s unique combination of crackling story-telling, religious symbolism and profound philosophies has made him an overnight publishing phenomenon.</p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><strong>Amish Tripathi</strong>&nbsp;(born 18 October 1974), is an Indian author, known for his novels&nbsp;<em><a title=\"The Immortals of Meluha\" href=\"https://en.wikipedia.org/wiki/The_Immortals_of_Meluha\">The Immortals of Meluha</a></em>,&nbsp;<em><a title=\"The Secret of the Nagas\" href=\"https://en.wikipedia.org/wiki/The_Secret_of_the_Nagas\">The Secret of the Nagas</a>,</em>&nbsp;<em><a title=\"The Oath of the Vayuputras\" href=\"https://en.wikipedia.org/wiki/The_Oath_of_the_Vayuputras\">The Oath of the Vayuputras</a></em>&nbsp;and&nbsp;<em><a title=\"Scion of Ikshvaku\" href=\"https://en.wikipedia.org/wiki/Scion_of_Ikshvaku\">Scion of Ikshvaku</a></em>. The first three books collectively comprise the Shiva Trilogy and the fourth is the first of the Ram Chandra Series.</p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\">The talk was organised in the BITS Auditorium after the inauguration of the cultural fest \'Oasis\'.</p>','The Oasis Talk');
