INSERT INTO `database_pagescontent` VALUES (1,'About Us','about','<p>Embryo is a forum for on-line, live and interactive lectures, run by students and faculties of BITS-Pilani. It was conceived and initiated by a group of 6 BITS Pilani Alumni in the Silicon Valley in 2006 with an aim to transform classroom education. <br /> Since February, 2006, more than 200 lectures have been successfully conducted in areas as wide ranging as Entrepreneurship, Black Holes, Solar Cells, Science of Smell, Naxalism, Rain water harvesting,Storage Networks, PSOCs, Process Control. <br /> In August 2010, Embryo 2.0 was launched. Since then we have conducted a series of lectures. The lecturer works closely with the course faculty and in a few cases, the lecture content is subject to evaluative components. The knowledge of the alumni has thus become an integral part of the BITS curriculum.</p>\r\n<h3>Vision</h3>\r\n<p>Enrich the learning experience at BITS Pilani.</p>\r\n<h3>Mission</h3>\r\n<p>To make the academic and industrial experience of the BITS alumni accessible to on-campus students through lectures, collaborative research projects, and exposure to current research trends around the world.</p>\r\n<h3>Why Embryo?</h3>\r\n<p>Although there is no alternative to \'in person\' classroom teaching, any University in the world is limited by its on-campus human resources and available expertise. Often, a lecture or two in the right area by the right person can change the course of one\'s career. Embryo proposes to free education from the barriers of distance, time and human resources. Leveraging web-based technologies, Embryo acts as a bridge between the knowledge seekers (students), and the potential speakers. Such a powerful method truly realizes the dream of border less classrooms and bottomless learning resources.</p>\r\n<h3>Available Infrastructure</h3>\r\n<p>With the advent of <a href=\"http://www.bitsconnect20.bitsaa.org\">BITS Connect2.0 </a>, we now have state of the art telepresence solutions across all campuses thus making the experience even richer.</p>\r\n<h3>About<a style=\"font-size: 14px;\" href=\"http://www.bits-pilani.ac.in/\"> BITS Pilani</a></h3>\r\n<p>Birla Institute of Technology and Science (BITS), Pilani is a Leading University in India offering degrees in Engineering, Management, Pharmacy, Sciences, Engineering Technology, Information Systems, General Studies, Finance etc presently at Pilani, Dubai, Goa and Hyderabad campuses. BITS Pilani also offers an array of work integrated learning programmes for HRD of a vast spectrum of Indian corporates.</p>\r\n<h3>About <a style=\"font-size: 14px;\" href=\"http://www.bitsaa.org/\">BITSAA</a></h3>\r\n<p>BITSAA International Inc. is a not-for-profit organization. The primary purpose of BITSAA International is to engage in charitable and educational activities by raising funds for setting up endowments, creating scholarships, rewarding teaching and research and generally promoting the development of resources at Birla Institute of Technology &amp; Science at Pilani. BITSAA International also aims to strengthen the ties, friendship and communications amongst former students, current students, faculty and friends of the Institute. BITSAA International provides a number of channels for people to stay connected with each other and the Birla Institute of Technology &amp; Science.</p>'),(2,'Home','home','<p><strong>Embryo</strong> is a project to foster <strong>strong collaboration</strong> of BITS students and BITS faculty with the alumni and friends of BITS Pilani.</p>\r\n<p>Through <strong>lecture series</strong> and <strong>collaborative projects</strong>, the students can get exposure to the cutting edge research areas. They also get an opportunity to network with Alumni and friends of BITS, who are reputed academicians and industry leaders.</p>\r\n<p>We aim to leverage BITSConnect to bring the alumni more closer to the students and faculty. Each and every alumnus can contribute his most valuable resources to BITS Pilani - knowledge and experience.</p>\r\n<p>The approach is three-fold:</p>\r\n<ul>\r\n<li>Complement BITS courses through video lecture series</li>\r\n<li>Facilitate collaborative research projects between alumni and BITS</li>\r\n<li>Expose students to current research trends and provide guidance for pursuing research projects</li>\r\n</ul>\r\n<p>On Jan 9, 2013,<a href=\"http://www.bitsconnect20.bitsaa.org\" target=\"_blank\"> BITSConnect 2.0</a> was inaugarated. A multi million dollar project which brings state of the art telepresence and interconnectivity to the campuses of BITS; it provides Embryo the platform to conduct high quality cross campus talks, and to further enhance the remote learning experience that it has been providing across all the campuses for some time now.</p>\r\n<p>Embryo aims to help BITS Pilani students become Leaders, Innovators and Entrepreneurs of tomorrow.</p>\r\n<p>You can also contribute to Project Embryo. Register with us and we shall get into touch shortly.</p>\r\n<p align=\"center\"><a href=\"/register\"><input type=\"button\" value=\"Register\" /></a></p>'),(3,'Contribute','contribute','<h3>How can I contribute?</h3>\r\n<p>You can share your valuable knowledge and experience which will consequentially provide additional exposure to the students, thus supplementing their education at BITS.</p>\r\n<ul>\r\n<li>As a faculty in the academic world, you can give guest lectures or teach an entire course at BITS.</li>\r\n<li>As a MS/PhD student doing research, you can talk about current research areas, motivate students of your discipline to take up research projects or help them apply to graduate schools.</li>\r\n<li>As a professional working in the industry, you can bring the industry perspective to the coursework at BITS, and give guest lectures on current trends in the industry. You can also talk about topics that supplement existing curriculum</li>\r\n</ul>\r\n<p>The Embryo team will</p>\r\n<ul>\r\n<li>Work with the group leaders of respective disciplines at BITS Pilani and find the appropriate time and place to schedule this lecture.</li>\r\n<li>Provide you the technical means to deliver a lecture.</li>\r\n</ul>\r\n<h3>What do I get from it?</h3>\r\n<ul>\r\n<li>Pure altruistic pleasure</li>\r\n<li>Collaboration and networking with some of the brightest students in India.</li>\r\n</ul>\r\n<h3>What do I get from it?</h3>\r\n<ul>\r\n<li>Click<a href=\"/faq\"> here </a>for FAQ\'s</li>\r\n<li>Click<a href=\"/register\"> here </a> to Register</li>\r\n</ul>\r\n<h3>Resources</h3>\r\n<ul>\r\n<li><a href=\"/handouts\">Handouts</a> for courses offered this Semester</li>\r\n</ul>'),(4,'FAQs','faq','<h3>Q.1 I have decided to deliver a talk. What now?</h3>\r\n<p><strong>Step 1: </strong>Register yourself <a href=\"/register\">here</a> on our Website as a Lecturer.One of the Embryo Co-ordinators will contact you soon after.</p>\r\n<p><strong>Step 2: </strong>Finalise the date and time of the talk with the co-ordinator.</p>\r\n<p><strong>Step 3: </strong>You provide an abstract of the topic of your talk.</p>\r\n<p><strong>Step 4: </strong>Our technical team will fix up a date for the trial run which is required to check the Technical compatibility from both the ends and smoothen out glitches if any.</p>\r\n<p><strong>Step 5: </strong>You provide the presentation (ppt / pdf) and any supporting audio visual material, that you will be using during your talk.</p>\r\n<p><strong>Step 6: </strong>We connect to you about 10 minutes before the scheduled time of the talk.</p>\r\n<h3>Q.2 Who will be my target audience?</h3>\r\n<p>The target audience for Embryo lectures is the undergraduate and postgraduate students of BITS who are pursuing degrees in various disciplines of science, technology and humanities. Faculty with relevant areas of research interest may also attend.</p>\r\n<p>Click <a href=\"/handouts\">here</a> to see the list of the course handouts offered by BITS Pilani. It can be used as a reference to gauge the academic experience of your audience. Besides academics the students of BITS are involved in a number of extra- curricular activities like photography, music, dancing, painting, sports etc. Their career interests besides engineering are finance, management, consultancy and civil services.</p>\r\n<h3>Q.3 What is the typical duration of a lecture?</h3>\r\n<p>45-60 minutes</p>\r\n<h3>Q.4 What software/technical requirements would be needed?</h3>\r\n<p>We use Cisco Webex<sup>TM</sup> for our talks. It supports both video conferencing and desktop/presentation sharing together. No installation would be needed from your side; you would just need to have Java installed on your computer (if not, it will prompt you to download a plugin). You would need a good internet connection (preferably over 1 Mbps) and a microphone and webcam (at least 1.3 MP). Your laptop\'s integrated webcam should do.</p>\r\n<h3>Q.5 I am not a BITS Alumni. Can I still deliver an lecture?</h3>\r\n<p>You are most welcome. Please register <a href=\"/register\">here</a> on our Website. We would be more than happy to discuss any such opportunity with you.</p>\r\n<h3>Q.6 What is the scope of topics covered in Embryo Lectures?</h3>\r\n<p>The lectures of Embryo cover topics from a variety of areas of academic and non -academic fields. Our past lectures were:</p>\r\n<ul>\r\n<li>Innovation/Patents - Disposable syringes (Mark Koska), Rainwater harvesting (Vijay Kedia)</li>\r\n<li>Research - Smell as a quantum phenomenon (Luca Turin,MIT), Smart materials</li>\r\n<li>Technical - Online Ads: Driving Innovation in Technology (Vinay Deo)</li>\r\n<li>Humanities - Mind-set development and communication skills</li>\r\n<li>Career - Applying for MS/PhD (Soumyadeep Ghosh)</li>\r\n<li>Finance - Personal Wealth management (Anand Mohan Agarwal)</li>\r\n<li>Current affairs - Naxalism (Anand Agarwal,IPS)</li>\r\n<li>Management - Optimal decision making in real time (Dr. Subhash Gupta)</li>\r\n</ul>\r\n<p>Click <a href=\"/lectures\">here</a> to see the complete list of talks</p>\r\n<h3>Q.7 Will it be possible to get feedback from students?</h3>\r\n<p>Facilities for audio-visual interaction with the audience are provided, so you can judge the live feedback for yourself. If you require anonymous feedback after the lecture, Embryo will undertake to perform it.</p>'),(5,'Pilani Team','pilaniteam','<h3>Faculty In Charge</h3>\r\n<p>Dr Amol Holkundkar, Dr&nbsp;Rishikesh Vaidya, Dr Rahul Banerjee</p>\r\n<h3>President</h3>\r\n<p>KALPIT MUNOT</p>\r\n<h3>Executive Coordinator</h3>\r\n<p>RISHABH JOSHI</p>\r\n<h3>Secretary</h3>\r\n<p>AYUSH SAWARNI</p>\r\n<h3>Campus Events Coordinator</h3>\r\n<p>SHASHWAT JHA</p>\r\n<h3>Campus Events Joint Coordinator</h3>\r\n<p>NIKHIL GARG</p>\r\n<h3>Web Team Coordinator</h3>\r\n<p>CHAITANYA GADODIA</p>\r\n<h3>Web Team&nbsp;Members</h3>\r\n<p>Sagar Daliya, Aditya Khandelwal, Palak, Mansi Bansal, Sukrut Waghmare, Aman Agrawal&nbsp;</p>\r\n<h3>Technical Team Coordinator</h3>\r\n<p>ABHIRAM SHASTRI</p>\r\n<h3>Technical Team&nbsp;Members</h3>\r\n<p>&nbsp;Arun Prabhu,Priyanka Prajapat,Akhil Agrawal, Yogesh Raut, Pranay Didwania, Aman Mudgal, Ayush Bothra&nbsp;</p>\r\n<h3>Publicity Team Coordinator</h3>\r\n<p>&nbsp;SHUBHANGI JASORIYA</p>\r\n<h3>Publicity Team&nbsp;Members</h3>\r\n<p>&nbsp;Sadrishya Agrawal, Aditi Goyal,Rashi Singhal, Rahul Dua, Sahil Singla, Jayesh Narayan, Arpit Sharma</p>\r\n<h3>Editorial Team Coordinator&nbsp;</h3>\r\n<p>VRUNDA TOL</p>\r\n<h3>Editorial Team&nbsp;Members</h3>\r\n<p>&nbsp;Garv Sharma,Shraddha Mashelkar, Pranshu Agarwal,Divya Padte, Prajjwal Khandelwal</p>\r\n<h3>Student Mentors</h3>\r\n<p>Raj Kiran Joshi, Yash Kothari, Chetan Chopra, Amitvikram Dutta, Shreya Inamdar, Ankita Sarda, Niranjan Godbole, Mayank Gupta, Kireeti Mara, Abhinav Raghvan, Arnav jain,&nbsp;Akandha, Shivangi Singh, Ayan Sen, Ashwini Pokle,&nbsp;VC ROOPNA, Soniya Lunawat,&nbsp;Hasil Sharma, Hrishikesh Mukte, Gyan Prakash Verma,&nbsp;Siddharth Malhotra, Apoorv Bhargava, Palak Joshi,&nbsp;Sumit Binnani,&nbsp;Nitish Pratik,&nbsp;Akhilesh Anandh,&nbsp;Siddharth Awasthi, Rachna Jha, Yash Jain, Parth Garg, Souradeep Bhattacharya, Rohan Badlani, Navneet Jha, Siddhant Shrivastava, Chinmayee Bhamburkar, Devendra Mittal.Himanshu Arora, Vignesh VS, Rahul Sharma, Geeta Bansal, Shrenik Borad, Rajat Arora, Ishani Singh, Dhruv Dave.</p>\r\n<p>You\'re welcome to join. Send a mail to embryoclub[at]gmail.com</p>\r\n<p>&nbsp;</p>'),(6,'Thank You','thankyou','<p>Thank you for registering with Embryo Club.<br /> Our coordinators will be in touch with you shortly.<br /> We hope the experience will be rewarding for you.<br /> Thank You</p>'),(7,'The Team','theteam','<h3>Executive Team (USA)</h3>\r\n<p>Shashikant Khandelwal, Mayur Shah, Shilpa Gupta, Gurpreet Singh, Madhur Khandelwal, Adarsh Sreekumar</p>\r\n<h3>Executive Team (India)</h3>\r\n<p>Ayusman Sarangi, Ashutosh Sharma, Mohit Gupta</p>\r\n<h3>Advisory Board</h3>\r\n<p>Chandra Bhople, Jayan Ramankutty, Prem Jain, Vijay Pathak</p>\r\n<h3>University Team Head</h3>\r\n<p>Dr Rahul Banerjee</p>\r\n<h3>BITS Pilani Team</h3>\r\n<p>Kalpit Munot, Rishabh Joshi, Ayush Sawarni, Shashwat Jha, Nikhil Garg, Chaitanya Gadodia, Abhiram Shashtri, Shubhangi Jasoriya, Vrunda Tol.Click <a href=\"/pilaniteam\">here</a> to see the complete team.</p>\r\n<h3>BITS Goa Tea</h3>\r\n<p>Saby John, Sarang Dhongdi, Siddarth Agrawal, Abhilash Dighe</p>\r\n<h3>BITS Hyderabad Team</h3>\r\n<p>Pratyush Mahapatra, Priyanka Kachare, Rishabh Saraswat, Sameer Reddy, Sai Prameela Reddy, Rajat Saxena, Aurgho Bhattacharjee, Click <a href=\"/hyderabadteam\">here</a> to see the complete team</p>\r\n<h3>Special Thanks</h3>\r\n<p>Nanda Kishore, Milap Shah.</p>'),(9,'Handouts','handouts','<p>Please click <a href=\"http://172.18.6.177/ID/Handouts.do\" target=\"_blank\">here</a> to view the handouts</p>'),(10,'Hyderabad Team','hyderabadteam','<h3>President</h3>\r\n<p>Pratyush Mahapatra</p>\r\n<h3>Secretary</h3>\r\n<p>Priyanka Kachare</p>\r\n<h3>Treasurer</h3>\r\n<p>Rishabh Saraswat</p>\r\n<h3>Technical Team</h3>\r\n<p>SAGAR ANAND,&nbsp;Darshan Chaudhary, Sudhindra Sarma, Rajas Joshi, Arkadip Basak, Rajat Saxena</p>\r\n<h3>Publicity Team</h3>\r\n<p>AURGHO BHATTACHARJEE,&nbsp;Amrit Pal, Swasti Gupta, Jaya Vamshi, Sumeet Chawla, Vivek Yadav, Eswara Sai, Abhimanyu Mukherjee</p>\r\n<h3>Event Management Team</h3>\r\n<p>K SAI PRAMEELA REDDY, P.Nikhil, Smriti Jain, P.Radhika, Saumya Jain, Suchita Pati, Ayush Jha, Abhav Tewari, Sushanth Sai, Manoj Gottipati, Aayush Khandelwal, Harshita Jha, Kartik Reddy</p>\r\n<h3>Communications Team</h3>\r\n<p>SARTHAK AGRAWAL, Nikhil Agarwal, Shivam Darmora, Apurva Verma, Nafisa Poonawala, Meha Sadasivnam, Krishna Ghantasala, Pranav Kabra, Mitali Soni</p>\r\n<h3>Editorial Team</h3>\r\n<p>Poojitha, Anirudh Ramesh, Aditya Chivukula, Chandan Bothra, Devrath Goyal, Sravani N</p>\r\n<p>You\'re welcome to join. Send a mail to embryoclub[at]gmail.com</p>\r\n<p>&nbsp;</p>'),(11,'Thank You','ethankyou','<p>Respected Sir/Madam,</p>\r\n<p style=\"padding-left: 30px;\">Your registration is successfully completed.</p>\r\n<p>Regards,</p>\r\n<p>ART Team</p>'),(12,'Waiting','waiting','<p>Hello ,</p>\r\n<p>Your Name is in waiting list. Your waiting list number will be mailed to you later.</p>\r\n<ol>\r\n<li>Since the seats in LTC 5103 (Telepresence Room) are limited, that is why it was required to have this Registration Process.<br /><br /></li>\r\n<li>All <strong>Registered</strong> students must be Seated <strong>BEFORE 8:15pm</strong>&nbsp;on 20th August.<br /><br /></li>\r\n<li><strong>All students are required to bring their ID Cards along with them</strong>. No student will be allowed to enter the Telepresence Room without an ID Card.<br /><br /></li>\r\n<li>If any registered student fails to arrive by this time, his registration is liable to be <strong>cancelled </strong>and the students in the Waiting List will be given seats instead.<br /><br /></li>\r\n<li>The priority of students in the Waiting List will be decided by their <strong>waiting list number</strong>.<br /><br /></li>\r\n<li>If all the seats are filled, we <strong>may </strong>allow some students to stand in the empty spaces. The priority for this too will be decided as per their waiting list number.<br /><br /></li>\r\n<li>The decision of BITS Embryo regarding any matter will be final and binding.</li>\r\n</ol>'),(13,'Thanks','nothankyou','<p><strong>Link Has expired.</strong></p>');
