INSERT INTO `lectures` VALUES (1,'2006-04-23 10:00:00','CS-IS','Basics of Information Retrieval','This talk will act as an introductory talk for Information Retrieval techniques.\r\n<p>\r\nIt will cover topics like the search and browse paradigms, relevance measures like precision and recall, inverted indices, clustering and classification, and personalization.\r\n\r\n<p>\r\nThere is no prerequisite required for this lecture. 1st yearites can attend too.\r\n',1,'','/unb/forum.php?req=thread&id=1','1','LTC 5106','Pilani'),(2,'2006-04-28 09:00:00','EEE-E&I','Global Positioning Systems','1. Basics of GPS\r\n2. How GPS works ?\r\n3. Applications of GPS.',2,'','/unb/forum.php?req=thread&id=2','1','LTC 5106','Pilani'),(3,'2006-04-23 11:00:00','MeE','Design of Experiments',NULL,3,'','/unb/forum.php?req=thread&id=3','1','LTC 5106','Pilani'),(4,'2006-11-12 10:00:00','MeE','Design of Experiments - Part I','Introduction to DOE, Introduction to ANOVA, 2k Factorial Designs  \r\n<p>\r\n2^k-p Fractional Factorial Design, Response Surface Methods\r\n<p>\r\nRandom Factors in experiments and Nested and Split Plot Design\r\n\r\n',3,'','/unb/forum.php?req=thread&id=4','1','',''),(5,NULL,'CS-IS','Search Engines - an Overview','The objective of this lecture is to introduce various concepts in the search engine world. The aspects that will be covered will be<br>\r\n- What is a search engine vs. traditional database search<br>\r\n- Some history of search engines – altavista, inktomi, yahoo, google<br>\r\n- Different types of search engines – web search vs. vertical search<br>\r\n- Different technologies that they use – crawling, scraping, relevance ranking<br>\r\n- Different types of vertical search engines and the nuances of each<br>\r\n<ul class=\"ul_1\">\r\n<li> shopping</li>\r\n<li>real estate</li>\r\n<li> blog</li>\r\n<li> travel</li>\r\n</ul>\r\n- How do Search Engines make money<br>\r\n- How do people spam search engines<br>\r\n',1,'',NULL,'1','',''),(6,'2006-08-13 10:30:00','Gen','MS/Phd - Overview of Higher Studies and life after graduate school','<p>Graduate School Life<br /> Difference between MS and PhD <br /> Various Job options</p>',4,'','/unb/forum.php?req=thread&id=5','1','LTC 5106','Pilani'),(7,'2006-08-26 10:00:00','Gen','MS/Phd Application Process Details','<p>- Basic components of Apping like GRE, SOP, Resume etc. <br /> - Supplement the application with other components <br /> Break some myths like low GPA, no aid, MS vs Phd etc.</p>',5,'','/unb/forum.php?req=thread&id=6','1','LTC 5106','Pilani'),(8,'2006-08-26 11:00:00','Gen','MS/Phd - the BITSian angle','<p>- Statistics on how BITSians perform<br /> - Common mistakes which BITSians make<br /> - What resources can you make use of which are specific to BITSians </p>',27,'','/unb/forum.php?req=thread&id=7','1','LTC 5106','Pilani'),(9,'2006-11-19 10:30:00','CS-IS','Introduction to Storage Area Networks - 1','# IP storage (protocol details, how/when  they are used, comparison with competing technologies)<br/>\r\n    <li> iSCSI<br/>\r\n    <li> FCIP<br/>\r\n# Case Studies of SANs<br/>\r\n    <li> e.g. a multilayer datacenter SAN <br/>\r\n    <li> e.g. use of FCIP for long-distance replications<br/>',6,'','/unb/forum.php?req=thread&id=8','1','',''),(10,NULL,'CS-IS','Introduction to Storage Area Networks - 2','# Multi-pathing for high availability <br>\r\n# SAN switch architecture<br>\r\n# Disk array architecture<br>\r\n# Initiator Architecture (FC HBA, iSCSI stack)<br>\r\n# Impact of SANs on file system, database and cluster software design<br>\r\n\r\n# Layered SAN technologies for disaster recovery and data protection<br>\r\n# Virtualization and Intelligent SAN services<br>\r\n# SAN futures<br>\r\n# Companies (products) and academic projects related to SANs<br>',7,'',NULL,'1','',''),(11,'2006-09-30 18:00:00','ChE','Microfluidics - A Primer','Microfluidics deals with the behavior, precise control and manipulation of micro- \r\nliter and nano- liter volumes of fluids. It is a multidisciplinary field comprising physics, \r\nchemistry, engineering and biotechnology, with practical applications to the design of \r\nsystems in which such small volumes of fluids will be used. Microfluidics emerged in the \r\n1990s and now is used in the development of DNA chips, micro- propulsion, micro- \r\nthermal technologies, and lab-on-a-chip technology. \r\n <p>\r\n The behavior of fluids at the microscale can differ from \'macrofluidic\' behavior as \r\nfactors such as surface tension, energy dissipation, and fluidic resistance start to \r\ndominate the system. Microfluidics studies how these behaviors change, and how they \r\ncan be worked around, or exploited for new uses. At these scales (channel diameters of \r\naround 10 to several hundred micrometers), some interesting and unintuitive properties \r\nappear. The Reynolds number, which characterizes the presence of turbulent flow, is \r\nextremely low; therefore the flow will remain Laminar. As a result, two fluids joining for \r\nexample will not mix easily and only diffusion alone will cause the two compounds to \r\nmingle. \r\n <p>\r\n This lecture will introduce the listeners to the various concepts in microfluidics. \r\nIt will outline the challenges and applications in the field of channel based microfluidic \r\nsystems. It will also discuss the field of droplet based microfluidics and present some of \r\nthe author’s work in this area. \r\n',8,'','/unb/forum.php?req=thread&id=9','1','',''),(12,'2006-11-16 18:00:00','MeE/EEE-E&I/CS-IS','Human-Robot Interaction (HRI) - Emerging Research Directions','It will focus on the state-of-art in HRI and the new research areas that are emerging with respect to entertainment and service robots. Multi-modal human-robot interaction consisting of facial expressions, vocal intonation, gestures, postures, and physiology are fast replacing traditional interfaces. The goal is to achieve high-dimensional, intuitive, and seamless interaction between humans and robots. This requires a synergistic integration of areas such as engineering, psychology, and computer science. This talk aims at acquainting the students interested in pursuing research/career in HRI with research going on in this area. \r\n<p>\r\nAll students with interest in Robotics, Artificial Intelligence, and Machine Learning are encouraged to attend\r\n',9,'','/unb/forum.php?req=thread&id=10','1','',''),(13,'2006-09-11 18:00:00','CS-IS','Introduction to Computer Vision','-How is vision related to sensing, control, AI\r\n\r\n-Applied vision - sampling of vision applications (vehicle safety, medical imaging, entertainment, autonomous navigation, industrial inspection)\r\n',10,'','/unb/forum.php?req=thread&id=11','1','',''),(14,'2006-09-17 09:00:00','CS-IS','Semantic Web – an Overview','Most of the Web\'s content today is designed for humans to read, not for computer programs to manipulate meaningfully. Computers can adeptly parse Web pages for layout and routine processing—here a header, there a link to another page—but in general, computers have no reliable way to process the semantics.\r\n<p>\r\nThe next generation of the Web, named Semantic Web, is an attempt to standardize ways to express semantics. It will enable computers to combine related data meaningfully. The Knowledge Representation community and the Web Standardization community (W3C) are working together to develop logics and representations to achieve this end. This lecture will present an overview of the same with pointers to resources for further study. Based on audience response, a follow up lecture may also be scheduled.\r\n<p>\r\nPre-requites:\r\n\r\nThe talk will mainly be targeted at students with CS/IS/Math background in their 3rd year. Some basic knowledge about the Web will be useful. Some elementary set theory/boolean logic will also help.',11,'','/unb/forum.php?req=thread&id=12','1','',''),(15,'2006-09-17 10:30:00','ChE','Multi-scale modeling and simulations of materials and biological systems','This lecture will introduce the students to various multi-scale modeling and simulation methods and applications of these methods to various materials science problems (eg- phase behavior of polymer blends, adsorption in carbon nanotubes, colloidal systems, etc.) and biological problems (eg- drug design, protein folding and aggregation, etc.)\r\n<p>\r\n1. Overview of computer simulation methods – Monte Carlo Simulations and Molecular Dynamics Simulations<br>\r\n2. How to choose an appropriate computational method given a problem<br>\r\n3. Computational study of materials systems 	<br>\r\n4. Computational study of biological systems <br>\r\n<p>\r\nRecommended texts: \r\n	Molecular Modeling: Principles and Applications by Andrew Leach, 	Understanding Molecular Simulations by Frenkel and Smit	\r\n',12,'','/unb/forum.php?req=thread&id=13','1','',''),(16,'2007-09-20 20:00:00','CS-IS','Graphics Processing Unit (GPU)- An Overview','1. What is GPU?<br>\r\n2. Why is GPU essential?<br>\r\n3. GPU and ImageProcessing<br>\r\n4. Software Applications using GPU Power<br>\r\n5. GPGPU: GPU\'s use for general purpose computing.<br>\r\n<p>\r\n\r\nPrereq:\r\n\r\nJust some basic knowledge of Image Processing/Computer Graphics.\r\n<p>\r\nExpected Audience:\r\n\r\n3rd year/4th year/5th year (dualites :) ) CS/IS students. Interested 2nd year students can also attend to get a flavour of this new domain. \r\n<p>\r\nReference:<br>\r\n\r\n1. http://en.wikipedia.org/wiki/Graphics_processing_unit<br>\r\n2. http://developer.nvidia.com/object/gpu_programming_guide.html<br>\r\n3. http://gpgpu.org/<br>\r\n',60,'','/unb/forum.php?req=thread&id=45','1','',''),(17,NULL,'EEE-E&I','Ultra-Wideband (UWB) Technology - An Overview\r\n','Things I would like to cover in this talk\r\n \r\n<li> What is UWB? \r\n \r\n<li> Applications of UWB.\r\n\r\n<li> Existing UWB standards.\r\n\r\n<li> Current research activities. \r\n\r\n<li> Future trends.\r\n<p>\r\nPrereq: Basic knowledge of wireless communication\r\nsystems.\r\n<p>\r\nExpected Audience: 3rd/4th year EEE/Instru students.\r\n1st/2nd year students and students from other\r\ndisciplines are also welcome.\r\n<p>\r\n\r\nReference:\r\n(i)  http://www.uwbforum.org/ <br>\r\n(ii) \r\nhttp://en.wikipedia.org/wiki/Ultra_wideband<br>\r\n(iii)http://www.wimedia.org/en/index.asp<br>\r\n',14,'',NULL,'1','',''),(18,NULL,'Gen','Web 2.0','Web 2.0 is changing the face of the internet domain now. It \r\nis\r\nthe most happening thing with a whole new set of technologies\r\nprominently reflected in services like flickr , the social bookmarking\r\nservice del.icio.us etc . Web 2.0 services are expected to replace\r\ndesktop computing applications for many purposes. In short it is a \r\nsetup\r\nwhere data from lots of sources is remixed with more participation from\r\nthe end users and the result is a truly great experience with the Web .\r\nThis talk would concentrate on Internet Trends with Web 2.0\r\n<p>\r\nPrereq:None',15,'',NULL,'1','',''),(19,NULL,'EEE-E&I','Overview of Electronic Design Automation (EDA) industry - Trends and Challenges','Suraj Bharech, BE(Hons) CS 2002 would also be co-lecturer\r\n<p>\r\nThings we would like to cover in this talk\r\n<ul>\r\n<li>What is EDA?\r\n\r\n<li>What skill set is required\r\n\r\n<li>What are the challenges in this domain?\r\n</ul>',18,'',NULL,'1','',''),(20,'2006-08-19 15:00:00','Gen','MBA - From the eyes of a BITSian - Part I','<p>Focus on ISB + Why MBA</p>',16,'','/unb/forum.php?req=thread&id=14','1','LTC-5106','Pilani'),(21,'2006-08-19 16:00:00','Gen','MBA - From the eyes of a BITSian - Part II','<p>Focus on IIMB and Admissions - the CAT, resources to tackle the exams</p>',17,'','/unb/forum.php?req=thread&id=15','1','LTC 5106','Pilani'),(22,'2006-11-11 13:30:00','Gen','MBA - From the eyes of a BITSian - Part III','<p>Focus on IIMA + Career Path and Post MBA opputunities</p>',20,'','/unb/forum.php?req=thread&id=16','1','LTC 5106','Pilani'),(23,'2006-11-01 18:00:00','CS-IS','TCP/IP Security Issues','In this lecture we will examine different security issues related to the TCP/IP suite of protocols. TCP/IP was not designed with security in mind and does not contain mechanisms to provide confidentiality, integrity and availability. Consequently, there have been numerous techniques, some quite ingenious, developed to circumvent  the security of a TCP/IP connection. We will review some of the more important of such techniques and discuss simple solutions wherever possible. Topics to be covered will include fingerprinting, sniffing, hijacking, DDoS, DNS. The lecture will NOT cover the different cryptographic solutions that have been recently developed to address these security issues. A knowledge of TCP/IP will be assumed. No knowledge of cryptography is required.\r\n',21,'','/unb/forum.php?req=thread&id=17','1','',''),(24,'2006-11-04 17:00:00','Bio','Introduction to Epigenetics\r\n','The emerging field of epigenetics holds great promise to enable answer fundamental questions in biology that directly impact development of disease cure strategies. Today, a great deal of biomedical research is focused in various areas of epigenetics. In my lecture I shall introduce the audience to this field, explain the various epigenetic processes in the cell (eg. DNA methylation, histone modifications), and briefly describe their relevance to important diseases like cancer.\r\n',33,'','/unb/forum.php?req=thread&id=18','1','',''),(25,'2006-09-25 18:00:00','CS-IS','Machine Translation','<ul>\r\n<li> What is Machine Translation? </li>\r\n<li> Why is it hard? </li>\r\n<li> A brief history and important approaches</li>\r\n<li> the IBM models(the most primitive translation models)</li>\r\n<li> Basic MT framework (language/translation model)</li>\r\n<li> Examples of language/translation model(eg. HMM models)</li>\r\n<li> Overview of synchronous grammars</li>\r\n<li> Syntax and Semantics : Evaluation</li>\r\n<li> Where are we heading?</li>\r\n</ul>\r\n\r\nFor beginners, try translation on\r\nhttp://www.google.com/language_tools',22,'','/unb/forum.php?req=thread&id=19','1','',''),(26,NULL,'CS-IS','Software Testing Methologies','<a href=\"http://www.cs.purdue.edu/homes/apm/mathur-homepage.html\">http://www.cs.purdue.edu/homes/apm/mathur-homepage.html</a>',23,'',NULL,'1','',''),(27,NULL,'ChE','Understanding Surface Reactivity of Transition Metals with Computational Surface Science','Computational surface science techniques, based on Density Functional Theory (DFT) calculations offer a big advantage of allowing the visualization of surface chemistry with a spatial resolution that is almost impossible to achieve with experimental \r\ntechniques alone. As a result, they serve as a very useful tool to understand atomic and \r\nmolecular structure and properties, as well as chemical reactivity on well-defined solid \r\nsurfaces. DFT calculations have successfully elucidated the mechanisms of complex \r\nchemical transformations, including adsorptive, desorptive, reactive, diffusive, and \r\nabsorptive processes on transition metal surfaces. In many cases, they have also identified \r\nnew intermediates which might have a strong influence on the reaction mechanism. Now, \r\nDFT calculations have also started to play a major role in the development of new \r\ncatalysts.  \r\n<p>\r\n This lecture will aim at introducing students with the state-of-the art \r\ncomputational methodologies employed in the field of heterogeneous catalysis. Examples \r\nfrom the literature as well as from speaker’s own work will be used to demonstrate the \r\npotential of this research area. The approach to bridge the temperature and pressure gaps \r\nbetween theoretical surface science and real world catalysis using a microkinetic model \r\nwill also be described.',24,'',NULL,'1','',''),(28,'2006-11-05 10:30:00','CS-IS/EEE-E&I','Component Based Software Architecture on Embedded Mobile Platforms','<ul>\r\n<li>Evolution of embedded system architecture: Mid/Late 90s (Limited memory, no heap), Early 2000s (increased memory, more processing power, filesystem) to where we are today (multimedia, desktop/mobile convergence, full blown OS support)</li>\r\n\r\n<li> Object Oriented programming and Embedded Systems: Are OO languages inefficient on embedded systems ?</li>\r\n\r\n<li> Component Based Software Architecture: Introduction, overview and advantages. (this part will be the main focus of the presentation). Will have code snippets in C++ to better explain various concepts.</li>\r\n</ul>\r\n\r\n<p>\r\nTarget Audience:\r\n\r\n3rd/4th year Comp Sci and Info Sys students.\r\n',25,'','/unb/forum.php?req=thread&id=20','1','',''),(29,'2006-09-24 10:00:00','MeE','SPC with Autocorrelated Process Data','With a brief introduction to statistical process control, the talk aims to discuss challenges faced while monitoring autocorrelated process and will introduce techniques for setting up monitoring schemes for the same.\r\n<p>\r\nPre-requisites: A basic course in probability and statistics',3,'','/unb/forum.php?req=thread&id=21','1','',''),(30,'2006-09-10 10:00:00','Bio','Regulatory T-cells and Autoimmunity','Naturally occurring Regulatory T-cells play a vital role in establishing tolerance to self constituents, with their dysfunction leading to Autoimmune pathology. Their ontogeny, signal transduction are the most popular area of Immunological research.  Understanding their function will aide the treatment of wide spectrum of diseases namely – Autoimmunity and Cancer.\r\nAll students with interest in Biology /Immunology are encouraged to attend.\r\n<p>\r\nPrerequisites: Basics in Immunology will be helpful',29,'','/unb/forum.php?req=thread&id=22','1','',''),(31,'2006-03-19 19:00:00','Gen','Power of the BITSAA Network for the BITSian Entrepreneur','Leverage the BITSAA network to create a forum for\r\n<ul>\r\n<li>Inspiring and training the next generation of BITSian Entrepreneurs\r\n<li>Finding business partners, advisors and investors\r\n<li>Tapping into BITSian talent \r\n<li>Providing investment opportunities\r\n</ul>',30,'','/unb/forum.php?req=thread&id=23','1','',''),(32,NULL,'MeE','Multivariate Control Charts',NULL,3,'',NULL,'1','',''),(33,'2006-11-19 09:00:00','MeE','Design of Experiments - Part 2',NULL,3,'','/unb/forum.php?req=thread&id=24','1','',''),(34,'2006-09-23 16:00:00','Bio','Mechanisms of Activation of Immune cell receptors','T cells and B cells are the main arms of the adaptive immune system in the body’s response to foreign pathogen invasion. The T cell antigen receptor (TCR) and the B cell antigen receptor (BCR) recognize foreign antigens, triggering signaling cascades with multiple outcomes, depending on the antigen. How these receptors transduce an extracellular ligand-binding event into intracellular signals is not clearly understood. I will discuss the different models of signal initiation by these receptors, with a focus on the structure of the TCR as a means to understanding its activation.\r\n<p>\r\nAll students with interest in Biology /Immunology are encouraged to attend.\r\n',31,'','/unb/forum.php?req=thread&id=25','1','',''),(35,NULL,'Bio','Signal Transduction and B-Cell Receptors',NULL,32,'',NULL,'1','',''),(36,'2006-11-25 08:30:00','Bio','Cost-effectiveness analysis using Markov modeling','Cost-effectiveness analysis (CEA), one of the mostly used study designs in Pharmacoeconomics. Markov modeling is commonly used to evaluate the impact of competing health care technologies including prescription drugs. This presentation is aimed at understanding.\r\n<li>What is Markov modeling and why do we need it?\r\n<li> What are some of the important concepts around Markov modeling?\r\n<li> How do we apply Markov modeling to answer research questions?\r\n<p>\r\nThis talk aims at acquainting the students interested in pursuing research/career in Pharmacy Practice, Pharmacoeconomics, Health Economics with research going on in this area.\r\nAll students with interest in Pharmacy, Management, Computer science, Biological sciences are encouraged to attend.\r\n',34,'','/unb/forum.php?req=thread&id=26','1','',''),(37,'2007-02-02 18:00:00','Gen','Grass Root Entrepreneurship (key elements) ','<ul>\r\n<li>Current Scenario:\r\n         The next twenty years are the most crucial of India. Opportunities are bright for entrepreneurs (Indians especially). The envirnment is most conducive to give yourself the best. No point compromising for 20k, 40k or 50k per month.\r\n<li>My experiences as a beginner\r\n</ul>',35,'','/unb/forum.php?req=thread&id=27','1','',''),(38,'2007-02-10 19:30:00','Gen','Overseas MBA – Why ?','<p>The talk will cover the following topics :</p>\r\n<ul>\r\n<li>Why should you consider doing a MBA abroad ?</li>\r\n<li>The differences between indian and foreign business schools.</li>\r\n<li>Information about top B schools.</li>\r\n<li>Different ways to prepare your MBA profile.</li>\r\n</ul>',36,'','/unb/forum.php?req=thread&id=28','1','LTC 5106','Pilani'),(39,'2007-02-11 19:30:00','Gen','Overseas MBA - How ?','<p>The talk will cover the following topics :</p>\r\n<ul>\r\n<li>How to prepare for an abroad MBA ?</li>\r\n<li>What to do on campus ?</li>\r\n<li>What to do off campus (professional career) ?</li>\r\n</ul>',37,'','/unb/forum.php?req=thread&id=29','1','LTC 5106','Pilani'),(40,'2007-02-11 20:15:00','Gen','The MBA experience','<p>MBA is a totally different experience. This talk will discuss the life during a MBA. It will also cover the different opportunities and options available after a MBA.</p>',38,'','/unb/forum.php?req=thread&id=30','1','LTC 5106','Pilani'),(41,NULL,'Bio','Stem Cell Epigenetics','This lecture will cover epigenetic controls in pluripotent stem cells – DNA and chromatin dynamics; X-chromosome inactivation and genomic imprinting in stem cell as well as  epigenetic reprogramming during somatic nuclear cell transfer and its implications for therapeutic cloning.',33,'',NULL,'1','',''),(42,'2007-03-16 17:30:00','Bio','Inside the Animal Cell Culture Laboratory','This lecture will cover the routine techniques used in an animal cell culture laboratory, using plenty of pictorial aids.  The aim is to give a virtual tour of the laboratory so that students who do not currently have access to one can get benefited.',33,'','/unb/forum.php?req=thread&id=31','1','',''),(43,NULL,'Bio','Genetic Engineering from the book to the bench','This talk is intended for those who are interested to know how the theoretical concepts learnt in textbooks can and actually do translate into technological aids for molecular biology research.  Some concepts to be covered include: Enzymes for better PCR; quick and easy cloning; transposon-based sequencing; recombineering.\r\n',33,'',NULL,'1','',''),(44,'2007-03-11 10:00:00','CiE','San Francisco Bay : Fluid Mechanics, Water Resources and Ecology','The initial part of the lecture will be given by Dr. Stephen G. Monismith ((PhD, University of California, Berkeley; PDF, University of Western\r\nAustralia). The talk will focus on several ecological and environmental issues pertaining to the effects of water resources use on the ecology of the San Francisco Bay. Several key concepts pertaining to the role of Fluid Mechanics in the environment will be introduced to the students. The lecture will also underline the need for understanding fundamental issues related to hydrology and fluid mechanics in order to develop strategies for environmental sustainability.',39,'','/unb/forum.php?req=thread&id=32','1','',''),(45,'2007-03-24 11:00:00','ChE','Performance Analysis and Trouble Shooting Of Industrial Process Control Loops.','',40,'','/unb/forum.php?req=thread&id=33','1','',''),(46,'2007-02-03 17:15:00','Gen','Wall Street Club : Start Off Lecture','',41,'','/unb/forum.php?req=thread&id=34','1','',''),(47,'2007-02-10 16:50:00','Gen','Finance as a Career Option',NULL,42,'','/unb/forum.php?req=thread&id=35','1','',''),(48,'2007-03-30 20:00:00','Gen',' Journey from BITS to the zenith of corporate excellence ','Vivek Paul takes a walk down memory lane , with an interactive session with the students of BITS, Pilani, covering anything and everything. Organised in collaboration with Wall Street Club, BITS , Pilani',43,'','/unb/forum.php?req=thread&id=36','1','',''),(49,'2007-04-02 19:30:00','Bio','The Mysteries of Plant Biochemistry ','The rhizosphere encompasses the millimeters of soil surrounding a plant root where complex biological and ecological processes occur. The work presented through the talk will describe the recent advances in elucidating the role of root exudates in interactions between plant roots and other plants, microbes, and nematodes present in the rhizosphere. Evidence indicating that root exudates may take part in the biochemical and cellular signaling events that initiate the execution of these interactions will also be discussed. Various positive and negative plant-plant and plant-microbe interactions will be highlighted and described from the molecular to the ecosystem scale.',44,'','/unb/forum.php?req=thread&id=37','1','',''),(50,'2007-03-15 21:00:00','Gen','Entrepreneurship-Food for thought',NULL,45,'','/unb/forum.php?req=thread&id=38','1','',''),(51,'2008-10-10 17:00:00','Chem/Bio/Pharma','Flow Cytometry and its application to medical diagnostics','Flow cytometry is a technology that simultaneously measures and then analyzes multiple physical characteristics of single particles, usually cells, as they flow in a fluid stream through a beam of light. The properties measured include a particle’s relative size, relative granularity or internal complexity, and relative fluorescence intensity. These characteristics are determined using an optical-to-electronic coupling system that records how the cell or particle scatters incident laser light and emits fluorescence. This technology is being used extensively in research and is the gold-standard for several critical diagnostic applications.  One such application is the enumeration of CD4+ T-Lymphocyte cells. These cells are a surrogate marker to monitor the progression of HIV infection. The objective of this talk is to provide a high-level introduction to flow cytometry and discuss the application of this technique in the enumeration of CD4+ cells.',82,'',NULL,'1','Pilani',''),(52,'2007-04-05 19:00:00','Gen','Hedge Funds: The 700 billion dollar industry','',47,'','/unb/forum.php?req=thread&id=39','1','',''),(53,'2007-04-17 20:00:00','ChE','Antibody Based Therapeutics and Applications','Antibodies play a very important role in the immune system. Their properties can also be exploited for therapeutic purposes. The talk will cover using antibodies and scFv\'s as therapeutics and some of the \"protein engineering\" strategies that can be applied to \"tune\" their properties. It will also cover the applications of these therapeutics and some basic techniques used to develop the same.',48,'','/unb/forum.php?req=thread&id=40','1','',''),(54,'2007-04-25 21:30:00','Gen','Core Values in building a sustainable business',NULL,49,'','/unb/forum.php?req=thread&id=41','1','',''),(55,'2007-04-22 21:00:00','Gen','Building micro-multinationals','In a connected business world of today, entrepreneurs are leveraging technology to build successful small companies which do global business. These are Micro-Multinationals and they could be started from any location in the world. The talk will discuss the characteristics of such companies and what it takes to build a successful Micro-Multinational.',50,'','/unb/forum.php?req=thread&id=42','1','',''),(56,'2007-08-19 10:30:00','CiE','Geographical Information Systems (GIS) and Network Analysis','Networks form a back bone of many infrastructures in our society. We commute from one place to another using transportation network. We communicate with each other using telecommunications network. This talk will focus on how such geo-spatial networks are represented in a Geographical Information Systems (GIS). The talk will focus about data modeling that enables the representation of such networks with in a GIS. \r\nIt will be very beneficial for people having background in Civil Engineering, Computer Science, Graphs and Theory and Optimization',51,'','/unb/forum.php?req=thread&id=43','1','',''),(57,'2007-09-09 10:30:00','Gen','Apping guidelines and fundamental Q&A on apping','This talk will cover all the information you need for applying to MS/PHD programs abroad.  You can ask you questions to a team of BITSians who have been there , done that. Target Audience is students who are apping this year.',52,'','/unb/forum.php?req=thread&id=44','1','5102-Pilani',''),(58,'2007-09-08 18:00:00','ChE','Computational approach to Catalysis','Density Functional Theory (DFT) calculations serve as a useful tool to understand the atomic and molecular structure and properties, as well as chemical reactivity on well-defined catalytic surfaces. They help to elucidate the mechanisms of complex chemical transformations and also to identify new reaction intermediates. Recently, these\r\ncalculations have also started to play an important role in the design of new and improved heterogeneous catalysts. This talk will first introduce some key concepts in DFT calculations. The synergism of DFT calculations, experiments, and microkinetic modeling for achieving better understanding of catalytic systems will then be described through examples of reactions related to hydrogen chemistry.',53,'','/unb/forum.php?req=thread&id=46','1','5103-Pilani',''),(59,'2007-09-07 18:30:00','CS-IS','Career options, Changing trends,Emerging Areas in CS and IS related fields',NULL,54,'','/unb/forum.php?req=thread&id=47','1','Goa',''),(60,'2007-08-20 21:30:00','Gen','Core Values in Building a Sustainable\r\nBusiness',NULL,49,'','/unb/forum.php?req=thread&id=41','1','Goa',''),(61,'2007-04-22 20:00:00','Gen','Apping for M.S./PhD.','',55,'','/unb/forum.php?req=thread&id=48','1','Classroom','Goa'),(62,'2007-04-14 20:00:00','Gen','Placements & Journey from BITS to BCG',NULL,56,'','/unb/forum.php?req=thread&id=49','1','Goa',''),(63,'2007-04-13 20:00:00','Gen','Demystifying the Common Admission\r\nTest(CAT)',NULL,57,'','/unb/forum.php?req=thread&id=50','1','Goa',''),(64,'2007-03-28 18:00:00','CS-IS/EEE-E&I','Programmable Software on Chip(PSOC)',NULL,58,'','/unb/forum.php?req=thread&id=51','1','Goa',''),(65,'2007-09-29 17:00:00','CiE','Traffic Engineering: Congestion Relief','Fueled by rapid economic development and  population explosion the demand for transportation has seen a steady upward surge over the last few decades. Construction of new highway capacity to accomodate this growth has not kept up pace resulting in a congested and over burdened transportation network.  \r\nIn 2003, it was estimated that the 85 largest metropolitan areas of the US experienced 3.7 billion vehicle-hours of delay, resulting in 2.3 billion gallons in wasted fuel and a congestion cost of $63 billion. Under these circumstances, what are some of the innovative techniques available to a transportation planner or traffic engineer? What are the lessons learnt so far? This talk will try to answer some of those questions. The speaker will also take questions regarding career options in the field of transportation \r\nengineering after the talk.',61,'','/unb/forum.php?req=thread&id=52','1','Pilani',''),(66,'2007-10-29 20:30:00','Gen','Entrepreneurship Part 1: Dream Big: Visualize and Realize!','<p>This is the first talk of a five talk series on Entrepreneurship at BITS Embryo. This series will talk about all aspect of entrepreneurship from creating and leading an organisation to marketing and services to finally end on exit strategies. This series is a must attend for all budding entrepreneurs.</p>',64,'','/unb/forum.php?req=thread&postid=67','1','5105','Pilani'),(67,'2007-11-02 20:30:00','Gen','Entrepreneurship Part 2: How and Where to Start?','<p>This is the second talk of a five talk series on Entrepreneurship at BITS Embryo. This series is a must attend for all budding entrepreneurs.</p>',64,'','/unb/forum.php?req=thread&postid=67','1','LTC 5106','Pilani'),(68,'2007-11-23 20:30:00','Gen','Entrepreneurship Part 3: Development of Product / Services','<p>This is the third talk of a five talk series on Entrepreneurship at BITS Embryo. This series will talk about all aspect of entrepreneurship from creating and leading an organisation to marketing and services to finally end on exit strategies. This series is a must attend for all budding entrepreneurs.</p>',64,'','/unb/forum.php?req=thread&postid=67','1','LTC 5106','Pilani'),(69,'2008-03-28 19:30:00','Gen','Entrepreneurship Part 4: Marketing and Product / Services Launch','<p>This is the fourth talk of a five talk series on Entrepreneurship at BITS Embryo. This series will talk about all aspect of entrepreneurship from creating and leading an organisation to marketing and services to finally end on exit strategies. This series is a must attend for all budding entrepreneurs.</p>',64,'','/unb/forum.php?req=thread&postid=67','1','5106','Pilani'),(70,'2008-04-13 20:30:00','Gen','Entrepreneurship Part 5: Growing the business and Exit Strategy','<p>This is the fifth talk of a five talk series on Entrepreneurship at BITS Embryo. This series will talk about all aspect of entrepreneurship from creating and leading an organisation to marketing and services to finally end on exit strategies. This series is a must attend for all budding entrepreneurs.</p>',64,'','/unb/forum.php?req=thread&postid=67','1','LTC 5106','Pilani'),(71,'2007-11-04 10:30:00','Gen','Remote Sensing At Its Extreme : The Interdisciplinary Nature of Observational Radio Astronomy ','<p>The lecture aims at answering the following questions:</p>\r\n<ul>\r\n<li>What is Radio Astronomy?</li>\r\n<li>What are the latest instruments in use?</li>\r\n<li>What goes into making them work?</li>\r\n<li>What are the technical challenges?</li>\r\n</ul>',66,'','','1','5106','Pilani'),(72,'2008-01-27 19:00:00','Phy',' A Primer on Gravitational Wave Astrophysics','<p>Gravitational waves are the bold prediction of Einstein\'s theory of General Relativity. They are produced as a result of the dynamics of massive bodies such as black holes and neutron stars. They are ripples in spacetime that carry energy, momentum and a tremendous amount of information about the source. This talk will present an introductory background and the usefulness of gravitational waves. We will also discuss current efforts to detect these waves and the open problems present in this emerging area of astrophysics.</p>',67,'','','1','5104','Pilani'),(73,'2008-03-29 17:00:00','Phy','Physics and Astrophysics using Neutrinos','<p>Neutrinos, \"the most tiny quantity of reality ever imagined by a human being\", as quoted by its co-discoverer Fedrik Reines, never ceased to puzzle physicists. Wolfgang Pauli introduced neutrino in 1930 as a desperate remedy to save the \"Law of Conservation of Energy\". It then took twenty seven long years to find the first experimental evidence for its existence. The reason for this long wait is its extreme reluctance to interact with matter. Over the last several decades, dedicated neutrino experiments around the globe have looked for neutrinos from the sun, from outer space, from interior of the earth and from man made activities. These experiments have answered many of the questions related to particle physics, astrophysics and even geophysics.</p>\r\n<p>In this talk the speaker will describe few of these experiments and their findings. He will also discuss the INO experiment and its physics</p>',68,'','','1','5101','Pilani'),(74,'2008-03-02 10:30:00','Gen','Investing Series Part I - Private Equity','',69,'','','1','5106','Pilani'),(75,'2008-03-08 19:30:00','Gen','Investing Series Part II - Derivatives and Structured Products','',70,'','','1','5105','Pilani'),(76,'2008-03-29 19:30:00','EEE-E&I','Feedback: Various Feedback topologies, Effect of feedback on noise, Distortion - Part I','',71,'','','1','LTC','Pilani'),(77,'2008-03-30 10:00:00','EEE-E&I','Feedback: Various Feedback topologies, Effect of feedback on noise, Distortion - Part 2','',71,'','','1','LTC','Pilani'),(78,'2008-04-05 19:30:00','EEE-E&I','Stability, Compensation','',71,'','','1','LTC 5106','Pilani'),(79,'2008-04-06 10:00:00','EEE-E&I','Stability ,Compensation','',71,'','','1','LTC','Pilani'),(80,'2008-08-24 18:00:00','Gen','BITS TO MS-PhD: Talk on Apping Guidelines','',72,'','','1','LTC 5106','Pilani'),(81,'2008-09-20 17:00:00','Gen','Financial Well Being of Young Adults','<p>The talk deals with various facets of handling one\'s own finances such as personal wealth management, risk management and investment, with focus being on the financial capability of young adults like various on-campus BITS students.</p>',74,'','','1','LTC-5105','Pilani'),(82,'2008-08-21 18:00:00','EEE-E&I','Wireless Data Networks','',75,'','','1','Room : 5105','Pilani'),(83,'2008-09-30 18:00:00','MeE','Modal Analysis, Theory, Experiments and Applications in New Product Development','<p>This talk is directed at all Mechanical Engineering students as well as faculty. The topic in general is also of relevance to Civil engineers.</p>',76,'','','1','5103','Pilani'),(84,'2008-09-28 11:00:00','Gen','Information Technology and Competitive Advantage','<p>Information Technology is all pervasive today. Irrespective of the industry, IT is used extensively by companies to give them an edge over their competitors. This lecture, which will be of interest to all students - Management students and also Technology students, will explain how the usage of IT has evolved in Corporations and will bring out with examples how companies use IT for competitive advantage.</p>',77,'','','1','5104','Pilani'),(85,'2008-10-05 17:00:00','CS-IS','Career Opportunities in Computer Graphics','<p>In this talk, the Speaker covers areas such as animation, visual effects and gaming, while giving a overview of the skillsets and career options in computer graphics.</p>',78,'','','1','5103','Pilani'),(86,'2008-10-07 17:00:00','Gen','How to get into Top B-Schools','<p>Though a handful graduates a decade ago, BITSians getting into top B-schools is on a rise during the past few years. MBA, considered the final immersive education experience for professionals, thrusts upon us an imperative and final chance to aim for the best institution that delivers the degree. The session aims at understanding what an MBA degree from a reputed Institution means, what the top B-schools look in a candidate, how to target such schools and finally his personal experiences.</p>',79,'','','1','LTC 5103','Pilani'),(87,'2008-10-09 18:00:00','CS-IS/EEE-E&I/Bio','An Introduction to Brain and Cognitive Science','<p>Disclaimer: This will NOT be an anatomy lecture!</p>\r\n<p>I will try answer a few of the following questions in my talk:<br /> 1. What do we know, for sure, about the brain ?<br /> 2. What do we not know yet ?<br /> 3. How can we find out more about the brain ?<br /> 4. What are the techniques used to find out more about the brain ?<br /> 5. Why study the brain ?</p>\r\n<p>Also,<br /> 1. How did I make a transfer from engineering to brain science ?<br /> 2. What is the role for engineers, mathematicians, physicists and biologists in this discipline ?<br /> 3. What do I do in my research ?</p>',81,'','','1','LTC 5106','Pilani'),(88,'2008-10-11 18:00:00','Gen','Demystifying Marketing\'s Role in an Enterprise','<p>Marketing is a one the key functions in the success of a firm and yet many have a hard time answering the question - \"What is marketing?\". Whether you are in engineering, operations, finance or sales it is very important to understand the role of marketing in your firm. This introductory lecture is designed to show how marketing helps create and enhance the value of a firm\'s product or service and to sell it to a buyer (customer) in exchange for substantial profits to the firm.</p>',83,'','','1','5103','Pilani'),(89,'2008-11-05 17:00:00','Gen','Consumer Psychology','',84,'','','1','LTC 5103','Pilani'),(90,'2008-11-14 20:00:00','ChE','Computational surface science and Catalysis','',85,'','','1','LTC 5106','Pilani'),(91,'2008-10-31 20:00:00','Phy/Math/EEE-E&I','Excitement of current Solar Physics research','<p>Sun is the nearest star that delivers energy to sustain life on Earth. Telescopes and instruments have been made to study Sun in various ways so that we can learn about its chemical composition and the physical processes that go on. Sun is a unique laboratory with which we are able to study nuclear fusion reactions, thermodynamics and magneto hydrodynamic (MHD) processes that can not be so easily duplicated on earth. Recent findings reveal that magnetic field plays a central role in determining the features on sun. Future research holds the promise for enhancing our understanding of the MHD engine that is operating on Sun.</p>',86,'','','1','LTC 5106','Pilani'),(92,'2008-11-12 21:00:00','Gen','The Mechanics of MBA Admissions','<p>About BITS2BSchool: We are a 1,900-strong group of BITS Pilani alumni who have set our sights on MBA degrees from the world\'s leading business schools. In the first year of existence, BITS2BSchool helped raise total admits to the worlds\' top b-schools by 50% in 2005, and hit a new admit record in 2006. We continue to assist prospective applicants by way of discussion forums, lecture series and application tips.We welcome all BITSians who wants to master the admissions process and get a coveted seat in their dream business school. This is valid for those applying to ISB, as well as IIM-A PGPX program since it uses the GMAT, and an Essay/GMAT application process.When you get waitlisted, or go for an interview, or are choosing between schools, we will as a group, advise you and help you along the way.</p>',36,'','','1','Multi-Location','Pilani,Goa, Dubai'),(93,'2009-02-01 10:00:00','Gen','Career choice in sales','<p>Does it really make a difference? It does. Life is mostly about sales, you have to sell your skills when interviewing for a job, once in a job you need to sell what you did that year during the appraisals to get on top of the ladder; once on the top you need to sell your product to your customers. If you have your own company, you need to be the best salesperson of the company.How do you do that, is it just about selling, is it about networking? To discuss more about the sales dynamics please join Mr Sudip Dutta for the session.</p>',88,'','','1','5106','Pilani'),(94,'2009-02-21 18:30:00','Gen','Why Germany for Higher Studies?','<p>Sub topics, dealt with during the session:- 1. Intro : Germany, University System, German people 2. Pros and Cons about Germany as a higher study destination with respect to : Finances, Technology, Academics,Cultural 3. Pre requisites for study 4. Short term and long term future in Germany 5. Work life balance 6. Importance of the german language 7. Germany is not the USA : How does it compare 8. Who should NOT come to Germany? 9. Other misc topics of interest : racism, social life etc</p>',89,'','','1','BITS-Pilani, Goa Campus (LC 101)','Goa'),(95,'2009-02-25 20:00:00','Math/Bio','Mathematical and Computational Modeling of Biological and Bio-inspired systems','<p>Abstract of the lecture:<br /> 1.A multidisciplinary talk involving various aspects of modeling in Biological systems and Bio-Inspired systems.<br /> 2.A brief introduction to some of the important Modeling problems and ways of tackling them<br /> 3.Opportunities in Mathematical Modeling at George Mason University</p>',90,'','','1','Pilani','Pilani'),(96,'2009-03-20 17:30:00','CS-IS','Data Storage Techniques and Networks','<p>This lecture covers such areas of data storage techniques and networks like file systems, storage subsystems, storage virtualization and data redundancy.</p>',92,'','','1','5105','Pilani'),(97,'2009-03-13 19:00:00','CS-IS','Computer Graphics - Art Meets Technology','<p>Sub topics dealt with:- -Career in CG -The basics of CG -CG implementation for Animation -CG implementation for Gaming -Skill sets -Job description</p>',93,'','','1','Classroom','Goa'),(98,'2009-04-06 19:00:00','CS-IS','Interactive Session on Computer Networking','<p>An interactive Q/A session on computer networking. Several queries ranging from OSI model to inter-disciplinary work being carried out in the field of networking and more were addressed. Students gained in-sights into the latest areas of research in the same fields.</p>',94,'','','1','LC 101 (Goa Campus)','Goa'),(99,'2009-01-15 18:00:00','Phy','Remote Sensing Techniques','<p>A basic informative session on the ongoing research in the field of remote sensing. The topic was dealt with, in a way to make it comprehendable to students of all years, disciplines and enthusiasts.</p>',95,'','','1','LC 101 (Goa Campus)','Goa'),(100,'2009-09-09 20:00:00','ChE','Crude Unit - An Overview','<p>The growing energy demand and declining crude quality have brought several issues in refining to the fore. The crude unit is the first important unit process in a refinery. This talk covers the current global situation in crude oil availability and the drivers of crude oil processing such as crude quality. It will also address crude unit operation and cover some of the common issues encountered in crude oil processing namely salt separation, fouling and corrosion. The intended audience is people interested in developing a basic understanding of crude unit operations. The talk will also cover a case study in corrosion. The talk is intended to give a flavor of these concepts and will not delve into technical details of how to optimize operation of a crude unit or the functioning of other units in a refinery.</p>',96,'','','1','LTC 5106','Pilani'),(101,'2009-10-15 17:00:00','Gen','PERSONAL WEALTH CREATION AND RISK MANAGEMENT (PWCRM)','<p>The presentation &ldquo;PERSONAL WEALTH CREATION AND RISK MANAGEMENT (PWCRM)&rdquo; covers: 1. Creating avenues of passive income through investment in Real Estate, Stock Market, Mutual Funds, etc. 2. Creating wealth in a Tax Efficient manner 3. Managing the avenues of passive income created 4. Understanding the financial and other risks associated with various types of investment. 5. Consolidating gains and striving for higher levels of success. 6. Covering the personal risks that each person is exposed to so that they emerge victorious even in the worst case scenario.</p>',74,'','','1','5104','Pilani'),(102,'2009-10-21 20:00:00','ChE','CFD Applications in Engineering','<p>Computational Fluid Dynamics Applications in Engineering</p>',97,'','','1','LTC 5101','Pilani'),(103,'2010-01-10 11:00:00','Gen','Online ads - Driving Innovations in Technology & Business','<p>The talk will first cover business model of online ads and then take you through details of technology in the ad serving engine. This is a high level talk and no prior knowledge of computer science or economics is needed.</p>',98,'','','1','5106 LTC','Pilani'),(104,'2009-08-08 13:24:29','Gen','Starting Off After College','<p>Shashikant, speaking from the United States, in a online lecture setup by the embryo group of BITS Pilani, started off by speaking about dreams. \"Dream and dream big\" he said, while illustrating how he started his first big venture. He smoothly shifted to talking about the importance of knowledge, \"Knowledge is Power\", he quoted the slogan of BITS Pilani. He also informed the audience that knowledge could also be dangerous sometimes, as knowing how hard it is to do something , could dissuade one from even trying - \"Ignorance is bliss\". (Organized by CEL, BITS Pilani and facilitated by BITS Embryo)</p>',1,'','','1','LTC','Pilani'),(105,'2010-03-18 01:08:24','Bio','Confluence of Medicine and Biology','',99,'','','1','BITS-Pilani, Goa Campus','Goa'),(106,'2010-04-05 18:00:00','Gen','Personal Wealth Creation and Risk Management','',74,'','','1','BITS Pilani, Goa Campus','Goa'),(107,'2010-04-08 18:00:00','Bio','Opportunities in Life Sciences – Ideas to Implement','',100,'','','1','BITS Pilani, Goa Campus','Goa'),(108,'2010-08-27 18:00:00','CS-IS','Starting a Web 2.0 Startup using Open Source technologies','',15,'','','1','BITS Pilani,Goa campus','Goa'),(109,'2010-09-24 18:15:00','Gen','How to get into the Best universities across the World','',101,'','','1','BITS Pilani,Goa campus','Goa'),(110,'2010-10-03 21:00:00','Gen','MS/PhD - A Primer on Applying for Graduate Studies','<p>Soumyadeep Ghosh(2006A7PS018P) 2010-BITS Pilani Pass-out is currently pursuing his PhD at Princeton University. He holds interests in Computer Systems - Compilers and Operating Systems, Parallel Computing</p>',102,'/Speakerphotos/SG.jpg','','1','LTC 5102','Pilani'),(111,'2010-10-16 14:00:00','MeE','KFP A unique solution to water crisis.','<p>KFP (Patented) can provide Ample water to Agriculture fields &amp; thirsty Villages of India at a very Low cost &amp; simultaneously reduce our Environmental Footprint.</p>',103,'/Speakerphotos/kedia.jpg','','1','LTC 5101','Pilani'),(112,'2011-01-30 18:00:00','EEE-E&I','Computer Architecture: an Insight into the Fundamentals','<p>Computer Architecture is a complex discipline blending the intricate knowledge of electronics [VLSI circuit design] with higher abstraction of computer science [Operating Systems with parallel computing]. This talk is intended to highlight the importance of this discipline and future research trends both at Stanford University and the current industry. The main objective is to clearly illustrate the basics of any processor: parallelism, pipelining, indirection, amortization, out of order processing, implicitness of Amdahl&rsquo;s law, multi core along with their application in solving complex architectural issues. Furthermore, architectural models like Superscalar, Deep Pipeline, GPU, SIMD will be touched on during the course of the talk. A small section at the end is dedicated to explaining practical synthesis issues in VERILOG coding and common blunders committed by higher level programmers.</p>',116,'/Speakerphotos/karthika.jpg','','1','LTC 5103','Pilani'),(113,'2010-09-24 21:00:00','Bio','Changing the Point..','<p>The talk initially put light upon the condition of Syringe use in developing countries like India and even in developed countries like China. It also highlighted many social aspects involved. It later focused on the the solution that Marc finally arrived at after a great struggle : The disposable Syringe</p>',105,'/Speakerphotos/koska.jpg','','1','LTC 5101','Pilani'),(114,'2010-09-26 21:00:00','Bio','Is smell a quantum phenomenon?','',106,'','','1','LTC 5101-Pilani','Pilani'),(115,'2010-09-18 21:00:00','Bio','Molecular basis of Amyloid diseases','The lecture featured in detailed the Molecular basis of Amyloid Diseases',107,'',NULL,'1','','Pilani'),(116,'2010-09-17 20:30:00','Gen','A talk on Hadoop Map Reduce by Madhur Khandelwal','<p>The talk focused on general introduction on Hadoop and Map Reduce Techniques</p>',108,'','','1','LTC 5106','Pilani'),(117,'2010-11-09 15:00:00','Gen','Optimal Decision Making in Real Time','<p>The talk centred on the following:</p>\r\n<ul>\r\n<li>Effective retail management systems</li>\r\n<li>Merchandise optimisation (Inventory management)</li>\r\n<li>Customer relationship management</li>\r\n<li>Supply chain management</li>\r\n</ul>',109,'/Speakerphotos/subhash.jpg','','1','LTC 5103 Pilani','Pilani'),(118,'2010-11-10 18:00:00','Gen','Change Your Life','<p>The Talked focussed on: &middot;Communication skills &middot;Mindset development &middot;High EQ &ndash; A competitive advantage &middot;Tips for GD, interviews &middot;Group dynamics</p>',110,'','','1','LTC 5101 Pilani','Pilani'),(119,'2010-11-15 18:00:00','EEE-E&I','Singlet exciton fission in Organic Semiconductor Photovoltaics','<p>Stacked multijunction organic solar cells exhibit higher efficiencies than devices with a single active layer. But each cell in the multijunction must satisfy current matching constraints, and the complete device can be challenging to fabricate, especially using solution-processing. Here, we demonstrate that singlet exciton fission in organic molecules promises single-layer organic solar cells with efficiencies beyond the single junction limit. We report solar cells comprised of tetracene, copper phthalocyanine and the buckyball C60. Short wavelength light generates singlet excitons in tetracene. These are subsequently split into two triplet excitons and transported to the junction via the phthalocyanine. In addition, the phthalocyanine contributes to the photocurrent by absorbing longer wavelengths.We measure a singlet fission efficiency of (71&plusmn;18)% in 2-nm-thick films of tetracene, and comparable singlet fission efficiencies in tetracene-C60 blends,demonstrating that exciton fission is compatible with blended, single-layer devices, and potentially enabling low cost, higher efficiency organic solar cells.</p>',111,'/Speakerphotos/priya.jpg','','1','LTC 5101','Pilani'),(120,'2011-01-29 16:30:00','Phy','Molecular Motors: Marvellous Nanomachines of Nature','<p>Molecular motors are remarkable proteins designed by nature. Some of them use energy from electrical gradients to make ATP, while others actually &ldquo;walk&rdquo; around inside cells of your body using the same ATP as an energy source. They are essential for every conceivable biological process, and therefore for us to be alive. These machines generate tiny pico-Newton forces to do work on the scale of nanometers. There is tremendous interest in unraveling the secrets of such robust nanomachines, and perhaps building some of our own in the future. The talk would also focus Dr Mallik\'s recent experiments to measure the forces applied by these Motors inside living cells.</p>',117,'/Speakerphotos/roopmalik.jpg','','1','LTC 5103','Pilani'),(121,'2011-03-01 20:00:00','Bio','Prospects for defeating Aging altogether','<p>It may seem premature to be discussing the elimination of human aging as a cause of death, when so little progress has yet been made in even postponing it. However, two facts undermine this assessment. The first is that aging happens throughout our lives but only causes ill-health after middle age: this shows that we can postpone that ill-health without knowing how to prevent aging completely, but instead by molecular and cellular repair. The second is that the typical rate of subsequent, incremental refinement of big technological breakthroughs is usually fast enough (so long as public enthusiasm for them is strong) to change those technologies almost beyond recognition within a natural human lifespan. In this talk I will explain, first, why therapies that can add 30 healthy years to the remaining lifespan of typical 60-year-olds may well arrive within the next few decades, and, second, why those who benefit from those therapies will very probably continue to benefit from progressively improved therapies indefinitely and will thus avoid debilitation or death from age-related causes at any age.</p>',118,'/Speakerphotos/aubreydegrey.jpg','','1','LTC 5103','Pilani'),(122,'2011-02-12 20:00:00','CS-IS','From Object Recognition to Object Categorisation - Trends in Image Search Techniques','<p>The talk throws light on certain basic techniques of Image Processing and Recognition. The speaker shall also elaborate on some of the new techniques in this arena that have become a part of his Research. Video Analysis and Content Extraction (VACE) alogorithms and Image Search Techniques are also a part of the lecture.</p>',119,'/Speakerphotos/IP.jpg','','1','LTC 5103 ','Pilani'),(123,'2011-02-19 20:00:00','Eco/Fin','Global Finance in the 21st Century: A Practitioner\'s Perspective','<p>Recent developments in the world of finance have left many established theories redundant, changed the rules of the game, and re-converted financial sector &ldquo;experts&rdquo; into &ldquo;students&rdquo;. In this dynamic and fluid context, this lecture will aim to introduce future leaders and participants of the financial world about some of the real-world applications of finance; help them better understand the various emerging financial paradigms in the wake of the global financial crisis; and last but not least, instill in them a sense of passion for the fascinating world of finance.</p>',120,'/Speakerphotos/finance.jpg','','1','LTC 5103','Pilani'),(124,'2009-08-20 18:00:00','Gen','Bit by the Entrepreneurship Bug','<ul>\r\n<li>Learning from failures</li>\r\n<li>Taking risks</li>\r\n<li>Any big problem is a big opportunity</li>\r\n</ul>',130,'/Speakerphotos/vinodkhosla.jpg','','1','LTC','Pilani,Goa'),(125,'2009-08-25 18:00:00','Gen','Idea to Opportunity - Market Analysis & Segmentation','<ul>\r\n<li>Idea vs. Opportunity</li>\r\n<li>Understanding target customer</li>\r\n<li>Identifying target markets and market segments</li>\r\n<li>Sizing your market</li>\r\n<li>Market analysis vs. marketing</li>\r\n</ul>',131,'/Speakerphotos/prasannakrishnan.jpg','','1','LTC','Pilani,Goa'),(126,'2011-03-05 20:00:00','Gen','ABC of Design Engineering','<p>Designers help conceive and shape products and services; they contribute hugely to the visual world around us; they create communications for organisations of all shapes and sizes; they influence how we use buildings and help improve our workspaces; they can contribute to building better public services or create more efficient working processes; they create the interfaces we use daily on digital devices; they help us digest information; they create the clothes you&rsquo;re wearing and the chair you may be sitting on, the iPod or the mobile phone that you are using.</p>\r\n<p>So is design for you?</p>\r\n<p>How do you become a designer?</p>\r\n<p>Why design after engineering?</p>\r\n<p>Design and innovation the need of the decade.</p>\r\n<p>The talk will cover what design is all about (with specific reference to industrial design), what a designer does, which are the design schools in India for post-gradwork, and the future of design (specially in India). A couple of case studies will also be shown via the PPT.</p>',126,'/Speakerphotos/amitsheth.jpg','','1','LTC 5104','Pilani'),(127,'2011-03-03 20:00:00','Phy','Loop Quantum Spacetime Probing the Microcosm','<p>What is space? What is time? What is spacetime? Where is it convenient to treat time as the fourth dimension? Why is it that this radical notion so popularized in the twentieth century physics no longer useful? What happens when Geometry meets the Quantum? These are the questions that confront us the moment we probe Loop Quantum &lsquo;Spacetime&rsquo;. But why at all would one set out to do so? The motivation is present even in elementary physics. Take for example Newton&rsquo;s first law, &ldquo;rest is equivalent to uniform motion&rdquo;, turn it around and ask, &ldquo;what is the equivalent of non-uniform motion?&rdquo; Newton has no answer to it. Einstein answered it by stating that locally, it is the gravitational field. And how is that so? Because, locally, no experiment can tell the difference. In like manner, intriguing answers emerge by posing questions of Quantum Mechanics; more when we combine it with Special Relativity and yet more when we attempt to reconcile General Relativity and Quantum Mechanics to arrive at Loop Quantum Gravity. If Special Relativity unifies space and time into spacetime, Loop Quantum Gravity abolishes first, time and then, space. There remain only relations among objects described by the formalism of an abstract network. At a fundamental level, time and space then are no longer useful concepts. And that is just the tip of the iceberg. In this talk we probe the fascinating interplay of concepts and theories that constitute Loop Quantum Gravity.</p>',127,'/Speakerphotos/loopgravity.jpg','','1','LTC 5104','Pilani'),(128,'2011-03-06 17:15:00','Eco/Fin','Personal Wealth Creation and Risk Management (PWCRM)','<p>The presentation covers:</p>\r\n<p>1. Creating avenues of passive income through investment in Real Estate, Stock Market, Mutual Funds, etc.</p>\r\n<p>2. Creating wealth in a Tax Efficient manner</p>\r\n<p>3. Managing the avenues of passive income created</p>\r\n<p>4. Understanding the financial and other risks associated with various types of investment.</p>\r\n<p>5. Consolidating gains and striving for higher levels of success.</p>\r\n<p>6. Covering the personal risks that each person is exposed to so that they emerge victorious even in the worst case scenario.</p>',128,'/Speakerphotos/anandagarwal.jpg','','1','LTC 5103','Pilani'),(129,'2009-08-18 18:00:00','Gen','Why Entrepreneurship?','<ul>\r\n<li>Entrepreneurship as a career</li>\r\n<li>What it takes to be an entrepreneur</li>\r\n<li>Impact as an entrepreneur</li>\r\n</ul>',143,'/Speakerphotos/anuragjain.jpg','','1','LTC','Pilani,Goa'),(130,'2009-08-11 18:00:00','Gen','Course Overview & Objectives of New Ventures Course','<ul>\r\n<li>What is Sparks New Ventures?</li>\r\n<li>Overview of Course Syllabus</li>\r\n<li>Review assignments</li>\r\n<li>Individual &amp; Team expectations</li>\r\n<li>Managing Mentor &ndash; Mentee Relationship</li>\r\n<li>Seed Funding &ndash; Size &amp; Criteria</li>\r\n</ul>',129,'/Speakerphotos/abhinavkhushraj.jpg','','1','LTC','Pilani,Goa'),(131,'2009-09-03 18:00:00','Gen','Building the Startup Team','<ul>\r\n<li>Understanding your strengths and gaps</li>\r\n<li>Common selection criteria</li>\r\n<li>How to attract, organize, inspire, motivate talent</li>\r\n<li>Creating an innovative culture</li>\r\n<li>Compensation and stock</li>\r\n<li>Advisory board</li>\r\n</ul>',132,'/Speakerphotos/nickhiljakatdar.jpg','','1','LTC','Pilani,Goa'),(132,'2009-09-08 18:00:00','Gen','Competition','<ul>\r\n<li>Business models and pricing approaches as a startup</li>\r\n<li>Differences across industries viz. hi-tech, life sciences, clean tech etc.</li>\r\n</ul>',133,'/Speakerphotos/bobmeese.jpg','','1','LTC','Pilani,Goa'),(133,'2009-09-18 18:00:00','Gen','Lean Startups','<ul>\r\n<li>New rules for a building successful start-ups</li>\r\n<li>Being lean in product development, strategy, marketing &amp; financing</li>\r\n<li>Discover the business before scaling the business</li>\r\n</ul>',134,'/Speakerphotos/sephskerritt.jpg','','1','LTC','Pilani,Goa'),(134,'2009-09-22 18:00:00','Gen','Product Development','<ul>\r\n<li>Product definition</li>\r\n<li>Product differentiation</li>\r\n<li>Assessing technical risks</li>\r\n<li>Product plan and timelines for major milestones</li>\r\n<li>Development resources required to complete design, specification and production</li>\r\n</ul>',135,'/Speakerphotos/ajaykulkarni.jpg','','1','LTC','Pilani,Goa'),(135,'2009-09-25 18:00:00','Gen','Intellectual Property','<ul>\r\n<li>Intellectual property and the various categories</li>\r\n<li>Government regulations at the global, country and regional level</li>\r\n<li>IP issues across industry verticals</li>\r\n</ul>',136,'/Speakerphotos/aniladvani.jpg','','1','LTC','Pilani,Goa'),(136,'2009-10-06 18:00:00','Gen','Sales & Marketing','<ul>\r\n<li>Entrepreneur as a sales person &ndash; developing sales skills</li>\r\n<li>Defining market strategy (positioning, promotions etc.)</li>\r\n<li>Sales strategy</li>\r\n</ul>',137,'/Speakerphotos/diaznesamoney.jpg','','1','LTC','Pilani,Goa'),(137,'2009-10-09 18:00:00','Gen','Business Models','<ul>\r\n<li>Obtaining capital &ndash; how to do it; and what investors are really looking for</li>\r\n<li>Options: Bootstrapping vs. angels vs. VCs</li>\r\n<li>How much to raise, when to raise</li>\r\n</ul>',138,'/Speakerphotos/vtbharadwaj.jpg','','1','LTC','Pilani,Goa'),(138,'2009-11-06 18:00:00','Gen','Financing (Bootstrapping, Angel, VC)','<ul>\r\n<li>Profiling competitors (revenues, growth, team, partnerships, investors, patents)</li>\r\n<li>Understand their target markets</li>\r\n<li>Advantages and shortcomings of their product</li>\r\n<li>Identifying your differentiation</li>\r\n</ul>',139,'/Speakerphotos/rahulchandra.jpg','','1','LTC','Pilani,Goa'),(139,'2009-11-10 18:00:00','Gen','Launching a Business - First 100 days','<ul>\r\n<li>Getting off the ground</li>\r\n<li>Creating a culture</li>\r\n<li>Core values</li>\r\n<li>Name, logo, identity, web site, office space etc. etc.</li>\r\n</ul>',140,'/Speakerphotos/anandmorzaria.jpg','','1','LTC','Pilani,Goa'),(140,'2009-11-13 18:00:00','Gen','Growth & Exit Strategies','<ul>\r\n<li>Different stages of growth &ndash; from founder&rsquo;s team to a scaled company</li>\r\n<li>Challenges and decisions to be taken as an entrepreneur</li>\r\n<li>Liquidity events</li>\r\n</ul>',141,'/Speakerphotos/rajureddy.jpg','','1','LTC','Pilani,Goa'),(141,'2009-11-17 18:00:00','Gen','Social Entrepreneurship','<ul>\r\n<li>What is social entrepreneurshipTypes of social entrepreneurship</li>\r\n<li>Differences from other kinds of entrepreneurship</li>\r\n</ul>',142,'/Speakerphotos/taniaaidrus.jpg','','1','LTC','Pilani,Goa'),(142,'2009-08-27 18:00:00','Gen','Creating & Presenting a Pitch','<ul>\r\n<li>Understanding your strengths and gaps</li>\r\n<li>Common selection criteria</li>\r\n<li>How to attract, organize, inspire, motivate talent</li>\r\n<li>Creating an innovative culture</li>\r\n<li>Compensation and stock</li>\r\n<li>Advisory board</li>\r\n</ul>',129,'/Speakerphotos/abhinavkhushraj.jpg','','1','LTC','Pilani,Goa'),(143,'2011-04-03 20:00:00','Eco/Fin','Talk on technological Startups in BITS','<p>How often do you find an EEE graduate doing his MBA from IIM A, and postgraduate from London school of Economics and simultaneously have launched 8 start-ups. Meet Mr. Suhail Kassim, BITS alumni of 2001 batch and an employee of World Bank talking to the BITSians about:</p>\r\n<ul>\r\n<li>Why it is good for BITSian engineers to go for start-ups rather than joining a job?</li>\r\n<li>Why success rate of BITSian start-up is way above the average?</li>\r\n<li>How to identify resources at your disposal (alumni, infrastructure) and use them to build upon your idea to convert them into a successful business.</li>\r\n</ul>',120,'/Speakerphotos/suhail.jpg','','1','LTC 5103','Pilani'),(144,'2011-04-06 17:00:00','MeE','KFP-Rainwater Harvesting Technique','<p>KFP i.e. Kedia Farm Pattern is an amazing rain water harvesting technology invented by an Indian Scientist Mr. Vijay Kedia. that can harvest upto 80% rainwater underground, contrary to other RWH technologies which can store only upto 18% rainwater above ground which is open to evaporation. KFP is a single solution to many major problems related to agriculture as well as social. The returns from KFP are innumerable, to name a few :</p>\r\n<ul>\r\n<li>Solution for Drought</li>\r\n<li>Solution for Floods</li>\r\n<li>Saves Electricity i.e. Saves Carbon Emissions</li>\r\n<li>Increases Crop Production</li>\r\n<li>Limits the use of chemical fertilizers</li>\r\n<li>Stops Soil Erosion</li>\r\n</ul>\r\n<p>The above were only to name a few. The talk will reveal to you that how a simple innovation can become the &lsquo;next big thing&rsquo;.</p>',103,'/Speakerphotos/kedia.jpg','','1','LTC 5103','Pilani'),(145,'2011-04-09 20:00:00','Bio','Matrix Engineering Technologies for Biomimetic Regeneration andRepair of Elastic Fiber Networks','<p>This talk will detail the speaker\'s efforts to regenerate vascular elastic fibers and fiber networks in vitro and in vivo. The extracellular matrix (ECM) within native blood vessels, and indeed other soft tissues, consist predominantly of cross-linked elastin and collagen structures that contribute to vessel elasticity and stiffness respectively and critically regulate cell behavior. The congenital absence or malformation, or accelerated pathological disruption and loss of vascular elastic structures within blood vessels can severely compromise vascular homeostasis. Unfortunately, faithful in situ elastic matrix regeneration and repair, and fabrication of engineered elastic tissue replacements in vitro are challenged by (a) the spatio-temporal complexity of the elastic matrix assembly process, which renders it difficult to replicate, and more critically, (b) attenuated tropoelastin mRNA expression by post-neonatal cells. To address these limitations, we seek to evaluate novel ECM-based molecules that will provide elastogenic cues and may be presented together with appropriate scaffolding biomaterials that can up-regulate elastin synthesis and regenerate biologically and ultrastructurally faithful mimics of native elastic matrices on demand. This talk will provide an overview of our ongoing efforts and future plans to regenerate elastic matrices by identifying and integrating appropriate tissue engineering tools (e.g., growth factor cocktails, biomaterial scaffolds, cell sources, dynamic culture systems) to (a) up-regulate elastin precursor synthesis by seeded or recruited cells, (b) recruit, assemble, and crosslink these precursors into stable matrix structures, (c) replicate the architectural facets of native elastic matrices (e.g., fiber formation, preferred orientation, meshing), and (d) stabilize these matrices against physiologic or pathologic breakdown. It is expected that our elastic matrix engineering technologies will be useful to (a) augument elastin synthesis, assembly, and maturation by healthy patient-derived cells within tissue engineered constructs and thus manufacture faithful mimics of native elastin on demand, and (b) regress elastin- compromised tissues (e.g., in abdominal aortic aneurysms) to a healthy state by coaxing diseased cell-mediated regenerative repair of elastic matrix.</p>',144,'/Speakerphotos/anandram.jpg','','1','LTC 5103','Pilani'),(146,'2011-04-06 17:00:00','MeE','KFP-Rainwater harvesting technique','',103,'','','1','LC101','Goa'),(147,'2011-04-16 20:00:00','Eco/Fin','New venture financing and risk management','<p>How often do you find an EEE graduate doing his MBA from IIM A, and postgraduate from London school of Economics and simultaneously have launched 8 start-ups. Meet Mr. Suhail Kassim, BITS alumni of 2001 batch and an employee of World Bank talking to the BITSians from the point of view of both the entrepreneur and investor about:</p>\r\n<ul>\r\n<li>Quick revision of business plan, financial and funding plan</li>\r\n<li>Stages and types of financing</li>\r\n<li>Types and sources of capital</li>\r\n<li>Due diligence</li>\r\n<li>Valuation</li>\r\n<li>Negotiations</li>\r\n<li>Introduction to important documents: Non-Disclosure agreements, Information memoranda, Term sheets, MoU, Agreement</li>\r\n<li>Ownership and control issues</li>\r\n<li>Managing risks</li>\r\n<li>Exit strategies</li>\r\n</ul>',120,'/Speakerphotos/suhail.jpg','','1','LTC 5103','Pilani'),(148,'2011-08-25 18:00:00','EEE-E&I','Introduction to Computer Architecture','',116,'','','1','LTC 5102','Goa'),(149,'2011-09-04 18:00:00','Eco/Fin','Harvard Business School 2+2 Program: BITsian Perspective','<ul>\r\n<li>What is the HBS 2+2 Program?</li>\r\n<li>How is this different from the HBS MBA?</li>\r\n<li>Should you apply to HBS 2+2?</li>\r\n<li>The HBS 2+2 Application process</li>\r\n<li>My experience applying to the HBS 2+2 and the BITSian advantage</li>\r\n<li>What after 2+2?</li>\r\n</ul>',145,'/Speakerphotos/vidyashankar.jpg','','1','LTC','Pilani,Goa,Hyderabad'),(150,'2011-08-19 17:00:00','Phy','Quantum Mechanics From A Geometric Viewpoint','<p>Geometric aspects of quantum mechanics, quantization and quantum dynamics</p>',146,'/Speakerphotos/Vasudevshyam.jpg','','1','LTC 5106','Pilani'),(151,'2011-08-18 17:00:00','Gen','General law for start ups- Contract, employment, IP, company','<p>The presentation aims to provide exposure to general laws applicable to a business in India with a view to give clarity and quality in decision-making.</p>',147,'/Speakerphotos/Naveengoyal.jpg','','1','LTC','Pilani'),(152,'2011-09-10 20:30:00','EEE-E&I','Analysis of RC Circuits and basics of Circuit Theory','<p>Fundamentals &amp; analysis of R-C Circuits.</p>\r\n<ul>\r\n<li>Overview on some of the intuitive methods to look at Circuits, and analyze them.</li>\r\n<li>Time &amp; frequency domain concepts needed in order to emphasize any R-C circuit.</li>\r\n</ul>',148,'/Speakerphotos/Santhoshkasavajjala.jpg','','1','LTC 5106','Pilani'),(153,'2011-10-01 20:00:00','Gen','MS/PhD - A Primer on Applying for Graduate Studies','<p>The talk centers on the MS/PhD application process and aims to talk about the following:</p>\r\n<ul>\r\n<li>Basic components of Apping like GRE,SOP,Resume etc.</li>\r\n<li>Supplementing the application with other components</li>\r\n<li>Breaking some myths like low CGPA, no aid, MS vs PhD etc.</li>\r\n<li>Statistics on how BITSians perform</li>\r\n<li>Common mistakes which BITSians make</li>\r\n<li>What resources can you make use of which are specific to BITSians</li>\r\n</ul>',150,'/Speakerphotos/Dhruvbalwada.jpg','','1','LTC 5106','Pilani'),(154,'2011-10-06 20:15:00','EEE-E&I','The Story of the Transistor','<ul>\r\n<li>Basic characteristics of some devices like diodes and transistors would be discussed from a designer&rsquo;s perspective.</li>\r\n<li>Also, a brief history of the IC World would be covered to motivate the need for Analog VLSI Design.</li>\r\n</ul>',151,'/Speakerphotos/Rakulviswanath.jpg','','1','LTC 5106','Pilani'),(155,'2011-10-08 20:30:00','EEE-E&I','Analysis of MOS Amplifiers','<ul>\r\n<li>Introduction to MOS amplifier types and circuit topologies.</li>\r\n<li>Low frequency analysis of various amplifier types and their small signal parameters.</li>\r\n</ul>',148,'/Speakerphotos/Santhoshkasavajjala.jpg','','1','LTC 5106','Pilani'),(156,'2011-10-13 20:30:00','EEE-E&I','The Common Source Amplifier','<ul>\r\n<li>MOSFET characteristics</li>\r\n<li>Load line of the CSA</li>\r\n<li>Small-signal analysis of the CSA</li>\r\n</ul>',151,'/Speakerphotos/Rakulviswanath.jpg','','1','LTC 5106','Pilani'),(157,'2011-10-15 20:30:00','EEE-E&I','Stability of Circuits','<ul>\r\n<li>Basics of frequency resonse of circuits and analysis of stability.</li>\r\n<li>The introduction of poles/zeroes and intuitive approach to find them.</li>\r\n</ul>',148,'/Speakerphotos/Santhoshkasavajjala.jpg','','1','LTC 5106','Pilani'),(158,'2011-10-15 16:30:00','Gen','Youth Leadership Through Teaching','<ul>\r\n<li>TEACH FOR INDIA - One day all children will attain an excellent education www.teachforindia.org</li>\r\n<li>The perfect chance for you to make a lasting difference in India\'s education along with gaining world-renown leadership experience!!</li>\r\n</ul>',152,'','','1','LTC 5106','Pilani'),(159,'2011-10-15 16:30:00','Gen','Youth Leadership Through Teaching','<ul>\r\n<li>TEACH FOR INDIA - One day all children will attain an excellent education www.teachforindia.org</li>\r\n<li>The perfect chance for you to make a lasting difference in India\'s education along with gaining world-renown leadership experience!!</li>\r\n</ul>',153,'','','1','LTC 5106','Pilani'),(160,'2011-10-16 20:00:00','Gen','Pre - MBA options for fresh graduates','<ul>\r\n<li>For those who have the motivation and desire to build a strong foundation for a career in business.</li>\r\n<li>About programs such as LBS MiM, Duke MiM, HEC MiM,YIF etc</li>\r\n<li>Options available, the applying process, the profiles usually selected etc</li>\r\n</ul>',154,'/Speakerphotos/Sauravpatyal.jpg','','1','LTC 5106','Pilani'),(161,'2011-11-09 20:00:00','Bio','Living Color:  Exploring the Evolution and Meanings of Human Skin Color','<p>Skin colour is one of the most obvious ways in which people vary, and has been used in the past as a basis for the biological classification of humans into races. Our research work and that of many other groups have demonstrated that skin pigmentation is a biological adaptation that regulates the penetration of ultraviolet radiation (UVR) into the skin. Skin pigmentation is an evolutionary compromise between the conflicting demands of protection of the skin against UVR and of production of vitamin D by UVR. This compromise represents one of the best examples of evolution by natural selection acting on the human body. In the history of the genus Homo and of our species, Homo sapiens, skin pigmentation has been a highly labile trait. Similar skin tones have evolved independently numerous times in response to similar environmental conditions. Because of this, skin colour is an inappropriate basis for the classification of humans into groups. This lecture will also explore the ramifications of skin pigmentation for health, social well-being, and social interactions.</p>',155,'/Speakerphotos/Ninajablonski.jpg','','1','LTC','Pilani'),(162,'2012-02-10 20:00:00','EEE-E&I','Cryptography','<p>Cryptography -- the art of secret writing -- continues to play an increasing role in computers and communication. Crypto, however, is not widely understood due to the perception that it is \"hard.\" This lecture will define the role of cryptography in secure communications, and will introduce basic terms and concepts. An overview of basic cryptographic functions (e.g., transposition and substitution), algorithm types (e.g., hash functions, and secret and public key systems), and methods of cryptanalysis (e.g., brute force, known plaintext, chosen plaintext, and power analysis) will be presented, along with an explanation of how they work together and the relationship between key length and crypto strength. Public key certificates will also be described. Current issues, such as hash collisions, will also be explored. Examples of cryptosystems such as the Encrypting File System (EFS), Pretty Good Privacy (PGP), Whole Disk Encryption (WDE), and the Secure Sockets Layer (SSL) will be presented, time permitting.</p>',156,'/Speakerphotos/gary.jpg','','1','LTC 5106','Pilani'),(163,'2012-04-12 20:00:00','CS-IS','E-Business for Business','<p>E-Business is increasingly becoming a very important application of the Internet today.This talk will decribe the evolution of E-Business with a perspective of it being an application beyond ERP.The talk will also describe emerging trends in applications of social networks , mobiles as well as technologies such as \"Augmented Reality\" and their applications in business.The talk will be of interest to all students.</p>',157,'/Speakerphotos/nilay-yajnik.jpg','','1','LTC 5106','Pilani'),(164,'2012-03-22 21:00:00','Gen','Designing technology for musicians and music listeners','<p>The talk focuses on:</p>\r\n<ul>\r\n<li>Brief history of computer music and areas of music research.</li>\r\n<li>Research in Music applications at MITS Media Labs.</li>\r\n<li>Design principles and programming paradigms that are used in music technology.</li>\r\n<li>Applications and tools to help you get started on building your own interactive music application.</li>\r\n</ul>',158,'/Speakerphotos/Sarkar,Mihir_Profile.gif','','1','LTC 5106','Pilani'),(165,'2012-04-10 20:00:00','Bio','Sustainable Body Movement 24/7 for the 21st Century Lifestyle','<p>The interactive program will also give you a nonverbal vocabulary of body movement.<br /> You will learn how the body works, and what to do and not do when sitting, standing, walking, bending, lifting, reaching, twisting, or sleeping.<br /> You will be given stress-reducing exercises that can be employed in public or private.<br /> In short, your relationship with your body will change.<br /> You will be in charge.<br /> And when you are in charge the &ldquo;bad&rdquo; stress dissipates, and even disappears.</p>',159,'/Speakerphotos/eva.jpg','','1','LTC 5106','Pilani'),(166,'2012-04-20 20:00:00','Gen','The attractions of GHOTing after Graduating -Why BITS to MS/PhD!','<p>Why should you (or should you not) apply to Grad School (MS/PhD)? And if you\'ve decided that Grad School is your next step after BITS-P, how do you go about the tiring yet rewarding process of \'App\'ing?</p>',160,'/Speakerphotos/srivarsha.jpg','','1','LTC 5106','Pilani'),(167,'2012-02-01 20:00:00','CiE','Fracture and Fatigue Mechanics','<p>The lecture covers following:</p>\r\n<ul>\r\n<li>Basic Failure Mechanisms in Structures</li>\r\n<li>Application in Design Engineering Structures</li>\r\n<li>Advance finite elements method</li>\r\n<li>Necessity in modern world</li>\r\n</ul>',161,'/Speakerphotos/piyushgupta.jpg','','1','LTC 5106','Pilani'),(168,'2012-08-24 20:00:00','CS-IS','Introduction to Machine Learning and Data Mining','<p>This talk introduces the audience to key methods and challenges in data analytics. It would touch upon a few techniques in Machine Learning and Data Mining with examples of real-life applications.Since this is the age of big data, the talk would also describe how Map-Reduce handles large scale data in a distributed fashion.</p>',162,'/Speakerphotos/sandeep2.jpg','','1','LTC 5106','Pilani'),(169,'2012-08-24 17:00:00','Phy','The Physics of Higgs Boson','<p>On 4th July 2012, Physicists at the Large Hadron Collider (LHC) CERN, Geneva, announced the discovery of one of the most sought after fundamental particle, - the Higgs Boson also referred to as \"the God particle\". Existence of such a particle was proposed independently by several physicists (Englert, Brout, Higgs, Guralnik, Hagen, Kibble) way back in 1964 as a solution to some of the outstanding puzzles of the physics of the fundamental particles, notably the origin of mass. So is the Higgs Boson really responsible for the origin of mass? Although the Higgs boson itself is not directly responsible for the origin of all the mass in the Universe, there are several Higgs-like-mechanisms operative in nature which provide us some insight into the complex problem of origin of mass. The reason behind this brouhaha about its discovery is that the Higgs boson and the Higgs mechanism forms the back-bone of the most fundamental theory (as of yet) of matter and energy -- the so called Standard Model of Particle Physics. We will attempt to understand the Higgs mechanism in a non-technical way through analogies with familiar phase-transitions and come to appreciate that indeed the Universe as a whole has undergone several phase transitions during its evolution.</p>',163,'/Speakerphotos/rishikesh.jpg','','1','LTC 5101','Pilani'),(170,'2012-08-30 20:30:00','CS-IS','Assisting Software Developers With the Difficult Task of Writing Test Oracles','<p>Software testing is difficult but absolutely critical. There are two high-level challenges when writing software tests, which fall into two deceptively simple categories: Test Inputs and Test Oracles. The vast majority of research on testing focuses on finding effective test inputs, those that exercise, or \"cover\", much of a program\'s behavior. But that is only half of the problem: how do we know if a program\'s behavior is actually correct? For that, we need a Test Oracle, or in more familiar terms, the test\'s \"checks\" or \"assertions\". If we test a \"square root\" function with the value 4, an oracle should verify that the output is 2. As simple as this sounds, writing test oracles for real, modern and complex software is far more difficult. It is a tedious, error-prone, manual process that has received comparatively little attention from the research community.</p>',164,'/Speakerphotos/Mark_Gabel.jpg','','1','LTC 5106','Pilani'),(171,'2012-08-27 20:45:00','CiE','Composition in Construction : Tradition vs Innovation','<p>Traditionally, civil infrastructures have been made out of masonry, concrete, timber, and steel. With continuous research and development in the application of fiber reinforced polymer (FRP) as a construction material, FRP has gained acceptance as a viable alternative. FRP material is known for its high strength-to-weight ratio, high stiffness and good corrosion resistance. Thus, the use of FRP enables reduction of dead weight of the structure and extends the life of the structure. The talk will focus on one of the applications of FRP as externally bonded reinforcement and a synopsis of research work I contributed to at Pennsylvania state university in this field. FRP strengthening systems typically utilize an ambient cured epoxy resin as matrix as well as adhesive. Ambient cured epoxies may have a glass transition temperature (Tg) close to the service temperature. The Tg being close to service temperature results in increased rate of physical aging which in turn results in the evolution of material properties. At temperatures close to Tg, creep deformation in the epoxy resin is also magnified. Hence it is important to characterize the Tg and creep behavior in the constantly evolving ambient cured epoxy resin to understand long term behaviour of FRP strengthening system.</p>',165,'/Speakerphotos/Anurag Jaipuriar.png','','1','LTC 5106','Pilani'),(172,'2012-09-09 20:00:00','Gen','BITS2MSPhD','<ul>\r\n<li>Why graduate school?</li>\r\n<li>Information on various M.S. and Ph.D. programs and their distinction</li>\r\n<li>Application process timeline</li>\r\n</ul>',166,'/Speakerphotos/Harshad.jpg','','1','LTC 5106','Pilani,Goa'),(173,'2012-09-24 20:00:00','Eco/Fin','<b>Butterfly Economics','<p1>The conventional ways of thinking in the social sciences, and in economics in particular, offer at best a partial and at worst a misleading view of the how the world operates. In essence, the world is seen as a machine.  The machine may be very complicated, but in principle it can be understood completely, and the consequences of using it in various ways can be predicted.  A lever pulled here or a button pressed there will have entirely predictable consequences.</p1>\r\n<p1>The speaker will be explaining why existing approaches to the analysis of the economy and of society must be altered fundamentally if we are to make progress in understanding both how world operates, and how we might try to change it for the better.  Economies and societies are not machines. They are more like living organisms. Individuals do not act in isolation, but affect each other in complex ways</p1>',168,'/Speakerphotos/paul_ormerod.jpg','','1','LTC-5106','Pilani'),(174,'2012-09-27 20:00:00','CS-IS','Inferring Private Information on Social Networks','<p>Online social networks, such as Facebook, are increasingly utilized by many people. These networks allow users to publish details about themselves and to connect to their friends. Some of the information revealed inside these networks is meant to be private. Yet it is possible to use learning algorithms on released data to predict private information. In this talk, we discuss how to launch inference attacks using released social networking data to predict private information. We then discuss three possible sanitization techniques that could be used in various situations. Then, we explore the effectiveness of these techniques and attempt to use methods of collective inference to discover sensitive attributes of the data set. In addition, we discuss how to use semantic web based fine grained access control techniques to increase privacy protections on social networks.</p>',169,'/Speakerphotos/murat.jpg','','1','LTC-5106','Pilani'),(175,'2012-09-29 20:00:00','Gen','University selection and Statement of Purpose','',170,'/Speakerphotos/yash.jpg','','1','LTC-5106','Pilani'),(176,'2012-10-19 20:00:00','Gen','Secrets of Digital Marketing','<p>Fun based session to understand latest and authentic stats to help you understand the market, discover its potential, these a fresh stats used for college presentation to support digital ideas in any marketing assignments, competitions or exams, also used for inferring Return on Investment metrics.Followed by hidden secrets of digital marketing ( these are media neutral strategies which a very important part of Integrated Marketing Communications and any marketing mix with digital at the core.Recently conferred with Star Youth Achiever Award by Star news - Global Youth Marketing Forum &amp; CMO Council (2012)\" According to industry body IAMAI (Internet and Mobile Association Of India), the digital media market will be worth Rs 3,500 crore by the end of 2012, its already ahead than Radio and Outdoor industry in India.Job trend reports are pointing to big things for the tech industry, including lots of openings and opportunities for growth, there are huge shortages of qualified professionals in the digital and technology space.Session on 19th October will be a spotlite on authentic stats / data about digital marketing + technology and will focus on emerging trends for you to gain latest and concentrated knowledge in short span of a session, definitely this will make you ahead of the curve in corridor discussions and job interviews.Finally the session will end session with some case studies.Recently conferred with Star Youth Achiever Award by Star news - Global Youth Marketing Forum &amp; CMO Council (2012)\"</p>',171,'/Speakerphotos/Rahul.jpg','','1','LTC : 5106','Pilani'),(177,'2012-10-27 20:00:00','Gen','Introduction to Urban Transportation Planning','<p>Transportation planning plays a fundamental role in a state, region or community&rsquo;s vision for its future. This lecture will serve as introduction to the fundamentals of transportation planning with an emphasis on the Four Step Trip Based Travel Demand Model. The intention is to explain the need for a comprehensive transportation model and how such a modeling process works, including the assumptions made and the steps used to forecast travel demand.</p>',172,'/Speakerphotos/Anyesha.jpg','','1','LTC-5106','Pilani'),(178,'2012-11-08 17:00:00','Gen','Theory of everything','<p>This talk will feature an introduction to cutting edge research going on in the field of theoretical physics with respect to the objective of reconciling quantum mechanics and general reltivity. It will consist of the broad overview of foundations, advantages and disadvantages of many theories that seek this goal, eg. string theory and Loop Quantum Gravity.The objective of this talk will be to convey the significance of Physics in understanding nature.</p>',173,'/Speakerphotos/Madhavan_V.jpg','','1','LTC 5106','Pilani '),(179,'2012-11-09 10:00:00','Gen','Loop quantum gravity','<p>This talk is to present an upcoming paper by the speaker on natural occurance of loop algebras in the Canonical Formulational of General Relativity via the ashtekar variables. Also, the quantization of new approach will be showed with a new operator construct with observables as momentum and velocity which can negate the need for a problem such as a Quantum Gravitational Heisenberg Uncertainty principle.</p>',173,'/Speakerphotos/Madhavan_V.jpg','','1','3247 ','Pilani'),(180,'2013-01-10 20:00:00','CS-IS','Human Computer Interaction','<p>Today&rsquo;s computers are the motivated student&rsquo;s path to high-quality knowledge, the independent designer&rsquo;s platform for creative endeavors, and everyone&rsquo;s medium to connect to other people. Computing is increasingly social. This talk will provide a gentle introduction to research in human-computer interaction, and in particular, research in social computing. This is a talk in three parts. The first part will provide a brief, historical perspective of human-computer interaction, in an attempt to answer &ldquo;how did we get here?&rdquo; The second part talks about recent advances in social computing, especially in education and crowdsourcing.</p>',174,'/Speakerphotos/ART_Chinmay.jpg','','1','LTC: 5105','Pilani'),(181,'2013-01-12 18:45:00','Gen','Future of Money<p style = \"color:gray\"><a href=\"#\" style=\"color:gray; text-decoration:none\">In collabaration with </a><a href=\"http://bits-csa.org/\" style=\"color:black\">CSA</a> with technical support from <a href=\"http://bitsconnect20.bitsaa.org/\" style=\"color:black\">BITSConnect 2.0</a></p>','<p>Inaug + Guest Talk by Director, Software Development PayPal, Laxmanan Krishnamurthy</p>',175,'','','1','Telepresence Classroom','Pilani,Goa,Hyderabad'),(182,'2013-01-12 20:00:00','CS-IS/EEE-E&I','Today\'s hardware for safe parallelism<p style = \"color:gray\"><a href=\"#\" style=\"color:gray; text-decoration:none\">In collabaration with </a><a href=\"http://bits-csa.org/\" style=\"color:black\">CSA</a> with technical support from <a href=\"http://bitsconnect20.bitsaa.org/\" style=\"color:black\">BITSConnect 2.0</a></p>','<p>Parallelism is everywhere - from tiny smart watches to gigantic super computers. But writing parallel programs is hard. To make parallel programming a common place, today\'s software (shared memory programming languages and environments) must evolve to enforce safe practices that ban \"wild behaviors\" e.g., unstructured parallelism and arbitrary data races. This software evolution is a rare opportunity to rethink today\'s hardware from the ground up. In this talk, Rakesh will discuss problems with today\'s parallel software and hardware, and then describe a hardware-software co-designed system that proposes to address these problems in both multi-core and heterogeneous systems.</p>',176,'/Speakerphotos/ART_Rakesh.jpg','','1','Telepresence Classroom','Pilani,Goa,Hyderabad'),(183,'2013-01-13 20:00:00','CS-IS','Tele-immersive systems<p style = \"color:gray\"><a href=\"#\" style=\"color:gray; text-decoration:none\">In collabaration with </a><a href=\"http://bits-csa.org/\" style=\"color:black\">CSA</a> with technical support from <a href=\"http://bitsconnect20.bitsaa.org/\" style=\"color:black\">BITSConnect 2.0</a></p>','',177,'/Speakerphotos/ART_Arpit.jpg','','1','Telepresence Classroom','Pilani,Goa,Hyderabad'),(184,'2013-01-13 13:30:00','CS-IS/Pharma','Integration of Computer Science and Medicine<p style = \"color:gray\"><a href=\"#\" style=\"color:gray; text-decoration:none\">In collabaration with </a><a href=\"http://bits-csa.org/\" style=\"color:black\">CSA</a> with technical support from <a href=\"http://bitsconnect20.bitsaa.org/\" style=\"color:black\">BITSConnect 2.0</a></p>','<p>Vishwa will talk about some cool research in which he has been involved, with respect to the integration of Computer Science and Medicine:</p>\r\n<ul>\r\n<li>1. Controlling robots via brain.</li>\r\n<li>2. Surgical Robotics - Will talk about some really cool robots and devices that drive modern day surgery.</li>\r\n<li>3. Technologies for early and better Cancer detection and diagnosis.</li>\r\n</ul>',178,'/Speakerphotos/ART_Vishwa.jpg','','1','Telepresence Classroom','Pilani,Goa,Hyderabad'),(185,'2013-01-13 18:00:00','CS-IS','Algorithms<p style = \"color:gray\"><a href=\"#\" style=\"color:gray; text-decoration:none\">In collabaration with </a><a href=\"http://bits-csa.org/\" style=\"color:black\">CSA</a> with technical support from <a href=\"http://bitsconnect20.bitsaa.org/\" style=\"color:black\">BITSConnect 2.0</a></p>','<p>The first talk given by Rizwan would build the fundamentals on planar graphs, its properties, basic tools, simple applications of the tools etc. to better equip the participants for the next talk. The second talk would encompass some of the highlights of the recent research in this area and an in depth discussion of one of the recent results in the field.</p>',179,'/Speakerphotos/ART_Rizwan.jpg','','1','Telepresence Classroom','Pilani,Goa,Hyderabad'),(186,'2013-01-14 10:30:00','CS-IS','What it means to run your DSA lab assignment at Google scale<p style = \"color:gray\"><a href=\"#\" style=\"color:gray; text-decoration:none\">In collabaration with </a><a href=\"http://bits-csa.org/\" style=\"color:black\">CSA</a> with technical support from <a href=\"http://bitsconnect20.bitsaa.org/\" style=\"color:black\">BITSConnect 2.0</a></p>','<p>Rajat will be trying to deliver a layman talk on what it means to run your DSA lab assignment at Google scale.</p>',180,'/Speakerphotos/ART_Rajat.jpg','','1','Telepresence Classroom','Pilani,Goa,Hyderabad'),(187,'2013-01-14 13:30:00','CS-IS','Algorithm(Advanced)<p style = \"color:gray\"><a href=\"#\" style=\"color:gray; text-decoration:none\">In collabaration with </a><a href=\"http://bits-csa.org/\" style=\"color:black\">CSA</a> with technical support from <a href=\"http://bitsconnect20.bitsaa.org/\" style=\"color:black\">BITSConnect 2.0</a></p>','<p>The first talk given by Rizwan would build the fundamentals on planar graphs, its properties, basic tools, simple applications of the tools etc. to better equip the participants for the next talk. The second talk would encompass some of the highlights of the recent research in this area and an in depth discussion of one of the recent results in the field.</p>',179,'/Speakerphotos/ART_Rizwan.jpg','','0','Telepresence Classroom','Pilani,Goa,Hyderabad'),(196,'2013-02-13 20:00:00',NULL,'General Talk on \"Finding signs of life, Earth like planets, Einstein\'s biggest mistake, NASA\'s plans for next great telescope in space, Big Bang\"','<p>The history of the universe in a nutshell, from the Big Bang to now, and on to the future &ndash; John Mather will tell the story of how we got here, how the Universe began with a Big Bang, how it could have produced an Earth where sentient beings can live, and how those beings are discovering their history.</p>',185,'Speakerphotos/John_C_mather.jpg','','1','LTC, 5102','Pilani, Goa and Hydrabad campu'),(197,'2013-02-16 20:00:00',NULL,'Know your university: MIT','',187,'Speakerphotos/ashok.jpg','','1','Teleprense room at IST','Pilani, Goa, Hydrabad'),(198,'2013-02-16 20:00:00',NULL,'Know your university: MIT','',186,'Speakerphotos/subra.jpg','','1','Telepresence room at IST','Pilani, Goa, Hydrabad'),(199,'2013-02-16 20:00:00',NULL,'Know your University: Harvard University','',190,'Speakerphotos/prahar.jpg','','1','Telepresense room IST','Pilani, Goa, hydrabad'),(200,'2013-02-17 20:00:00',NULL,'Know Your University: Cornell University','',189,'Speakerphotos/ajay.jpg','','1','Telepresence room at IST','Pilani, Goa, Hydrabad'),(204,'2013-03-10 10:00:00',NULL,'Groundwater Simulation','<ul>\r\n<li>Groundwater and Transport Modelling</li>\r\n<li>Optimization of Water Quality and Quantity</li>\r\n<li>Numerical Simulation Models</li>\r\n<li>Groundwater Development and Protection Startergies</li>\r\n</ul>',194,'Speakerphotos/Abhishek_Singh.jpg','','1','LTC-5106','Pilani'),(203,'2013-02-16 20:00:00',NULL,'Know Your University: MIT','',193,'Speakerphotos/andrea_2.jpg','','1','LTC 5103','Pilani,Goa,Hyderabad,Dubai'),(205,'2013-04-14 10:30:00',NULL,'Know Your University-Wireless Communication','<p>Gaelen graduated with an MS in Electrical Engineering from UCLA in 2012. His focus at UCLA was on Wireless Communication. Prior to this, he completed his Bachelors in Electrical and Electronics Engineering from the Pilani campus in 2010. Gaelen is currently working as a Systems Engineer at Silvus Technologies, a small business focusing on R&amp;D and Product Development in the Wireless industry. He has previously interned with Qualcomm and Bharti Airtel in India.</p>',195,'Speakerphotos/gaelen.jpg','','1','LTC-5106','Pilani'),(206,'2013-04-14 10:30:00',NULL,'Know Your University-Enterpreneuship and Project Management','<p>Satish Polisetti currently runs a company that builds technology to enable native advertising for the entire web/mobile world, funded by Sequoia Capital and other prominent angel investors in the Silicon Valley. He graduated with a dual degree in Mechanical &amp; Electrical Engineering (A4A3) from the Pilani campus in 2007. Satish&rsquo;s focus at UC Berkeley was entrepreneurship &amp; product management. He was selected as Mayfield Fund (top VC firm) fellow in 2010. He won Oxford Youth Business Development Competition, UC Berkeley Startup Competition and finalist at Global Social Venture Competition. He served as Vice President to organize the first BITSAA Global Meet in 2011 and was recently recognized with &lsquo;BITSAA 30Under30&prime; award. Satish interned at Indian Space Research Organization (PS-1), Qualcomm (PS-2) and Cypress USA (PS-2). Satish was selected from Asia-Pacific for Infineon Technologies International Graduate Program and worked in Singapore before joining UC Berkeley to pursue his MS in Information Systems. He won scholarships from Narotam Sekhsaria Foundation, KC Mahindra Education Trust in 2009.</p>',196,'Speakerphotos/satish_polisetti.jpg','','1','LTC-5106','Pilani'),(207,'2013-04-14 10:30:00',NULL,'Know Your University-Computer Architechture','<p>Siddhartha is currently pursuing his Ph.D in Computer Science from UC San Diego under supervision of Prof. Andrew B. Kahng. His specialization is in machine learning in CAD, physical reliability and their impacts on computer architecture and Network-on-Chip (NoC) router estimation. His paper on NoC router estimation got nominated for the best paper award in Design Automation Conference-2012. Siddhartha completed his Bachelors in Electrical and Electronics from the Pilani campus in 2003 with a silver medal from his batch. Thereafter, he worked at Intel Technology India Pvt. Ltd. for seven years on low-power graphics architectures and has six patents on his work on Switchable Graphics, Self Refresh Displays and Dual Display Clone. Siddhartha actively pursues Indian classical music (Hindustani vocal). He regularly performs in different cities across the US and has been training six students over the last few years at UCSD.</p>',197,'Speakerphotos/sidnath99_ucsd_1320946925.jpg','','1','LTC-5106','Pilani'),(208,'2013-04-08 20:00:00',NULL,'The Essence of Entrepreneurship in emerging markets','<ul>\r\n<li>Framework of thinking about emerging markets.</li>\r\n<li>The idea of institutional voids.</li>\r\n<li>Well developed bond markets.</li>\r\n<li>Credit rating agencies.</li>\r\n<li>Market Research firms.</li>\r\n<li>Executive search firms.</li>\r\n<li>Opportunities of Entrepreneurship</li>\r\n</ul>',198,'Speakerphotos/tarun_khanna.jpg','','1','LTC-5106','Pilani'),(209,'2013-04-07 20:30:00',NULL,'Application of Information Technology in Construction Engineering and Project Management','<p>An online talk covering topics:</p>\r\n<ul>\r\n<li>Discrete event simulations</li>\r\n<li>Information modeling and visualization</li>\r\n<li>Sensing and Computer Vision</li>\r\n<li>Social networks</li>\r\n</ul>',199,'Speakerphotos/amlan_mukherjee.jpg','','1','LTC-5106','Pilani'),(210,'2013-08-08 20:00:00',NULL,'Business Plan','<p>Take away from the workshop:</p>\r\n<ul>\r\n<li>What is a biz plan ?</li>\r\n<li>Why do you need one ?</li>\r\n<li>Elements of a biz plan ?</li>\r\n<li>How to flesh them out ?</li>\r\n<li>How to dovetail the elements into a logical, integrated, meaningful biz plan ?</li>\r\n<li>What does writing one entail?</li>\r\n</ul>',200,'Speakerphotos/Nandini_200.jpg','','1','LTC-5106','Pilani'),(211,'2013-08-10 17:30:00',NULL,'Robotics 101','<p><span style=\"color: #333333; font-family: \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 12.727272033691406px; line-height: 14.545454025268555px;\">Passionate for Robotics ? Wondering how and where to get started ?</span><br style=\"color: #333333; font-family: \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 12.727272033691406px; line-height: 14.545454025268555px;\" /><br style=\"color: #333333; font-family: \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 12.727272033691406px; line-height: 14.545454025268555px;\" /><span style=\"color: #333333; font-family: \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 12.727272033691406px; line-height: 14.545454025268555px;\">We have found the right mentor for you !! Embryo presents you Mr.Samay Kohli, Founder and team leader of the world-renowned AcYut- BITS Pilani and currently the CEO and co-founder of Grey Orange Robotics Pvt. Ltd. Your mission to begin with robotics: Robotics 101 can be completed with his expertise. He would speak about how to channelise your skills and use the resources to the best extent to complete your mission.</span><br style=\"color: #333333; font-family: \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 12.727272033691406px; line-height: 14.545454025268555px;\" /><br style=\"color: #333333; font-family: \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 12.727272033691406px; line-height: 14.545454025268555px;\" /><span style=\"color: #333333; font-family: \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 12.727272033691406px; line-height: 14.545454025268555px;\">The talk will be an int</span><span class=\"text_exposed_show\" style=\"color: #333333; font-family: \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 12.727272033691406px; line-height: 14.545454025268555px;\">eractive session. The speaker will introduce the audience with the basic aspects of Robotics and what one should know to take this hobby further followed by a question and answer session.No prerequisites for &ldquo;Understanding&rdquo; the talk.</span></p>',201,'Speakerphotos/Samay_201.jpeg','','1','LTC-5106','Pilani'),(212,'2013-08-21 19:40:00',NULL,'THE $300 HOUSE','<p>India has been granted independence but still 27% Indians cannot afford a decent house to live in. It is of the utmost importance to create a healthy, affordable environment to live in. Christian Sarkar is such a man who along with Vijay Govindarajan has set up the project \"The $300 House\". The CEO of Ecosystem Intelligence, Double Loop Marketing LLC, Mr.Sarkar is trying his hand at being a 33% sanyasi by taking up this social challenge as he himself quotes in his TED talk. <br /> <br /> People interested in Civil Engineering, Architecture must attend the lecture. People inclined towards social entrepreneurship should definately give it a try. This Independence day try to know the burning issue of our country and contribute in your own way.</p>',202,'Speakerphotos/christian_202.jpg','','1','LTC-5106','Pilani'),(213,'2013-08-25 20:30:00',NULL,'Don\'t Let low Grades, Keep you from Top University','<p><span style=\"color: #333333; font-family: Calibri, sans-serif; font-size: 13px; white-space: pre-wrap;\">The talk will mainly focus on how to get into top university if you have a low CGPA and factors apart from CGPA deciding admission into the top universities.</span></p>\r\n<p><span style=\"color: #333333; font-family: Calibri, sans-serif; font-size: 13px; white-space: pre-wrap;\"><a href=\"https://docs.google.com/file/d/0B_-ZRdHqLxwzbWRFREgyYnNpZjg/edit?usp=sharing\">Click Here</a> for Lecture Slides.</span></p>',203,'Speakerphotos/chandra_203.jpg','','1','LTC-5103','Pilani, Goa, Hyderabad'),(214,'2013-08-20 20:30:00',NULL,'Importance of Leadership in today\'s India','<p>We have always dreamt of leading, leading in every field of society. But as we grow up, this vision is lost in the sands of time. In times like these, people like Dr. Kiran Bedi inspire us by their heroic leadership qualities and selfless service to the society. BITSEmbryo rekindles that fire in you, presenting to you Dr. Kiran Bedi, elucidating the significance of leadership in today\'s India. BITSEmbryo.</p>\r\n<p style=\"text-align: center;\"><strong>Date:</strong> 20th Aug, 2013.<br /><strong>Time:</strong> 8:30 P.M.<br /><strong>Venue:</strong> LTC-5103.</p>',204,'Speakerphotos/kiran_204.jpeg','','1','LTC-5103','Pilani, Goa, Hyderabad'),(215,'2013-08-31 20:30:00',NULL,'BITS2MSPhD talks: Know your Application Process','<p>Confused between MS/PhD? BITS2MSPhD talks are back! Listen to BITS Alumni presently in Purdue University, Carnegie Mellon University and Cornell University speak discuss about MS/PhD application procedure. The entire application procedure, preparation and resources which are specific to BITSians will be discussed at length. <br /><br />If you have any queries tweet your questions with the hash tag #bits2msphd at any point during the talk.</p>\r\n<p><a href=\"https://docs.google.com/file/d/0B_-ZRdHqLxwzX3pOWUxWN3pKZEE/edit?usp=sharing\" target=\"_blank\">Click here</a> for Lecture slides.</p>',205,'Speakerphotos/yashkumar_205.jpg','','1','LTC-5106','Pilani, Goa, Hyderabad'),(216,'2013-09-14 20:45:00',NULL,'Challenges and Opportunities in Civil Engineering','<p>Civil engineering, the oldest engineering discipline, is a professional discipline that deals with the design, construction, and maintenance of the physical and naturally built environment, including works like roads, bridges, canals, dams, and buildings. Amit Mukhrejee has a lot of experience in civil companies . He has a lot of knowledge in planning , cost controling ,cost estimation,scheduling of any activity. The speaker will describe about the civil companies , their projects and what is its scope and opportunities in future. If you interested in core civil companies and its projects please don\'t miss this interactive session. You are free to ask any kind of question regarding civil companies and projects.</p>\r\n<p>Pilani Campus:</p>\r\n<ul>\r\n<li>Date: 14th sept. [saturday], 2013.</li>\r\n<li>Time: 8:45 PM</li>\r\n<li>Venue: LTC-5106</li>\r\n<li>Speaker: AMIT MUKHERJEE</li>\r\n</ul>\r\n<p><br /><br /></p>',208,'Speakerphotos/amit_208_2.jpg','','1','LTC-5106','Pilani'),(217,'2013-09-12 20:00:00',NULL,'What lies ahead: MS, MBA, Entrepreneurship','<p>More often than not, we are unaware what we want to do after BITS. Is it Masters, Management or diving into Entrepreneurship. This lecture is intended to guiding the students about career opportunities whether to go for MS, MBA or entrepreneurship. The lecture will focus mainly on letting students discover their interests and choose their path on the basis of their interests.<span style=\"color: #222222; font-family: arial, sans-serif; font-size: 13px;\">&nbsp;</span></p>',209,'Speakerphotos/shivakumar_209.jpg','','1','LTC-5106','Pilani, Goa, Hyderabad'),(218,'2013-09-06 20:00:00',NULL,'The Fundamentals of Vedic Mathematics','<p><span style=\"color: #222222; font-family: arial, sans-serif; font-size: 13px;\">The talk will mainly focus on how vedic maths can be used to solve complicated mathematical problems with ease and in a much shorter span of time.He solved many questions illustrating how vedic maths can be used to simplify complicated calculations.</span></p>',210,'Speakerphotos/download.jpg','','1','LTC 5106','Pilani Goa'),(219,'2013-09-15 20:00:00',NULL,'Expedition to Antarctica','<p>Robert Swan became the first man to walk North Pole and South Pole in 1989. &nbsp;A chance meeting with him in Austin, Texas inspired Bandan to take up the expedition to Antarctica in March 2013 with Robert\'s sustainability team. The talk will reveal the unfolding of events and the preparation that went behind making it to the Expedition. &nbsp;And in the end , how this journey inspired me to launch initiatives that motivate others to make a positive change in the world</p>',211,'Speakerphotos/bandan_211.jpg','','1','LTC-5106','Pilani'),(220,'2013-10-21 20:00:00',NULL,'Road to Space','<p><span style=\"color: #222222; font-family: arial, sans-serif; font-size: 13px;\">A general talk about&nbsp;</span><span style=\"color: #222222; font-family: arial, sans-serif; font-size: 13px; text-decoration: underline;\">space mission design</span><span style=\"color: #222222; font-family: arial, sans-serif; font-size: 13px;\">, and experiences from the projects he has &nbsp;been involved in. A part of the talk will be dedicated &nbsp;to his&nbsp;</span><span style=\"color: #222222; font-family: arial, sans-serif; font-size: 13px; text-decoration: underline;\">experience with small satellites and vision for the future.</span></p>',212,'Speakerphotos/kartk_212.jpg','','1','LTC-5103','Pilani'),(221,'2013-10-15 18:30:00',NULL,'Rs.2 blood glucose sensing: How? Why? and What more !!!','<p><span style=\"color: #333333; font-family: \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 12.727272033691406px; line-height: 14.545454025268555px;\">A chance to interact with the developer of \"Blood sugar test for Rs 2, in 10 seconds\"</span><br style=\"color: #333333; font-family: \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 12.727272033691406px; line-height: 14.545454025268555px;\" /><span><span style=\"color: #333333; font-family: \'lucida grande\', tahoma, verdana, arial, sans-serif;\"><span style=\"font-size: 12.727272033691406px; line-height: 14.545454025268555px;\">Get to know how this breakthrough actually happened</span></span><br /><br /><span style=\"color: #333333; font-family: \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: small;\"><span style=\"line-height: 14.53125px;\">Dr. Suman Kapur is a Biologist and innovator. She has been primarily instrumental in the development of a path-breaking test for diabetes which is significantly cheaper and requires thousand times less blood than traditional glucose meters.&nbsp;</span></span></span></p>',213,'Speakerphotos/suman_213.jpg','','1','LTC-5103','Pilani'),(222,'2013-10-15 17:30:00',NULL,'Introduction to Advertising','<p>This lecture provides you the best start to management. Must Attend for MBA aspirants and prospective entrepreneurs.</p>',214,'Speakerphotos/parameswaran_214.jpg','','1','LTC-5106','Pilani'),(223,'2013-10-10 19:00:00',NULL,'Dealing with Noise - Living with uncertainty in investing and valuation','<p>Embryo club and Management association, BITS Pilani present a talk by Dr Aswath Damodaran, Prof of Finance, Stern Business School, NYU. This lecture will enlighten you about basics of valuation of companies and certain investment strategies.</p>',215,'Speakerphotos/aswasth_215.jpg','','1','LTC-5103','Pilani'),(224,'2013-11-17 20:00:00',NULL,'Unlock You Future','<p>Dinkar Nandwana is a BITS-Pilani alumnus. Currently, working in Schlumberger, Houston, Texas Area he has had wide exposure as a graduate research assistant in University of Illinois, Urbana Champaign. He will be throwing light on MS/PhD Admissions, Foreign Internships &amp; Jobs in general. It\'s a must attend talk for students who are looking for Job opportunities abroad or planning for higher education.</p>',216,'Speakerphotos/069eec1.jpg','','1','LTC-5106','Pilani'),(225,'2013-09-08 20:30:00',NULL,'Life as an Indian Engineering Services Officer','<p>This talk will focus on the following aspects:<br /><br />1. Life as a CPWD Engineer</p>\r\n<p>2. Prospects after doing Indian Engineering Services</p>\r\n<p>3. A brief about his current project in Elevated Road Corridors</p>\r\n<p>4. Current state of Civil Engineering in general</p>',217,'Speakerphotos/manu_amitabh.jpg','','1','LTC-5106','Pilani'),(226,'2014-01-24 20:00:00',NULL,'The untold saga of the university education system','<p>From runes and hieroglyphics to the sophisticated study of the quantum mechanics,universities have always played a pivotal role in the education system of our society. In the yore, India boasted of some of the best \'gurus\' and universities in the likes of Nalanda and Taxila. However, today the universities of the west have proven to imbibe better quality education. This talk will take you on an historical roller coaster ride, discussing the key issues with the current University models followed all over the world, and possible alternatives we could move to. All in all, the talk aims to provide a newer perspective to think about Education.<br /> <br /> <strong>Target Audience:</strong> All students and Faculty</p>',218,'Speakerphotos/Balaji_Viswanathan_218.jpg','','1','LTC-5106','Pilani'),(227,'2014-01-21 20:00:00',NULL,'How to Crack a Coding Interview: Skills and Strategies for Software Engineers','<p>CS interviews are a different breed from other interviews and, as such, require specialized skills and techniques. This talk will teach you how to prepare for coding and PM interviews, what top companies like Google, Amazon, and Microsoft really look for, and how to tackle the toughest programming and algorithm problems. This is not going to be a fluffy be-your-best talk; it will be deeply technical and will discuss specific algorithm and data structure topics.</p>',219,'Speakerphotos/Gayle_Laakmann_219.jpg','<b>Target Audience:</b> All Computer science and Information systems students including those who are passionate about coding.','1','LTC-5103','Pilani, Goa, Hyderabad'),(228,'2014-01-21 20:00:01',NULL,'Dreams and Creative Problem Solving','<p>Dreams have produced art, music, novels, films, mathematical proofs, designs for architecture, telescopes, and computers. Dreaming is essentially our brains thinking in another biochemical state&mdash;and therefore it&rsquo;s likely to solve some problems on which our waking minds have become stuck. Harvard psychologist Deirdre Barrett&rsquo;s research has explored the role of dreaming in everyday problems and creative projects, the brain processes behind this, and how dream incubation can increase problem solving dreams. This talk will take inspiration from great historical dreams and modern lab research in presenting techniques to increase the likelihood that you will have breakthrough dreams&mdash;and recall and act on them.</p>',220,'Speakerphotos/Deirdre_Barrett_220.jpg','Target Audience: No prerequisites. Anyone can attend the talk.However the talk shall be extremely useful for biological sciences and pharmacy students.','1','LTC-5106','Pilani'),(229,'2014-01-25 20:00:00',NULL,'The seed of Genius','<p>This talk will go beyond the conventional lecture style and entail simultaneous visual screens as well as explanatory and backup graphics. Th author will talk about the uniqueness and speciality that each individual posses to succeed and do well in his/her life, discipline, bussiness or career. For this one needs to know his/her true capabilities so that he/she can focus on doing the best that one can. You need to get to know your hidden potential fast so that you do not waste your time, energy and resources on inherent weaknesses and problems.</p>\r\n<p>A few extracts from the author\'s book: <br /> Believe in Yourself...Take Charge of Your Life <br /> Taking charge comes from within, so you need to be proactive in being the boss of your own mind. Being proactive means looking ahead and planning to the extent that you can. Taking charge of yourself may be the fuel you need to make everything in your life a success. <br /> \"Appo Deepa Bhavah\" <br /> Be your own lamp <br />Buddha\'s last words to his foremost disciple Ananda, as he fell silent to embrace his approaching death. <br /> <br /> So, if you feel you have the passion in you to excel, you want to be among the best in your profession, career or life, or if you were fascinated by the Srimad Bhagwad Gita lectures - This lecture is for you.</p>',222,'Speakerphotos/222_Ankur_Gupta.jpg','','1','LTC-5106','Pilani'),(230,'2014-02-03 18:30:00',NULL,'Entrepreneurship, A Mission with Passion','<p>Sarathbabu Elumamlai, an alumnus of IIM-Ahmedabad and BITS Pilani, has immense experience in entrepreneurship, politics and social work. this talk will focus on Entrepreneurship and what goes into being a successful entrepreneur. So, if you have that flair of working for your own ideas and making other people\'s lives better, this talk is for you.</p>',223,'Speakerphotos/223_sarathbabu.jpg','','1','LTC-5103','Pilani, Goa, Hyderabad'),(231,'2014-02-08 20:00:00',NULL,'MS in Computer Science','<p>If you are passionate about Computer Science and words like Data Science, Algorithm and Machine learning excite you but you think you can\'t pursue them because you are from &nbsp;\"Non-CS\" background then you couldn\'t be more wrong. Embryo presents an online lecture on Application Process for MS in Computer Science especially for those from <strong>\"Non-CS\" background.</strong></p>',224,'Speakerphotos/224_anjishnu.jpg','The speaker will guide you how to get admission in MS Computer Science despite having Non CS background. He will also share the challenges that he had to face and how he managed to get over them.','1','LTC-5103','Pilani'),(232,'2014-02-18 20:00:00',NULL,'Research in Molecular biology : Current progress and future perspective','<p>Molecular Biology is one of the most upcoming fields in today\'s time and a lot of meaningful research work is being done in this field. The speaker will enlighten the audience about his specific work in the field. If you have an interest in Biology or were mesmerized by the Biology lectures in your 1st year, don\'t miss it!</p>',225,'Speakerphotos/Ishaan.jpg','','1','LTC 5103','Pilani Goa Hyderabad'),(233,'2014-02-21 18:00:00',NULL,'The essential Business and Intellectual Property laws required for a Start up','<p>Are you looking forward to build the \'THE NEXT BIG THING\'? If yes, then this is the talk for you. This talk will mainly focus on the following aspects.</p>\r\n<ol>\r\n<li>To Incorporate or not to Incorporate: Forms of Doing business</li>\r\n<li>The essential contracts that start ups cannot ignore</li>\r\n<li>Protect your Intellectual Property</li>\r\n<li>To Patent or not to Patent? Patenting issues for Tech companies.</li>\r\n</ol>',226,'Speakerphotos/vishnu_prasad.jpg','','1','LTC-5106','Pilani'),(239,'2014-03-10 20:15:00',NULL,'What makes Silicon Valley tick','<p>This talk will mainly be about innovation-based Entrepreneurial Economy.</p>\r\n<p>&nbsp;</p>',230,'Speakerphotos/krishna_saraswat.jpg','','1','LTC 5103,Telepresence room','Pilani,Goa,Hyderabad'),(240,'2014-03-14 18:00:00',NULL,'Quantum Computing and Cryptography','<p>Information is stored and manipulated in a physical system, and thus any realistic model of computation and communication must be cast in a realistic physical framework. A century ago, the quantum paradigm for physics was introduced in order to resolve several open problems. Later in the 20th century, the consequences of this paradigm for computation and communication were explored. A quantum computer could solve some important problems exponentially faster than we believe is possible with conventional classical devices. Quantum communication brings us unbreakable cryptographic primitives that are not possible in a classical paradigm. Quantum technologies redefine which cryptographic tools are secure, and thus there is an urgent need to update our cryptographic infrastructure to be secure in a world with these emerging quantum technologies.<br /><br />There will be an overview of what quantum information is, and how it impacts computation and cryptography.</p>',231,'Speakerphotos/mmosca.jpg','','1','F-101(Hyd) LTC 5103(Pilani)','Pilani,Hydrabad'),(241,'2014-04-18 20:00:00',NULL,'Graphene — An exciting two-dimensional material for science and technology','<p>One atom thick graphene is derived from graphite and is a new material; however,graphite has been a part of human history for centuries. He will discuss why it generates so much excitement (including a Nobel prize in 2010) in a wide variety of scientific disciplines. He will discuss its electronic and mechanical properties with an eye towards applications.</p>\r\n<p>The content of his talk will assume no prior exposure to graphene related research.</p>\r\n<p><strong>He\'s also agreed to give a part of his time to his experience with bitsians who do their thesis\' under him at tifr</strong>.</p>\r\n<p>&nbsp;</p>',232,'Speakerphotos/232.jpg','','1','LTC-5104','Pilani'),(242,'2014-04-22 17:30:00',NULL,'Leadership in Technology and Innovation: Global trends and challenges for India','<ul>\r\n<li><span style=\"color: #000000; font-family: arial,helvetica,sans-serif;\">Technology is changing the world around us. Countries and companies are innovating with technology to enhance their competitiveness and change the rules of the game. India has established a leadership position in technology but there is much more to be done. There are also many opportunities for India to leverage technology and maneuver its path to sustainability.The talk will focus on some of these new ideas and approaches which could accelerate the development of the country.</span></li>\r\n</ul>',233,'Speakerphotos/233_1.jpg','','1','LTC-5103(Pilani)','Pilani,Goa,Hydrabad'),(243,'2014-09-25 19:45:00',NULL,'3D Printing with Atoms: An Impossible (or just an Improbable) Dream','<p>Can we design and construct a matter compiler? That is, is it possible to conceive of a scheme whereby the fundamental atomic/molecular building blocks of matter can be autonomously and intelligently manipulated via software to form a nanoscopic, microscopic, or even a macroscopic product like a computer, a table, or a car? In other words, can we push 3D printing all the way down to the atomic level? This is the essence of the highly controversial &ldquo;molecular manufacturing&rdquo; concept put forward by K. Eric Drexler in the eighties [1] (and which was originally inspired by Feynman&rsquo;s musings [2] on the ultimate limits of miniaturisation in 1959).</p>\r\n<p>In this talk He shall first reappraise Drexler&rsquo;s matter compilation scheme in the context of the latest developments in (sub)atomic resolution scanning probe microscopy (SPM) and 3D printing before describing some of his work in Nottingham in three areas of key relevance to the nanofactory concept:</p>\r\n<ul>\r\n<li>Atom switching and manipulation driven purely by the making and breaking of a single chemical bond [3]</li>\r\n<li>Mapping the force-field of individual bonds [4,5]</li>\r\n<li>Removing the human factor: automated imaging and manipulation [6]</li>\r\n</ul>\r\n<p><strong>References:</strong></p>\r\n<p>[1] Nanosystems, K Eric Drexler, Wiley-Interscience (New York), 1992</p>\r\n<p>[2] There&rsquo;s Plenty of Room at the Bottom, RP Feynman, 1959 (http://www.zyvex.com/nanotech/feynman.html</p>\r\n<p>[3] A. Sweetman et al., Phys. Rev. Lett. 106, 136101 (2011) [See also Sixty Symbols &ndash; Atomic Switch: https://www.youtube.com/watch?v=UBmBMmuUBMk ]</p>\r\n<p>[4] A. Sweetman et al, Nature Comms., 5, 3931 (2014) [See also &ldquo;The sound of atoms bonding&rdquo;: https://www.youtube.com/watch?v=Ehw8PTA4QkE ]</p>\r\n<p>[5] C. CHiutu et al., Phys. Rev. Lett. 108, 268302 (2012)</p>\r\n<p>[6] RAJ Woolley et al., &nbsp;Appl. Phys. Lett. 98, 253104 (2011)</p>\r\n<p><span style=\"color: #222222; font-family: Garamond, serif; font-size: 15px;\">All papers available at&nbsp;</span><a style=\"color: #1155cc; font-family: Garamond, serif; font-size: 15px;\" href=\"http://www.nottingham.ac.uk/~ppzstm/publications.php\" target=\"_blank\">http://www.nottingham.ac.uk/~ppzstm/publications.php</a></p>\r\n<p>&nbsp;</p>',234,'Speakerphotos/philipmoriarty.jpg','','1','LTC 5103,Telepresence room','Pilani'),(244,'2014-08-19 20:00:00',NULL,'No Matter What You Can Be Happy','<p>In this she will be sharing her story after surviving the blast and her journey so far spreading the message that patience and determination can take you out of the deepest woods and underlining the basic concept of life &mdash; fight and you will survive, surrender and you will be wiped out. The talk will emphasize on the fact that we should learn to embrace every inch, every scar, and every emotion.&nbsp;</p>',235,'Speakerphotos/Malvika_Iyer.jpg','','1','LTC-5106','Pilani'),(245,'2014-08-11 20:00:00',NULL,'Seven qualities of mentally tough and happy people','<p>Happy and successful people are great at resisting temptation. They are great at overcoming fear in order to do what they need to do. They consistently keep doing what they have decided is most important. All those qualities require mental strength and toughness. In this talk we will learn some of the qualities of mentally tough and happy people. Yes, we all can cultivate those qualities to reach our desired goals in life.</p>',236,'Speakerphotos/Manoj_Kumar_Dora.jpg','','1','LTC-5103','Pilani'),(246,'2014-09-03 20:00:00',NULL,'\'Ideas to Start-up\' - Innovate & Stay Relevant ','<p>Every organization has a reason for being. It might be a unique idea, ability to offer a particular product or service, or it might arise from having been in the right place at the right time with certain set of \'wow\' capabilities. But as its core, your organisation probably relies on people, Innovation and Intellectual property (IP) far more than any imagination.</p>\r\n<p>The ability to innovate and win clients is frequently the difference between organizations that succeed and those that fail. The value of many of the world&rsquo;s largest companies is increasingly vested in Innovation, Intellectual Property, knowledge-based, intangible assets. An economy based on these assets is often known as &lsquo;Innovation Economy\'. Innomantra is all around this - Let\'s converse!</p>',237,'Speakerphotos/Lokesh_V_2.jpg','','1','LTC-5103','Pilani'),(247,'2014-08-26 20:00:00',NULL,'Physics for You','<p>He will mainly be taking about how to share our enthusiasm for science with others and will be taking a long question and answer session after the talk.&nbsp;</p>',238,'Speakerphotos/Henry_Reich.jpg','','1','LTC 5103,Telepresence room','Pilani,Goa,Hyderabad'),(248,'2014-09-03 17:30:00',NULL,'Innovation in Emerging Market','<p>Ever since the Industrial Revolution,All innovation has happened in the West for the affluent consumer. Only &nbsp;in the last 2 decades has the focus shifted to the emerging BRIC countries. In India affordability, scarcity of resources, a huge population and unique eco-system pose a special challenge. Products will have to be developed through a bottom up, community co-creation process unlike the R &amp; D approach followed in the West. Innovation will have to be looked at 3 levels-Product, Processes and People. MART has developed the 3i model (inquiry, immersion, implementation), an approach appropriate for innovating in India</p>',239,'Speakerphotos/Pradeep_Kashyap.jpg','','1','LTC 5103,Telepresence room','Pilani'),(249,'2014-09-01 20:00:00',NULL,'The NASA Kepler Mission and the Future of NASA Astrophyics','<p>The Kepler Mission is NASA&rsquo;s first space telescope capable of finding Earth-size planets in the habitable-zone of other stars in the Milky Way Galaxy. &nbsp;The results of the mission have been outstanding, and indicated that planets far outnumber the number of stars in the Milky Way. &nbsp;Kepler&rsquo;s results have been astonishing and will serve as a spring-board for future NASA Astrophysics missions. &nbsp;Roger Hunter of NASA Ames Research Centre will be discussing the background of the Kepler Mission, its results to date, and the NASA roadmap for the future NASA Astrophysics Missions.&nbsp;</p>',240,'Speakerphotos/Roger_Hunter.jpg','','1','LTC 5103,Telepresence room','Pilani,Hyderabad'),(250,'2014-09-05 20:00:00',NULL,'The road to success is paved with Failures','<p>Only those who do something at all, fail! Those who never fail, never actually do anything! So if you are failing at anything, means you are going to succeed one of these days! Remember,&nbsp; the longing to give up after a failure is the strongest in all of us! And those of us who fail a great many times, feel and believe that fate is not on our side and that we must stop trying, hat we must just do whatever is easy, and then we end up living a mediocre life! Do you want to do that?<br /><br />Some of us also try to go to temples, astrologists and fortune tellers and get into performing all kinds of rituals to avoid failures! OK it is fine to do these things, but only if these things worked, there would be very few failures to report! Remember, the people who have ultimately succeeded in life are the ones who have failed the most times! So never fear when you are faced with a failure, learn from the same and move on&nbsp; towards sure success!<br /><br />Preeti\'s life has been liberally endowed with failures, and yet She teaches the secret of success! How to actually turn your failures into successes, how to manage to hang on when life is on the deep down turn, what is the exact recipie to make it through this world and come out on top, how to manage the time when you are only meeting these failures in life, and how simple it is to manage; only if you have mastered the trick of tricking failure! So do listen up as She personally has failed countless times, lost it all, had everything working against her, deserted by what is called life and support&hellip; and yet dared to dream and move on with a smile on her lips and a spring in her step! The successes you wish for are all yours,&nbsp; She is simply going to hand you the recipie and trick to get it all for yourself! Of course, She is here to guide you, help you develop the tools to get there, encourage and support you, but the efforts, resolve and actions will have to be yours! Life only comes once&hellip; live&nbsp; it to your heart&rsquo;s content and give it your best shot! The choice is entirely in your hands!</p>',241,'Speakerphotos/preeti_monga.jpeg','','1','LTC 5103','Pilani,Goa,Hyderabad'),(251,'2014-09-08 20:00:00',NULL,'Business Information Modelling','<p>The main aim of the talk is to enable students gain an insight into the concept of Building Information Modelling (BIM). How BIM is driving construction projects overseas and why professionals in India need to adopt it will be discussed. Applications of BIM and what opportunities it presents in the near future will be explored.</p>',242,'Speakerphotos/Viraj_Voditel.jpg','','1','LTC 5103,Telepresence room','Pilani,Goa,Hyderabad'),(252,'2014-09-10 20:00:00',NULL,'Faces and Fingerprints: Human Recognition Using Biometrics ','<p>Biometrics is the science of recognizing individuals based on their physical and behavioral attributes such as fingerprints, face, iris, voice and signature. The automated process of comparing a pair of biometric signals (such as two face images) and determining the probability that they belong to the same individual is both a fascinating as well as practical area of research. Biometric solutions have been incorporated in border security systems, access control applications, criminal investigations, time-and-attendance technology and national ID cards. Recent research in this field has focused on securing biometric templates, searching for identities in large biometric databases, recognizing people in a nighttime environment, fusing biometric traits and designing faster matching algorithms. This talk will discuss the recent progress made in biometrics and enumerate some of the cutting edge problems being addressed by researchers in this field.</p>',243,'Speakerphotos/Arun_Ross.jpg','','1','LTC-5103','Pilani'),(253,'2014-09-13 20:00:00',NULL,'How I lived on Rs 32 a day','<p>Tushar Vashisht graduated from an Ivy League University to become a wall street/silicon valley banker. He decided to leave that and join the Govt of India in one of the most ambitious tech projects every undertaken by the country - the Unique ID (Aadhaar) project. From there he continued his journey to live on Rs 100/day and Rs 32/day. His learnings from these projects and the people he met led to his startup HealthifyMe which today is pioneering quantified self movement in India and helping people get fitter and healthier.</p>\r\n<p>Tushar will talk about his journey in today\'s talk and on what lies ahead.</p>',244,'Speakerphotos/tushar_vashisht.jpg','','1','LTC 5103,Telepresence room','Pilani'),(255,'2015-02-10 20:00:00',NULL,'Exploring Solar System in search of Life and Elusive Material in the 21st century','<p>This talk by Dr. Giri will begin with a focus on myriad space missions being conducted in search of signatures of life on several bodies in the Solar System, including the one he is associated with - European Space Agency\'s Rosetta Mission. The most crucial aspect of in situ missions is the cutting-edge hardware that lead to the attainment of their scientific objectives. Dr. Giri will speak about the role of instrumental payloads, how they are assembled and the future of sample-return missions.</p>\r\n<p>The 21st century will witness the rise of space missions designed for extra-terrestrial resource utilisation. Such missions will be driven by commercial purposes and are expected to subsequently lead to a massive space industry. As a second focal point of the talk, Dr. Giri will elaborate the nature of commercial space missions.</p>\r\n<p>India\'s recent success with the Mars Orbiter Mission is a strong outset to establish an ambitious citizen-centric space exploration program. In the concluding focal point, Dr. Giri will talk about the requisites for India to establish its own multi-mission space program.</p>',246,'Speakerphotos/chaitanya.jpg','','1','Telepresence Room','Pilani'),(256,'2015-02-01 20:00:00',NULL,'How to Start a business from scratch','<p>The talk will focus on starting new business ventures. He will be sharing his story through the talk and will also be explaining the basic essentials for a successful start-up.</p>',247,'Speakerphotos/sarath_babu.jpg','','0','Telepresence Room','Pilani'),(257,'2015-02-01 19:00:00',NULL,'DIGITAL IMAGE FORENSICS','<p>Given an image or a video clip can you tell which camera it was taken from? Can you tell if it was manipulated? Given a camera or even a picture, can you find from the Internet all other pictures taken from the same camera? Forensics professionals all over the world are increasingly encountering such questions. Given the ease by which digital images can be created, altered, and manipulated with no obvious traces, digital image forensics has emerged as a research field with important implications for ensuring digital image credibility. This talk will provide an overview of recent developments in the field, focusing on three problems. First, collecting image evidence and reconstructing them from fragments, with or without missing pieces. This involves sophisticated file carving technology. Second, attributing the image to a source, be it a camera, a scanner, or a graphically generated picture. The process entails associating the image with a class of sources with common characteristics (device model) or matching the image to an individual source device, for example a specific camera. Third, attesting to the integrity of image data. This involves image forgery detection to determine whether an image has undergone modification or processing after being initially captured.</p>',249,'Speakerphotos/Dr_Nasir_Memon.jpg','','0','Telepresence Room(LTC 5103)','Pilani'),(258,'2015-02-04 20:00:00',NULL,'The Quintessence of Questioning','<p>In this fast paced and ever changing world, we are often on a mission seeking relevance, looking for the right answers to our questions. But what if it isn\'t the answers but the questions themselves that hold the key? Addressing this pertinent topic, BITS Embryo presents polymath Joshua Engel, sharing his ideas on the \'Quintessence of Questioning\"</p>',253,'Speakerphotos/joshua_engel.jpg','','1','LTC-5103','Pilani, Goa, Hyderabad'),(259,'2015-02-05 19:30:00',NULL,'Being Entrepreneurial','<p>StartUP actually means STARTING UP. How to Make \"It\" Happen, But first you need know what is \"it\". Are you Engineering Or Getting Engineered? We all have the Key to SUCCESS but don\'t know the LOCK. GET out of the COMFORT ZONE - But WHY? Be there to find out.</p>',254,'Speakerphotos/sujit-lalwani.png','','1','LTC-5106','Pilani'),(260,'2015-04-04 20:00:00',NULL,'Gateway to Indian Engineering Services Exam','<p>&nbsp;</p>\r\n<p>He will be talking about</p>\r\n<p>&nbsp;</p>\r\n<p>1. IES as a career option.</p>\r\n<p>2. Preparation Strategy. (especially useful for 2nd and 3rd year students)</p>\r\n<p>3. Service Description and future prospects and the kind of work an IES officer has to do.</p>\r\n<p>&nbsp;</p>\r\n<p>The session will be interactive and the speaker insists on the session being informal.</p>',255,'Speakerphotos/manish.jpg','','1','LTC-5103','Pilani'),(261,'2015-02-27 17:30:00',NULL,'Marketing Analytics and Possible Career Opportunities','',248,'Speakerphotos/download_1.jpg','','0','LTC-5103','Pilani Campus'),(262,'2015-04-10 19:30:00',NULL,'Career Centre and its utility for BITSians','<div style=\"font-family: arial, sans-serif; font-size: 12.8000001907349px; color: #888888;\" dir=\"ltr\"><em><span style=\"color: #000000;\">&nbsp;A</span>t the cusp of graduating? Wondering about how you can leverage the strong alumni network to&nbsp;<span style=\"text-decoration: underline;\">Get ahead</span>&nbsp;<span style=\"text-decoration: underline;\">i</span>n your career?</em></div>\r\n<p class=\"MsoNormal\" style=\"margin: 0px; color: #222222; font-size: 12.8000001907349px; font-family: tahoma, sans-serif;\"><em><br />\"With the help of&nbsp;<strong>this platform</strong>, I&rsquo;ve been able to build contacts with BITS alumni who are in high profile positions now\"<br />- Recent BITSian graduate</em></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0px; color: #222222; font-size: 12.8000001907349px; font-family: tahoma, sans-serif;\"><em>&nbsp;</em></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0px; color: #222222; font-size: 12.8000001907349px; font-family: tahoma, sans-serif;\"><em>&ldquo;Rest assured, I&rsquo;ll be using this&nbsp;<strong>platform&nbsp;</strong>routinely for my hiring requirements&rdquo;<br />-BITSian Co-founder on hiring for openings in his company</em></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0px; color: #222222; font-size: 12.8000001907349px; font-family: tahoma, sans-serif;\"><em>&nbsp;</em></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0px; color: #222222; font-size: 12.8000001907349px; font-family: tahoma, sans-serif;\"><em>&ldquo;The support to those wanting to study on this&nbsp;<strong>platform&nbsp;</strong>further is impressive. Would have been nice to have around when I was in the process of applying myself&rdquo;<br />-BITSian who graduated in 2010, did his Masters after graduating</em></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0px; color: #222222; font-size: 12.8000001907349px; font-family: tahoma, sans-serif;\"><em>&nbsp;</em></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0px; color: #222222; font-size: 12.8000001907349px; font-family: tahoma, sans-serif;\"><em>If you are curious to know of this centralized platform for BITSians&nbsp;facilitated by fellow BITSians, attend the talk by the Director of Career Services, BITSAA...</em></p>\r\n<p><em>&nbsp;</em></p>',256,'Speakerphotos/2ef910d.jpg','','0','LTC-5103','Pilani Campus'),(263,'2014-11-16 20:00:00',NULL,'How to build a UAV and opportunities at IISC Bangalore','<ol style=\"margin: 0px; padding: 0px; border: 0px; color: #222222; font-family: arial, sans-serif; font-size: 13px; line-height: 15.6000003814697px;\" data-ved=\"0CB0Q_xc\">\r\n<li class=\"mod\" style=\"line-height: 1.24; margin: 0px; padding: 20px 20px 0px; border: 0px; list-style: none; clear: none;\" data-md=\"61\">\r\n<div class=\"_oDd\" style=\"overflow: hidden; padding-bottom: 20px;\" data-hveid=\"37\"><span class=\"_Tgc\" style=\"font-size: 16px;\">The&nbsp;<strong>UAV</strong>&nbsp;is an acronym for Unmanned Aerial Vehicle, which is an aircraft with no pilot on board.&nbsp;<strong>UAVs</strong>&nbsp;can be remote controlled aircraft (e.g. flown by a pilot at a ground control station) or can fly autonomously based on pre-programmed flight plans or more complex dynamic automation systems.</span></div>\r\n</li>\r\n<li class=\"mod\" style=\"line-height: 1.24; margin: 0px; padding: 20px 20px 0px; border: 0px; list-style: none; clear: none;\" data-md=\"61\"><span class=\"_Tgc\" style=\"font-size: 16px;\">In the lecture, Mr.Anupam will be covering the following topics:</span></li>\r\n<li class=\"mod\" style=\"line-height: 1.24; margin: 0px; padding: 20px 20px 0px; border: 0px; list-style: none; clear: none;\" data-md=\"61\">\r\n<div style=\"margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; font-size: 13px; line-height: normal;\">\r\n<div style=\"margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;\">1) Career and Research at IISc including internships, MTech, MS and PHd in brief</div>\r\n2) Unmanned Aerial Vehicles(UAVs) and allied research areas like Avionics, image processing, propulsion in depth</div>\r\n<span class=\"_Tgc\" style=\"font-size: 16px;\"><span style=\"margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; font-size: 13px; line-height: normal;\">3) His own initiative to take up BITSIANs for research work.</span></span></li>\r\n</ol>',257,'Speakerphotos/anupam_purwar.jpeg','','0','LTC 5103','Pilani'),(264,'2014-11-12 20:00:00',NULL,' Entrepreneurship and ReDx initiative of Media Lab','<ol style=\"margin: 0px; padding: 0px; border: 0px; color: #222222; font-family: arial, sans-serif; font-size: 13px; line-height: 15.6000003814697px;\" data-ved=\"0CB0Q_xc\">\r\n<li class=\"mod\" style=\"line-height: 1.24; margin: 0px; padding: 20px 20px 0px; border: 0px; list-style: none; clear: none;\" data-md=\"61\">\r\n<div class=\"_oDd\" style=\"overflow: hidden; padding-bottom: 20px;\" data-hveid=\"37\"><span class=\"_Tgc\" style=\"font-size: 16px;\"><strong>Computer vision</strong>&nbsp;is a field that includes methods for acquiring, processing, analyzing, and understanding images and, in general, high-dimensional data from the real world in order to produce numerical or symbolic information, e.g., in the forms of decisions. want to know more about this and other topics like machine learning,imaging,optics,spectroscopy and mobile health? come join us for the talk by Rohan S. Puri,a biomedical engineer on entrepreneurship and ReDx initiative of media lab.</span></div>\r\n</li>\r\n</ol>',258,'Speakerphotos/rohan_puri.jpg','','0','LTC 5103','Pilani, Hyderabad'),(266,'2015-08-12 20:00:00',NULL,'Software Development,Quantum Computing : Q&A Session','<p>Q&amp;A Session</p>',259,'Speakerphotos/kovid.jpg','','1','LTC','Pilani'),(267,'2015-08-18 20:00:00',NULL,'The Science and Potential of Lucid Dreaming','',263,'Speakerphotos/Robert_Waggoner.jpg','','1','LTC','Pilani'),(268,'2015-08-22 20:00:00',NULL,'Black Holes, Information Paradox and its resolution','',261,'Speakerphotos/mathur_s.jpg','','1','LTC','Pilani'),(271,'2015-08-10 20:00:00',NULL,'Build a Dinosaur Project','',267,'Speakerphotos/Jack-Horner.jpg','','1','LTC','Pilani'),(275,'2015-09-02 20:00:00',NULL,'Value Based Selling: A Long Term Perspective on Customer Acquisition.','<p>We often extol the virtues of adopting a long term as opposed to a short term perspective when addressing business decisions. &nbsp;However, on the ground action often deviates from this lofty goal. &nbsp;Using concrete examples and research this talk shows the benefits of taking a long term view, particularly focused on optimizing customer acquisition and retention. &nbsp;We will develop an understanding of customer value management as a strategy for delivering superior value to targeted business segments while obtaining equitable returns through value based selling. Use of value based pricing, customer relationship management and brand building will be integral to the above discussion.</p>',266,'Speakerphotos/mitsloan.mit.edu.jpeg','','1','LTC','Pilani'),(274,'2015-08-27 19:30:00',NULL,'Career as an Author','',269,'Speakerphotos/Nikhil-Sachan.jpg','','1','5103','Pilani'),(276,'2015-09-16 20:00:00',NULL,'MIT Senseable City Lab','<p><span style=\"color: #222222; font-family: verdana, sans-serif; font-size: 12.8px;\">Over the past few decades, an emerging suite of miniaturized, networked, and pervasive digital technologies has woven itself into our urban environment &ndash; our buildings, urban infrastructures, objects, and communication devices. These digital technologies are creating a digital nervous system with which we interact on a daily basis.&nbsp; Advents in data analytics tools allows for these systems to be simulated, informing planners, policy makers, designers, researchers, and citizens alike.</span></p>',270,'Speakerphotos/newshaghaeli.jpg','','1','LTC','Pilani'),(279,'2015-08-27 18:00:00',NULL,'The Quest for the Substance of Substance','<p>Intellectual curiosity leads humans to the pursuit of understanding the laws of nature, at different scales. &nbsp;Over a period of time, discovery of these laws have evolved a scientific method that distinguishes itself from the creationist&rsquo;s perception of the universe. &nbsp;A recollection of discoveries of molecules to quarks will help to provide a perspective on what is science, albeit however narrowly, while enriching our understanding of nature in this realm. In the process we will learn some salient features of experiments at the European Organisation for Nuclear Research, CERN, and their results including those popularized by media by names that are best misnomers.</p>',273,'Speakerphotos/SudhirRaniwala.jpg','','1','LTC 5105','Pilani'),(278,'2015-09-05 20:00:00',NULL,'Start-ups in Advertisement','',272,'Speakerphotos/jatin.jpg','','1','LTC','Pilani'),(280,'2015-09-13 20:00:00',NULL,'Detection of Dark Matter','<div class=\"gmail_default\" style=\"color: #222222; font-size: 12.8px; font-family: verdana, sans-serif;\"><span class=\"il\">Matter</span>, as we know, constitutes less than 5% of the total mass of the universe.Rest of the&nbsp;<span class=\"il\">matter</span>&nbsp;is what we call&nbsp;<span class=\"il\">Dark</span>&nbsp;<span class=\"il\">Matter</span>, which can be felt gravitationally, but can\'t be seen.In the online talk, Dr. Mahapatra will talk about the experiments leading the world towards the detection of&nbsp;<span class=\"il\">Dark</span>&nbsp;<span class=\"il\">Matter</span>.</div>\r\n<div class=\"gmail_default\" style=\"color: #222222; font-size: 12.8px; font-family: verdana, sans-serif;\">Date of the talk is September 11.</div>',274,'Speakerphotos/download.jpe','','1','LTC 5103','Pilani'),(281,'2015-09-14 20:30:00',NULL,'Hindi Across the Borders','<p><span style=\"font-size: 12.8px; font-family: verdana, sans-serif;\">The stature of our culture and languages is in a dire need to be revived.&nbsp;</span><span style=\"font-size: 12.8px; color: #000000; font-family: verdana, sans-serif;\">A</span><span style=\"font-size: 12.8px; font-family: verdana, sans-serif;\">s a tribute to our national language on the auspicious day of Hindi Diwas,&nbsp;</span><span style=\"font-size: 12.8px; font-family: verdana, sans-serif;\">EMBRYO CLUB, in collaboration with the POETRY CLUB is organizing a talk based on&nbsp;</span><span style=\"font-size: 12.8px; font-family: verdana, sans-serif;\">how the language of Hindi is viewed beyond our borders.</span></p>',275,'Speakerphotos/unnamed.jpg','','1','LTC 5103','Pilani'),(283,'2015-02-25 20:30:00',NULL,'A career in Science','<p>A career in Science</p>\r\n<p>&ldquo;It&rsquo;s Pioneering! It&rsquo;s Exciting! It&rsquo;s rewarding! It&rsquo;s&hellip;not for the faint-hearted!&rdquo;</p>\r\n<p>It might not be everyone&rsquo;s cup of tea, but a career in science can be very enriching if you believe that you have an innate curiosity for how everything works, and a stubborn passion for learning by making mistakes.</p>\r\n<p>This talk would primarily cover the diverse career options available to students in pure sciences. Science is not monolithic, and I hope to describe some of the most gratifying job opportunities you can pursue with a background in science.</p>\r\n<p>Confused about where to start and how to go about it? Fear not, most of us (who trod this path before you) were equally lost. The talk should chart a roadmap for anyone fascinated by science but unsure of how to pursue relevant opportunities. I shall describe experiences leading up to my ongoing doctoral research to make it more relatable.</p>\r\n<p>At the end of this open-ended talk, you will either be scared away from an MS/PhD, or stoked to soon be a part of this rich endeavor. I hope it will be the latter, for</p>',276,'Speakerphotos/vijay.jpg','A talk in the series of BITS2MSPhD, as both the speakers are ex-BITSians.','1','LTC 5103','Pilani'),(284,'2015-04-10 19:30:00',NULL,'Career Centre and its utility for BITSians','<p>At the cusp of graduating? Wondering about how you can leverage the strong alumni network to Get ahead in your career?</p>\r\n<p>\"With the help of this platform, I&rsquo;ve been able to build contacts with BITS alumni who are in high profile positions now\"</p>\r\n<p>- Recent BITSian graduate</p>\r\n<p>&ldquo;Rest assured, I&rsquo;ll be using this platform routinely for my hiring requirements&rdquo;</p>\r\n<p>-BITSian Co-founder on hiring for openings in his company</p>\r\n<p>&ldquo;The support to those wanting to study on this platform further is impressive. Would have been nice to have around when I was in the process of applying myself&rdquo;</p>\r\n<p>-BITSian who graduated in 2010, did his Masters after graduating</p>\r\n<p>If you are curious to know of this centralized platform for BITSians facilitated by fellow BITSians, attend the talk by the Director of Career Services, BITSAA...</p>',280,'Speakerphotos/suhas_kashyap.jpg','','1','LTC 5103','Pilani'),(285,'2014-10-16 20:00:00',NULL,' The Lure of Astronomy: Engineering for a better view','<p>The central question in Astronomy is the origin of all we see around us. This quest drives astronomers to continuously improve the sensitivity and resolution of their instruments, enabling them to look deeper and into a more distant past. Major astronomical projects for the coming decade include the Thirty Meter Telescope in optical bands and the Square Kilometer Array in the radio band, in both of which India is a partner making major technical contributions. In addition, India is also involved in the Laser Interferometric Gravitational Wave Observatory (LIGO) project, and several space-based astronomy missions. This talk will discuss some of the engineering challenges of these upcoming projects and highlight opportunities for making technical contributions.</p>',281,'Speakerphotos/dipankar.png','The talk will be in collaboration with Astro Club for space week.','1','LTC 5103','Pilani'),(286,'2014-10-16 17:30:00',NULL,'My entrepreneurial journey with REDBUS','<p>The talk aims to give an insight of the entrepreneurial world and the career prospects in a start-up.The speaker is a distinguished alumni of BITS Pilani and would like to share his experience with the students. &nbsp; &nbsp;</p>\r\n<p>Mr. Phanindra Sama is the Founder and CEO of RedBus, India\'&rsquo;s First Online Bus Ticket Booking Service. Started in 2005, today RedBus is the largest online bus ticketing company in India. RedBus is run by a comparatively younger team. What started as a team of three grew into a team of 50 within 9 months.Today the turnover of the company is about Rs 1000 crores.&nbsp;</p>\r\n<p>He received his Electrical Engineering degree from BITS Pilani and Post-Graduation from Indian Institute of Science.</p>',282,'Speakerphotos/phanindra_Sama.jpg','','1','LTC 5103','Pilani'),(287,'2014-11-10 18:30:00',NULL,'Live Talk & Demo on 3D Printing','<p>3D printing is a bigger revolution than internet. From 3D printed houses to 3D printed human tissues, the technology is touching every aspect of our life. But are we prepared for this new technology and its impact on our career? BITS Embryo presents live talk on 3D printing by-</p>\r\n<p>Prudhvi Reddy (IIM Calcutta; BITS Pilani)</p>\r\n<p>Raja Sekhar Upputuri (China Europe International Business School, Shanghai; BITS Pilani)</p>',283,'Speakerphotos/pruthvi.jpg','Agenda\'s of the talk\r\n\r\n1. Introduction to 3D Printing.    \r\n2. Live Demo with a 3D Printer \r\n3. Guidance for a career on 3D Printing','1','LTC 5106','Pilani'),(288,'2014-11-12 20:00:00',NULL,'Enterpreneurship, and ReDx initiative of Media Lab','<p>BITS Embryo, Hyderbad is organizing a talk by Rohan Puri, Instructor MIT Media Lab. The talk will focus on Entrpreneurship.&nbsp;</p>\r\n<p>&nbsp;</p>',284,'Speakerphotos/rohan_puri.png','','1','LTC 5103','Pilani,Goa,Hyderabad'),(289,'2014-11-16 20:00:00',NULL,'How to build your own UAV','<p>This talk by research oriented Mr Anupam Purwar will focus on building your own Unmanned Aerial Vehicle.</p>\r\n<p>He would be covering a variety of topics:</p>\r\n<p>1) Career and Research at IISc including internships, MTech, MS and PHd in brief</p>\r\n<p>2) Unmanned Aerial Vehicles(UAVs) and allied research areas like Avionics, image processing, propulsion in depth</p>\r\n<p>3) His own initiative to take up BITSIANs for research work.</p>',285,'Speakerphotos/anupam.jpg','','1','LTC 5103','Pilani'),(290,'2014-11-18 18:00:00',NULL,'7 mantras of success in the corporate arena','<p>The world is moving fast and our expectations from our lives have changed. We are more career oriented now, seek to beat the odds and be entrepreneurs, and strive for success in whatever we do. But what defines our professional success is purely subjective to what we aspire to be in life. Samuel Rufus, the Apprentice Asia runner-up, known for maverick, creative and innovative ideas will be here with us on 18th of November to share his 7 mantras to success in the professional world. He was known as an &ldquo;in-house&rdquo; entrepreneur at Deloitte, went on to set-up Mxit (a South African Chat App) in India. from ground-up at Hyderabad, India.&nbsp;</p>',286,'Speakerphotos/sam.jpg','','1','Telepresence Classroom','Pilani,Goa,Hyderabad'),(291,'2015-02-01 19:00:00',NULL,'Digital Image Forensics','<p>Given an image or a video, can we tell which image or video camera has it been taken from? Can we tell if it was manipulated? Have you ever wondered this? If yes, Come to LTC 5103 on 01st Feb \'15. You\'ll all the answers you need.</p>',287,'Speakerphotos/naseer.jpg','','1','LTC 5103','Pilani'),(292,'2015-10-14 18:00:00',NULL,'Comets and interstellar medium','',289,'Speakerphotos/Ip.jpg','','1','LTC','Pilani'),(293,'2015-10-14 21:00:00',NULL,'Internet of Things','',290,'Speakerphotos/carla_diana.jpeg','','1','LTC','Pilani'),(294,'2015-09-18 20:30:00',NULL,'Astral Projections','',271,'Speakerphotos/steve_jones_1.jpeg','','1','LTC 5103','Pilani'),(295,'2015-10-20 21:00:00',NULL,'BITS2MSPhD','<p><span style=\"font-family: arial, sans-serif; font-size: 12.8px;\">An interactive session with Samarth Hegde (2009B1PS729P) and Ashwin Naik (2008A3PS140P)&nbsp;</span></p>\r\n<div style=\"font-family: arial, sans-serif; font-size: 12.8px; display: inline !important;\">\r\n<div style=\"display: inline !important;\"><span style=\"color: #222222;\">to clear any questions/doubts and misconceptions about the daunting Application process for&nbsp;</span>\r\n<div style=\"display: inline !important;\">\r\n<div style=\"display: inline !important;\"><span style=\"color: #222222;\">MS/PhD degrees abroad.&nbsp;</span></div>\r\n</div>\r\n</div>\r\n</div>',292,'Speakerphotos/Samarth.jpg','An interactive session with Samarth Hegde (2009B1PS729P) and Ashwin Naik (2008A3PS140P) \r\n\r\nto clear any questions/doubts and misconceptions about the daunting Application process for MS/PhD degrees abroad. Pertinent advice for all years and streams at BITS-Pilani. If you are keen on making your application competitive but unsure of how to go about it, you know whose talk to attend!','1','LTC 5103','Pilani'),(296,'2016-02-17 20:30:00',NULL,'The Diversity and Demographics of Distant Rocky Worlds','<p><span style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px;\">The discovery of exoplanets (planets outside our Solar System) has brought the settings of many science fiction stories within reach of scientific inquiry. Astronomers&rsquo; ever increasing sensitivity to smaller and smaller planets has opened the opportunity for empirical insights into the nature and demographics terrestrial worlds. Up to what size and mass do planets typically have rocky compositions? How Earth-like are these distant rocky worlds? How common are rocky planets in the Habitable Zones of their host stars? In this&nbsp;</span><span class=\"il\" style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px;\">talk</span><span style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px;\">, I will present the current constraints on each of these questions, appealing both to individual planet case studies and to planet population statistics</span></p>',294,'Speakerphotos/IMG_3513.png','','1','LTC','Pilani'),(297,'2016-01-23 20:00:00',NULL,'Machine Learning','<p>Recent developments with regards to some state of the art machine learning algorithms that make sense of data</p>',295,'Speakerphotos/ml.jpg','','1','LTC 5103','Pilani'),(298,'2016-03-02 20:00:00',NULL,'Frugal Innovation','<p><span style=\"color: #252525; font-family: sans-serif; font-size: 14px; line-height: 17.92px;\">Frugal innovation or Frugal Engineering&nbsp;</span><span style=\"color: #252525; font-family: sans-serif; font-size: 14px; line-height: 17.92px;\">is the process of reducing the complexity and cost of a good and its production.&nbsp;</span><span style=\"color: #252525; font-family: sans-serif; font-size: 14px; line-height: 17.92px;\">Usually this refers to removing non essential features from a&nbsp;</span><a style=\"color: #0b0080; text-decoration: none; font-family: sans-serif; font-size: 14px; line-height: 17.92px; background-image: none; background-repeat: initial;\" title=\"Durable good\" href=\"https://en.wikipedia.org/wiki/Durable_good\" target=\"_blank\">durable good</a><span style=\"color: #252525; font-family: sans-serif; font-size: 14px; line-height: 17.92px;\">, such as a car or phone, in order to sell it in&nbsp;</span><a style=\"color: #0b0080; text-decoration: none; font-family: sans-serif; font-size: 14px; line-height: 17.92px; background-image: none; background-repeat: initial;\" title=\"Developing country\" href=\"https://en.wikipedia.org/wiki/Developing_country\" target=\"_blank\">developing countries</a><span style=\"color: #252525; font-family: sans-serif; font-size: 14px; line-height: 17.92px;\">. Designing products for such countries may also call for an increase in durability</span><span style=\"color: #252525; font-family: sans-serif; font-size: 14px; line-height: 17.92px;\">&nbsp;and, when selling the products, reliance &nbsp;on unconventional&nbsp;</span><a style=\"color: #0b0080; text-decoration: none; font-family: sans-serif; font-size: 14px; line-height: 17.92px; background-image: none; background-repeat: initial;\" title=\"Distribution (business)\" href=\"https://en.wikipedia.org/wiki/Distribution_(business)\" target=\"_blank\">distribution</a><span style=\"color: #252525; font-family: sans-serif; font-size: 14px; line-height: 17.92px;\">&nbsp;channels.</span><span style=\"color: #252525; font-family: sans-serif; font-size: 14px; line-height: 17.92px;\">Sold to so-called \"</span><a style=\"color: #0b0080; font-family: sans-serif; font-size: 14px; line-height: 17.92px; background-image: none; background-repeat: initial;\" title=\"Bottom of the pyramid\" href=\"https://en.wikipedia.org/wiki/Bottom_of_the_pyramid\" target=\"_blank\">overlooked consumers</a><span style=\"color: #252525; font-family: sans-serif; font-size: 14px; line-height: 17.92px;\">\", firms hope volume will offset razor-thin&nbsp;</span><a style=\"color: #0b0080; text-decoration: none; font-family: sans-serif; font-size: 14px; line-height: 17.92px; background-image: none; background-repeat: initial;\" title=\"Profit margin\" href=\"https://en.wikipedia.org/wiki/Profit_margin\" target=\"_blank\">profit margins</a><span style=\"color: #252525; font-family: sans-serif; font-size: 11.2px; line-height: 11.2px;\">.</span><span style=\"color: #252525; font-family: sans-serif; font-size: 14px; line-height: 17.92px;\">Such services and products need not be of inferior quality but must be provided cheaply.</span><span style=\"color: #252525; font-family: sans-serif; font-size: 14px; line-height: 17.92px;\">Several US universities have programs that develop frugal solutions. Basically&nbsp;</span><span style=\"color: #252525; font-family: sans-serif; font-size: 14px; line-height: 17.92px;\">&nbsp;Entrepreneurial Design for Extreme Affordability&nbsp;.</span></p>',300,'Speakerphotos/jaideep.rect_1-300x168.jpg','','1','LTC','Pilani'),(299,'2016-04-01 19:30:00',NULL,'Have we reached the end of Physics?','<p><br style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px;\" /><span style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px;\">Why is there something rather than nothing? Why does so much interesting stuff exist in the universe? Particle physicist Harry Cliff works on the Large Hadron Collider at CERN, and he has some potentially bad news for people who seek answers to these questions. Despite the best efforts of scientists (and the help of the biggest machine on the planet), we may never be able to explain all the weird features of nature. Is this the end of physics? Learn more in this fascinating talk about the latest research into the secret structure of the universe.</span></p>',301,'Speakerphotos/harry_cliff.jpg','','1','LTC 5103','Pilani'),(300,'2016-08-20 20:30:00',NULL,'Quantum Entanglement','<p><span style=\"color: rgba(0, 0, 0, 0.701961); font-family: verdana, sans-serif; font-size: 12.8px; font-weight: bold;\">Albert Einstein&nbsp;</span><span style=\"color: rgba(0, 0, 0, 0.701961); font-family: verdana, sans-serif; font-size: 12.8px;\">once dubbed&nbsp;</span><a style=\"color: #1155cc; font-family: verdana, sans-serif; font-size: 12.8px; font-weight: bold;\" href=\"http://t.sidekickopen60.com/e1t/c/5/f18dQhb0S7lC8dDMPbW2n0x6l2B9nMJW7t5XX463BzFbMQZkgqdnqSWVS9Tpj56dy6xf2-5Kkv02?t=http%3A%2F%2Fwww.dailymail.co.uk%2Fsciencetech%2Farticle-3283317%2FEinstein-wrong-Ground-breaking-test-reveals-spooky-quantum-entanglement-phenomenon-real.html&amp;si=4507282640207872&amp;pi=f959992b-9b25-472e-d529-bf8c7281021c\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://t.sidekickopen60.com/e1t/c/5/f18dQhb0S7lC8dDMPbW2n0x6l2B9nMJW7t5XX463BzFbMQZkgqdnqSWVS9Tpj56dy6xf2-5Kkv02?t%3Dhttp%253A%252F%252Fwww.dailymail.co.uk%252Fsciencetech%252Farticle-3283317%252FEinstein-wrong-Ground-breaking-test-reveals-spooky-quantum-entanglement-phenomenon-real.html%26si%3D4507282640207872%26pi%3Df959992b-9b25-472e-d529-bf8c7281021c&amp;source=gmail&amp;ust=1471747076140000&amp;usg=AFQjCNGAhygSIR5sTkOYssiXhFi1BmnyBg\">Quantum Entanglement</a><span style=\"color: rgba(0, 0, 0, 0.701961); font-family: verdana, sans-serif; font-size: 12.8px;\">&nbsp;\"</span><span style=\"color: rgba(0, 0, 0, 0.701961); font-family: verdana, sans-serif; font-size: 12.8px; font-weight: bold;\">spooky actions at a distance</span><span style=\"color: rgba(0, 0, 0, 0.701961); font-family: verdana, sans-serif; font-size: 12.8px;\">,\" and the concept remains one of the starkest examples of how quantum theory differs from our usual intuitions about space, time, and matter. Physicists have tested quantum entanglement in laboratories for forty years, and have always found results consistent with quantum theory; today entanglement is at the heart of next-generation devices like quantum computers and quantum encryption. Yet every experimental test to date has been subject to one or more \"loopholes,\" which could possibly account for the results even in the absence of genuine quantum entanglement. This lecture describes the latest experimental tests of quantum entanglement, including a new experiment that uses some of the oldest light in the universe to address the last major loophole and pave the way for a genuinely loophole-free test of quantum entanglement.</span></p>',306,'Speakerphotos/Kaiser.small.jpg','','1','LTC 5103','Pilani'),(301,'2016-08-21 20:30:00',NULL,'First Step Towards  Drones','<p><span style=\"color: #222222; font-size: 12.8px; font-family: verdana, sans-serif;\">What is 0.5m in size, weighs about 0.5 kg; Rancho flies it and everybody wants it. Talk about double flips, dancing around obstacles or just taking over the world, drones are everywhere. Every few weeks, there&rsquo;s a new one showing drones swarming, mapping, surveilling, building, and generally wowing us with ever greater powers. And we bring you the action live from University of Pennsylvania, from formation flying to simply playing ping-pong in the air.</span></p>\r\n<div style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"font-family: verdana, sans-serif;\"><br /></span>\r\n<div>\r\n<div style=\"font-size: 12.8px;\"><span style=\"font-family: verdana, sans-serif;\">During his research at the GRASP Lab, Yash Mulgaonkar and his colleagues have created autonomous aerial robots capable of flying aggressive maneuvers and even undertaking complex tasks that are difficult for humans to perform. His latest breakthroughs: The<strong>&nbsp;Dragonfly</strong>&nbsp;and the&nbsp;<strong>Picobug</strong>&nbsp;- inspired by insects like honeybees and beetles are small, fully autonomous robots weighing less than 30g that are robust to collisions with the environment and can easily navigate through confined spaces like pipes and air ducts.</span></div>\r\n<div style=\"font-size: 12.8px;\"><span style=\"font-family: verdana, sans-serif;\">&nbsp;</span></div>\r\n<div style=\"font-size: 12.8px;\"><span style=\"font-size: 12.8px;\"><span style=\"font-family: verdana, sans-serif;\">The Falcon robots he\'s developed for the FLA program carry sophisticated sensor payloads and powerful on-board computers that can perceive an unknown environment and build real-time maps to give the user a full 3D situational awareness for use in first response and search and rescue operations.</span></span></div>\r\n</div>\r\n</div>',307,'Speakerphotos/MuCbcTWt.jpg','Yash Mulgaonkar is a research scientist at the University of Pennsylvania, currently pursuing his PhD on Multi-Robot Systems, under the famous Vijay Kumar of GRASP Labs, Upenn. Early in his career, Mulgaonkar developed the world’s smallest autonomous drone. He’s since been focused on how to make drones and other robots accessible to everyone by developing rapid fabrication methods for them. His research is also focused on training robots to work together so they can accomplish tasks more efficiently. He has also been listed in \'2016 Forbes 30under30 list for Science\'.\r\n\r\n','1','LTC 5103','Pilani'),(302,'2016-09-09 20:00:00',NULL,'Body Language','<p><span style=\"font-family: arial, helvetica, sans-serif; font-size: 13px;\">This talk described how to use your body language to excel in social situations like informal meetings,Interviews ,etc.</span></p>',308,'Speakerphotos/Mark_Bowden-2013-2.jpg','','1','LTC 5103','Pilani'),(303,'2016-09-11 20:00:00',NULL,'INFORMATION RETRIEVAL','',310,'Speakerphotos/3927748_orig.jpg','','1','LTC 5103','Pilani'),(305,'2017-01-21 17:30:00',NULL,'Metaphysics and Tarots','<div style=\"font-size: 12.8px;\">\"The most powerful sources of information come from within;&nbsp;</div>\r\n<div style=\"font-size: 12.8px;\">the Tarot aids in coming in contact with one\'s Higher Self.\"</div>\r\n<div style=\"font-size: 12.8px;\">&nbsp;</div>\r\n<div style=\"font-size: 12.8px;\">Metaphysics attempts to find answers to existence, objects &amp; their properties,&nbsp;</div>\r\n<div style=\"font-size: 12.8px;\">space and time, cause and effect, and possibility. The subject of Metaphysics includes tarot readings. Tarot cards are believed to be excellent indicators, that naturally act as a link to your higher self and the collective unconscious.</div>',312,'Speakerphotos/tripti-chitkara1.jpg','','0','LTC 5103','Pilani'),(304,'2017-01-23 20:30:00',NULL,'Optimization of lower-limb exoskeletons','<p>Gurvinder Singh is an electrical engineer who is <strong>&nbsp;Professor of Robotics and Autonomous Systems, Professor of Robotics and the Built Environment and &nbsp;a Professor of Robotics.</strong></p>',311,'Speakerphotos/gurvinder_singh.jpg','','1','LTC 5103','Pilani'),(306,'2017-01-29 20:00:00',NULL,'Gravitational Waves','<p>Gravitational waves are \'ripples\' in the fabric of space-time caused by some of the most violent and energetic processes in the Universe. Albert Einstein predicted the existence of gravitational waves in 1916 in his general theory of relativity. Einstein\'s mathematics showed that massive accelerating objects (such as neutron stars or black holes orbiting each other) would disrupt space-time in such a way that \'waves\' of distorted space would radiate from the source (like the movement of waves away from a stone thrown into a pond). Furthermore, these ripples would travel at the speed of light through the Universe, carrying with them information about their cataclysmic origins, as well as invaluable clues to the nature of gravity itself.</p>',313,'Speakerphotos/whitcomb.png','','0','LTC 5103','Pilani'),(308,'2017-02-05 20:00:00',NULL,'Gravitational Waves','<p>Gravitational waves are \'ripples\' in the fabric of space-time caused by some of the most violent and energetic processes in the Universe. Albert Einstein predicted the existence of gravitational waves in 1916 in his general theory of relativity. Einstein\'s mathematics showed that massive accelerating objects (such as neutron stars or black holes orbiting each other) would disrupt space-time in such a way that \'waves\' of distorted space would radiate from the source (like the movement of waves away from a stone thrown into a pond). Furthermore, these ripples would travel at the speed of light through the Universe, carrying with them information about their cataclysmic origins, as well as invaluable clues to the nature of gravity itself.</p>',313,'Speakerphotos/whitcomb_1.png','','0','LTC 5103','Pilani'),(309,'2017-01-30 20:30:00',NULL,'Muons','<p><span style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px;\">The talk is based on elementary particles muons that are one of the particles in Standard Table.The talk covers the following component:</span></p>\r\n<div style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px;\">1.History of muons&nbsp;</div>\r\n<div style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px;\">2.Muon spin spectroscopy</div>\r\n<div style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px;\">3.Discovery of muons and methods to produce them</div>\r\n<div style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px;\">4.Techniques in advanced muon SR</div>\r\n<div style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px;\">5.Research Themes in muon spin spectroscopy</div>',314,'Speakerphotos/brewer_jesse.png','','1','LTC 5103','Pilani'),(310,'2017-02-06 21:00:00',NULL,'String Theory','<p>&nbsp;Space&nbsp;and&nbsp;time&nbsp;</p>\r\n<div>together constitute one of the most basic<br />elements of physical reality.&nbsp; Since Einstein&nbsp;spacetime&nbsp;has become an<br />active participant in the dynamics of gravity. However, our notion of<br />a&nbsp;quantum&nbsp;spacetime&nbsp;is still rudimentary. String theory, building upon<br />hints provided from the physics of black holes, seems to be suggesting<br />a very novel, \"holographic\" picture of what&nbsp;quantum&nbsp;spacetime&nbsp;might<br />be. This relies on some very surprising connections of gravity with<br />quantum&nbsp;field theories. In these lectures, after a general overview, I<br />will try and convey some of the flavour of these connections as well<br />as its significance and impact.</div>\r\n<p>&nbsp;</p>',315,'Speakerphotos/Rajesh_Gopakumar_2009.jpg','','1','LTC 5103','Pilani'),(311,'2017-02-07 20:00:00',NULL,'Mars Curiosity Rover','<p><span style=\"font-family: calibri; font-size: 14.6667px;\">Nearly five years after its celebrated arrival at Mars, the Curiosity rover continues to reveal Mars as a once-habitable planet.&nbsp; Early in the planet&rsquo;s history, generations of streams and lakes created the landforms that Curiosity explores today.&nbsp; The rover currently is climbing through the foothills of Mount Sharp, a 3-miile-high mountain formed from sediment brought in by water and wind.&nbsp; This talk will cover the latest findings from the mission, the challenges of exploration with an aging robot, and what lies ahead.</span></p>',316,'Speakerphotos/Vasavada1.jpg','','1','LTC 5103','Pilani'),(312,'2017-03-20 20:30:00',NULL,'Gravitational Waves','',313,'Speakerphotos/index.jpg','','1','LTC 5103','Pilani'),(315,'2017-03-31 20:30:00',NULL,'Artificial Intelligence','<p><span style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px;\">The topic, he would like to speak on will be \"</span><strong style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px;\">Artificial&nbsp;Intelligence: Entrepreneurship opportunities for next gen Data Scientists</strong><span style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px;\">\", primarily targeted for Computer Science, Information System &amp; Mathematics department students.</span></p>',317,'Speakerphotos/Shobhit.jpg','','1','LTC 5103','Pilani');
