INSERT INTO `presenters` VALUES (1,'Shashikant Khandelwal','Cofounder / Chief Architect / CTO,\r\nTheFind Inc.\r\n\r\nM.S. (Computer Science)\r\nStanford University\r\n\r\nBE. (Computer Science)\r\nBITS Pilani, Class of 2001','Shashikant is BE(Hons) CS from BITS Pilani (2001), and MS CS from Stanford (2004). He is currently leading the technology team at TheFind Inc. <a href=\"http://www.thefind.com\">TheFind</a> is a search engine startup which is trying to break the barriers of comprehensiveness and relevance for shopping search. ','fd97093@yahoo.com','310 Villa St, Mountain View, CA - 94041'),(2,'Mayur Shah','Senior Software Engineer,\r\nQualcomm Inc,\r\n\r\nM.S. (Electrical Engineering)\r\nArizona State University\r\n\r\nM.Sc. (Physics), B.E. (Electrical & Electronics)\r\nBITS Pilani, Class of 2002.','Mayur Shah received M.S. in Electrical Engineering from Arizona State University in 2004. He received B.E.(Hons.) in Electrical Engineering and M.Sc. (Hons.) Physics from Birla Institute of Technology and Science, Pilani, India, in 2002. He is currently working on GPS receiver algorithm design at Qualcomm. ','mayurshah530@yahoo.com','2235 California Street, Apt 193, Mountain View, CA - 94040'),(3,'Shilpa Gupta','Phd (Industrial Statistics) Arizona State University\r\n\r\nMS (Industrial Engineering) Arizona State University, 2004\r\n\r\nBE (Hons) Mechanical Engg, BITS Pilani, 2001','Shilpa Gupta is currently doing Phd in Industrial Statistics at ASU. She holds a Six Sigma Black Belt and a Certificate in Statistics.','',''),(4,'Sagnik Nandy','Software Engineer, Google Inc\r\n\r\nPhd Computer Science, UCSD, 2005\r\n\r\nBE(Hons) CS, BITS Pilani, 2001','Sagnik Nandy received his B.E. (Hons) in Computer Science from BITS, \r\nPilani in 2001. He subsequently went to University of Califronia, San Diego and recieved his PhD in Computer Science in 2005. He is currently working as a Software Engineer at Google in Mountain View, CA. ','',''),(5,'Nitish Korula','Phd CS, UIUC\r\nBE(Hons) CS, BITS Pilani','Nitish is pursuing a PhD at UIUC in Algorithms','',''),(6,'Ashish Shah','Lead iSCSI team, CISCO Systems,\r\nMS EE, Stanford, 2001, \r\nBE(Hons) EEE, BITS Pilani, 1998\r\n','Ashish Shah is BE(Hons) EEE from BITS Pilani (1998), and MS EE from Stanford (2001). He is currently leading the iSCSI team in the MDS SAN Switch product line at the Data Center Business Unit of Cisco Systems in San Jose, CA.','ashishbshah@gmail.com','7385 Briza Loop, San Ramon CA 94582'),(7,'Satyam Vaghani','Lead, Structured Data Access Group, Vmware,\r\nMS CS, Stanford, 2002,\r\nBE(Hons) CS, BITS Pilani, 2000','Satyam Vaghani is BE(Hons) CS from BITS Pilani (2000), and MS CS from Stanford (2002). He is currently leading the Structured Data Access R&D group at VMware headquarters in Palo Alto, CA. VMware, an EMC company (NYSE: EMC), is the global leader in virtual infrastructure software for industry-standard systems.','',''),(8,'Ketan Bhatt','Post Doctoral Fellow, UIUC,\r\nPhd, Chemical and Biomolecular Engg, NCSU, 2006,\r\nBE(Hons) Chemical Engg, BITS Pilani, 2001\r\n','Ketan Bhatt received his B.E. (Honors) in Chemical Engineering from BITS, \r\nPilani in 2001. He joined Professor Orlin Velev’s research group at North Carolina State \r\nUniversity in Raleigh soon after. He received his M. S. in Chemical in 2003 and his Ph. D. \r\nin Chemical & Biomolecular Engineering in 2006. His graduate research was focused on \r\nthe manipulation and assembly of colloidal particles and fluids using alternating electric \r\nfields. His research work has lead to publications in such prestigious journals as Nature \r\nand Nature Materials. He has accepted a post doctoral research position in Professor \r\nJennifer Lewis’s research group at University of Illinois at Urbana-Champaign starting \r\nSeptember 2006. ','',''),(9,'Pramila Rani','R&D Engineer, Metis Design,\r\nPhd, Electrical Engg, Vanderbilt University, 2005,\r\nBE(Hons) EEE, BITS Pilani, 2001\r\n','Pramila Rani, R&D Engineer at Metis Design, received her B.E(Honors) in Electrical & Electronics Engineering from Birla Institute of Technology and Science in 2001, and M.S. in Electrical Engineering from Vanderbilt University in 2003. As part of her Masters’ work she developed a fuzzy-logic based affect-recognition system that could predict the underlying affective state of a person from his/her physiological signals. Continuing her research in this field, she received her Ph.D. in Electrical Engineering from Vanderbilt University in 2005. Her research focused on the area of human-robot interaction in which she developed affective feedback-based implicit communication framework for advanced human-robot interaction. She specializes in signal processing, machine learning, robotics, and linear control theory. Her work on making intelligent, emotion-sensitive robots was featured in several news websites and on TV, including BBC and TechTV. She was among the 35 students selected worldwide to take part in the RAS/IFRR Summer School on \"Human-Robot Interaction\" in July 2004. She was also nominated for the Chancellor’s list during 2004 and then again in 2005. Dr. Rani has several technical publications in her areas of expertise, including three book chapters, and is currently a member and contributing author for the IEEE, and AAAI. ','',''),(10,'K L Arvind','Manager of Technology, Sarnoff in India','Arvind graduated from Birla Institute of Technology and Science with a Masters degree in Systems Software and a Masters degree in Chemistry. He then went on to do a PhD in Robotics from Carnegie Mellon University. During the course of graduate study, he also dabbled with a startup on virtual medical simulation and also had a stint at a high-technology small business (Intelligent Automation). After that he worked at Honeywell, Bangalore for some time and now he is managing technology for Sarnoff in India.','',''),(11,'Sivaramakrishnan Narayanan (k2)','PhD, CS, OSU,\r\nBE(Hons) CS from BITS Pilani, 2002\r\n','k2 is BE(Hons) CS from BITS Pilani (2002) and is currently pursuing PhD at The Ohio State University, Columbus, OH. He has two arms and two legs.','k2_181@yahoo.com','865 Deacon Circle Columbus, OH - 43214'),(12,'Arthi Jayaraman','Phd, Chemical Engg, NCSU, 2006,\r\nBE(Hons) Chemical Engg, BITS Pilani, 2000\r\n','Arthi Jayaraman received her B.E. (Hons) in Chemical Engineering at BITS Pilani in 2000. She went on to work with Dr. Carol K. Hall and Dr. Jan Genzer at North Carolina State University and got her M.S. Chemical Engineering in 2002 and Ph D in Chemical Engineering in 2006. Her doctoral work was devoted to understanding molecular recognition in biomimetic polymer systems using computer simulations. Her research has been published in high impact journals such as Physical Review Letters and Biophysical Journal. Currently, she is doing her postdoctoral work with Dr. Kenneth Schweizer in the department of Material Science and Engineering at University of Illinois at Urbana-Champaign.','',''),(13,'Ayusman Sarangi','Software Engineer, Adobe Systems,\r\nM.Sc  (Hons) Biology with BE(Hons) CS from BITS Pilani, 2003','M.Sc  (Hons) Biology with BE(Hons) CS from BITS Pilani, 2003\r\nAfter working with Sun Microsystems, Bangalore for a short period, I have been working with Adobe Systems, Noida .','',''),(14,'Chinmaya Mishra','PhD EE, Texas A & M,\r\nBE(Hons) EEE, BITS Pilani, 2002\r\n','Chinmaya Mishra received the B.E. (Hons.) degree in\r\nElectrical and Electronics Engineering from BITS,\r\nPilani in 2002 and the M.S. degree in Electrical\r\nEngineering from Texas A&M University, College\r\nStation, TX in 2004. Since the fall of 2004, he has\r\nbeen working toward the Ph.D. degree at the Analog and\r\nMixed Signal Center, Texas A&M University. \r\nIn the spring of 2002, he was an intern in the DSP\r\nDesign Group at Texas Instruments, Bangalore, India.\r\nDuring the summer of 2005, he was a RF IC Design\r\nEngineer (intern) at WiQuest Communications, Allen,\r\nTX. Since February 2006, he has been an intern in the\r\nCommunications Technology Department at IBM T. J.\r\nWatson Research Center, Yorktown Heights, NY. \r\nMr. Mishra received the IEEE Solid-State Circuits\r\nSociety Predoctoral Fellowship for 2006-2007. \r\n','',''),(15,'Shivakumar G','Software Engg, Yahoo India,\r\nBE(Hons) CS, BITS Pilani, 2005',NULL,'',''),(16,'Subramaniyan Krishnan','MBA, ISB, 2005,\r\nBE(Hons) EEE, BITS Pilani, 2001','Worked for DaimlerChrysler Research & Technology India for three years before completing MBA from Indian School of Business (Class of 2005. Working with Trilogy India for the past one year.','fd97116@yahoo.com','Trilogy E-Business Software India Pvt Ltd, No 5, Salarpuria Infinity, Bannerghatta Road, Bangalore - 560029, Karnataka'),(17,'Madhurjya Banerjee','IIM Bangalore, 2005-2007, BE(Hons) E&I, BITS Pilani, 2001-2005','','madhurjya82@yahoo.com','64, Khelat Babu Lane, Kolkata - 700037, West Bengal'),(18,'Ankush Bagotra','Be(Hons) BITS Pilani, 1999','Presntly Working with Atrenta India Pvt Ltd as Lead Engineer','',''),(20,'Madhusudan S.N.','Mahindra British Telecom, \r\nPGDBM, IIMA, 2005,\r\nBE(Hons) EEE, BITS Pilani, 2001','Madhu is working onsite with Bristish Telecom in London and graduated from IIMA','sn_madhusudan@yahoo.com','82, Pempath Place London HA9 8QR United Kingdom'),(21,'Nasir Memon','Professor - Department of Computer and Information Science & Director, ISIS Lab, Polytechnic University.\r\nPhd, CS, UNL, 1992,\r\nBE(Hons) Chemical MSc Mathematics, BITS Pilani, 1982\r\n','Prof Memon has strong research interests in Data Compression, Computer and Network Security, Digital Forensics and Multimedia Processing. For more information, please visit <a href=\"http://isis.poly.edu/memon\" target=\"_blank\">his home page</a> and <a href=\"http://isis.poly.edu\" target=\"_blank\">his lab</a>','memon@poly.edu','6 MetroTech Center, Polytechnic University, Brooklyn, NY 11201 USA'),(22,'Saurabh Deshpande','PhD student, CS, Univ of Rochester, NY,\r\nBE(Hons) CS, BITS Pilani, 2005','Saurabh Deshpande is a second year Phd student in\r\nStatistical NLP at University of Rochester, NY. He\r\ngraduated from BITS, Pilani in 2005 with a dual degree\r\nin Computer Science and Biological Science.\r\n','saurabh@cs.rochester.edu','7/A, Sur-Sangam Apts, Mirambica Rd, Naranpura, Ahmedabad - 380013'),(23,'Aditya P. Mathur','Professor of Computer Science & Associate Dean, Graduate Education, School of Science, Purdue University,\r\nPhD, Computer Science, BITS Pilani, 1977\r\n','Aditya Mathur conducts research in the areas of software testing, reliability, and formal approaches for software process control. Mathur has been a crusader for the use of code coverage criteria in the estimation of software reliability or as an orthogonal metric to assess confidence in the reliability estimates. He has proposed the \"Saturation Effect\" as a motivating device for quantitative test assessment using an increasingly powerful suite of criteria. This device is often used by vendors to enhance marketing of their test tools. Mathur, in collaboration with Raymond DeCarlo, has pioneered research into the use of feedback control in software development.\r\nPlease visit his webpage <a href=\"http://www.cs.purdue.edu/people/faculty/apm/\"> here</a>','',''),(24,'Shampa Kandoi','PhD Chemical Engg, U Wisc-Mad, 2006,\r\nB.E. (Hons) Chemical Engineering, BITS, Pilani, 2001','Shampa Kandoi received her B.E. (Honors) in Chemical Engineering from BITS, Pilani \r\nin 2001. Subsequently, she joined University of Wisconsin-Madison and started working \r\non her PhD in the area of heterogeneous catalysis and surface science, under the \r\nsupervision of Prof. Manos Mavrikakis and Prof. James A. Dumesic. As part of her \r\ndoctoral work, she has employed a combination of theoretical calculations, experiments, \r\nand microkinetic modeling to study industrially important chemical reactions, primarily \r\nfocusing on the production and purification of hydrogen for fuel cell applications. She \r\nhas several publications in peer-reviewed journals and has presented her research at \r\nvarious occasions. After defending her PhD thesis in August 2006, she will be taking up a \r\nresearch position in the Fuel Cells (Power) division of United Technologies Corporation. ','',''),(25,'Karthick Chinnaswami','Sr Staff Engg, Qualcomm,\r\nMS CS, Clemson University,\r\nMSc(Tech), IS, BITS Pilani, 1994','Karthick Chinnaswami (90C6xxxxx) graduated from Pilani with M.Sc.(Tech.) Information Systems in 1994 and M.S. Computer Science from Clemson University. He is currently a Senior Staff Engineer/Manager at Qualcomm where he is co-architect of an effort for refactoring the multimedia subsystem.','karthick@qualcomm.com','9753 Wren Bluff Dr, San Diego, CA 92127'),(26,'Ashish Garg','Working in Cypress Semiconductor, San Jose,\r\nBE(Hons) Instrumentation, BITS Pilani, 2001\r\n\r\n','Ashish is also the secretary of BITSAA Silicon Valley Chapter.','',''),(27,'Sanketh Shetty','PhD (ECE) UIUC (current),MS(EE) NCSU(04-06), B.E(Hons.) EEE BITS Pilani (00-04) ',NULL,'sanketh.shetty@gmail.com','202 E John Street, B 12, Champaign, IL - 61820, USA'),(28,'V Sravan Kumar','ICICI Bank\r\nPGDBM, IIMA, 2003, BE(Hons) EEE, BITS Pilani, 2001',NULL,'',''),(29,'Uma Chandrasekaran','Grad Student, Medical College of Georgia, USA, \r\nMSc(Bio Sci), BE(Hons) Instrumentation, BITS Pilani, 2005','Uma Chandrasekaran, Graduate student  at Medical College of Georgia(MCG), received her M.Sc(Hons.) Biological Sciences and B.E(Honors) in Electrical & Instrumentation Engineering from Birla Institute of Technology and Science in 2005. She did her Summer Fellowships in India (IISc) as well as in Medical College of Georgia(USA).As part of her Internship  she worked on signal transduction in T-cells  and went on continue her Phd with the same lab group in MCG. At present her area of research is Regulatory T-cells, their enrichment and delineation of their signaling.','',''),(30,'Alagu Periyannan, Jayan Ramankutty, Prem Jain, Punita Pandey, Raju Reddy, Vivek Paul',NULL,NULL,'',''),(31,'Mahima Swamy','Graduate Student( Phd) in Molecular Immunology,  Max Planck Institute for Immunobiology, Freiburg, Germany 2003.\r\n<br>\r\nM.Sc. Biological Sciences, ME, Biotechnology BITS Pilani, 1998-2003','Mahima Swamy is currently a Phd student in molecular immunology at the Max Planck Institute for Immunobiology, Germany. She completed her M.Sc. Biological Sciences and M.E., Biotechnology from BITS Pilani in 2003.','',''),(32,'K Yogesh',NULL,NULL,'',''),(33,'Manoj Kannan','M.Sc. (Tech.) Information Systems, M.E. Biotechnology from BITS-Pilani','Manoj went to BITS in 1996 and did both his undergraduate and masters degrees there. Manoj is working toward Ph.D. at the National Cancer Institute, Maryland, USA.','',''),(34,'Dr Rahul Ganguly','B.Pharm, BIT, Mesra, 1992,\r\nM. Pharm, BITS, Pilani, 1994,\r\nPh.D, University of Georgia, 2003\r\n','Dr. Ganguly works on the health economic and outcomes research aspects of\r\nneurological products in early phases of development at GlaxoSmithKline, Global Research and Development. He is also adjunct assistant professor at\r\nthe University of Arkansas, Pharmaceutical Evaluation and Policy department. Before joining GlaxoSmithKline he was on faculty at the University of Mississippi, School of Pharmacy teaching and developing a research program in health economics and outcomes research.\r\n<p>\r\nHis research interests are:\r\n\r\n<li> Methodological issues in retrospective database research. For e.g. techniques for reducing selection bias, research design\r\n<li> Reimbursement and access for pharmaceutical products and their impact on overall resource utilization (Policy analysis)\r\n<li> Cost-effectiveness analysis of pharmaceutical products (Decision modeling)\r\n\r\n','rahgang@hotmail.com','5108-203 copper ridge drive, durham, NC - 27707, USA'),(109,'Dr. Subhash Gupta','CEO of \"Apex Decisions\"','PhD,Physics,Columbia University\r\nMS,Physics,Columbia University\r\nM.A. M.Phil','',''),(35,'Sasi Kanth Chemalamudi',NULL,'Founded Habits Edutainment Pvt. Ltd. - India\'s first Edutainment Company. We have two more divisions - Habits Technology Office and Habits Business Consultancy Division (for start-ups and small-businesses)\r\n<br>\r\nWe are a team of 8 as of now and we are organising our second recruitment drive aiming at being a team of 18 by  mid Feb.\r\n<br>\r\nWe are working on lauching Habits Edutainment Lounges all over the city of Hyderabad (and gradually spread all over India)\r\n<br>\r\nI was selected by BusinessWeek as one of Asia\'s 20 Best Entrepreneurs under the age of 25. I wish to have a degree in Entrepreneurship from INSEAD (France) once I set Habits on the track perfectly ','sasi@habits.in',''),(36,'Abhinav Khushraj','Strategy & Business Development Manager at NOKIA, USA\r\nMSc.(Tech) Information Sys. from BITS Pilani(1999)\r\nMBA from MIT Sloan School of Management (2008)\r\nMS in computer science, University of Florida (2001)','Abhinav is a strategy and business development manager at Nokia. He has worked at General Catalyst Partners conducting due diligence of internet startups. Previously he has worked at Booz Allen in strategy consulting. He actively pursues business ideas and advises wireless and internet startups. He is involved with BITSAA CEL initiatives and has been a BITS Embryo speaker. While doing his MBA at MIT Sloan School of Management, he led the MIT VC Conference and introduced the MIT Entrepreneurship Showcase drawing entrepreneurs from across the world. Previously, he worked at Citrix Systems leading product development for a new business line. ','akhushraj@gmail.com',''),(37,'Abhinav Gattani','MBA Student, Kellogg\'s School of Management',NULL,'abhinav_gattani@yahoo.com',''),(38,'Prerna Goel','MBA, Queens Business School','Prerna Goel did her MBA from Queens School of Business, Canada. She is currently working with CIBC Toronto. Previously, she worked for close to three years in Texas Instruments and had a brief stint at Techspan India Ltd.\r\n','prernagoel@gmail.com',''),(39,'Vamsi Krishna Sridharan','Doctoral Research Scholar, Environmental Fluid Mechanics and Hydrology, Department of Civil and Environmental Engineering ,Stanford University\r\n\r\n\r\n','Vamsi graduated from BITS with BE (Hons) Civil Engineering Degree as part of the class of 2004. He then did Master of Science (M.Sc.)\r\nDegree in Environmental Science and Engineering, from the Singapore Stanford Partnership Program (SSP), a joint program with Stanford\r\nUniversity and Nanyang Technological University (NTU), Singapore, and graduated in 2005. He worked in Singapore at NTU as a Project Officer\r\nunder Dr. Adrian Law in the area of Fluid Mechanics applied to membrane bioreactors for wastewater treatment. He is currently pursuing a PhD in Environmental Fluid Mechanics at Stanford University under the guidance of Dr. Stephen Monismith. He is working on a computational model to study the effect of flows in the San Fancisco Bay on movement of fish larvae. His research experience includes computational modeling and lab scale non-invasive measurements of fluid flow. For the past two years, he has also been a teaching assistant in three graduate level courses in Fluid Mechanics and Hydrology taught at Stanford University. While at BITS, He was an active member of the Civil Engineering Association , and served as second year representative of the association and as APOGEE coordinator and High rise magazine sub-editor in his third year. Some of the projects he worked on while at BITS are: Expert system based drought management under Dr. K. S. Raju, GIS based drought management under Dr. Rajiv Gupta, Municipal Solid Waste characterization in Vidya Vihar campus under Dr. V. Ramakrishna and design and fabrication of live suspension bridge under Dr. S.P. Gupta. He was also an active member of the Department of Trophy Fabrication during  and the Department of Closed Circuit Television during his first year. During his second and third years, he was also involved in the cultural activities of the Pilani Tamil Mandram (PTM) as an amateur pantomimer.','',''),(40,'Dr.Lakshminarayanan Samavedham','Assistant Professor,National University Of Singapore<br/>\r\nB.E(Hons) Chemical Engineering1988, BITS Pilani <br/>\r\nMS (Chemical Engineering.),IIT Madras, <br/>\r\nPhD (Process Control)  University of Alberta, Canada, 1997.',NULL,'',''),(41,'Sameer Singla','ISB, India',NULL,'',''),(42,'Venu Palaparthi',NULL,NULL,'',''),(43,'Vivek Paul','Partner, Texas Pacific Group. <br>\r\nFormerly, Vice Chairman, Wipro and CEO of its global information technology, product engineering, and business process services segments','Vivek Paul, is one of the most influential business persons in the world.  A EEE graduate from BITS, Pilani, he received his MBA from University of Massachusetts.  He has been ranked the &quot;Best Manager of the Year&quot; in 2004 by Business World.  He has also been named one of the &quot;Top 30 CEO&#39;s by Barrons.\r\n<br>\r\nStarting his career at Pepsi Co, he did a short stint at Bain & co. He also ran the global CT (Computerized Tomography) business of GE and reported directly to the Chairman of GE.  In fact he was hand picked by Jack Welch for the job. He also did valuable work as the President and CEO of GE&#39;s medical equipment JV in India.  In his tenure as the President, he made it the &quot;best joint venture in Asia&quot; (Source: The Economist) and made India a large exporter of high value engineering goods.\r\n<br>\r\nHis most famous success as a manager has been the exponential growth of Wipro Technologies that he achieved while at the helm of it&#39;s global IT, product engineering, and business process services segments.  He converted this $150 million business into a $1 billion behemoth in just six years. During his tenure as Vice Chairman of Wipro, he was the most highly paid executive in India.  After quitting Wipro, he joined the venture capital firm, Texas Pacific Group as a partner.  Currently, he oversees the new technologies and life sciences investments of the group working in close co ordination with its Asian arm, Newbridge Capital.  The group manages a global portfolio of approximately $70 billion in revenue. Besides TPG, he is also serving on the board of Electronic Arts and is a member of the BITS Senate.','',''),(44,'Dr. Harsh Bais','University of Delaware',NULL,'',''),(45,'Jayan Ramankutty','Serial Entrepreneur ','Jayan Ramankutty (1971 batch) is Vice President of Cypress Semiconductor’s Data Communications division, and co-founder and Director of Empowertel.  Jayan was founder, President and COO of Lara Networks, Inc., which he sold to Cypress Semiconductor in 2000. He has held various senior level technical and management positions in Alliance Semiconductor, VIA Technologies and Elxsi. He also founded, and sold Nimbus Technology to Alliance Semiconductor prior to going IPO. Jayan has over 18 years of extensive experience in the field of research, design and development of large, multi-processor computer systems, complex ASICs and SoCs targeted towards networking and telecommunication markets. Jayan holds an MS in Computer Engineering from San Jose State University and a BE (Hons) EEE from BITS. He is currently chief executive officer of Yume Networks, a San Jose startup that delivers broadband content for Indian ex-patriate.','jayanr@yahoo.com',''),(46,'Amit Krishnan','Senior Product Manager, Microsoft Corporation',NULL,'',''),(47,'Laetitia Pichot de Cayeux','Texas Pacific Group','Laetita is an alumnus of Harvard Business School. She has also worked with Goldman Sachs. Currently she is with the Texas Pacific Group.','',''),(48,'Shanta Boddapati','Batch of 2001, B.E. Chemical Engineering,<br> Ph.D candidate in Chemical Engineering, Arizona State University',NULL,'',''),(49,'Raju Reddy','Founder and CEO, SierraAtlantic, \r\nBE(Hons) EEE, BITS Pilani, \r\nMSCS, Virginia Tech','Raju is the founder and CEO of Sierra Atlantic. With over 1,000 employees, Sierra Atlantic is headquartered in Silicon Valley, has a Global Development Center in Hyderabad, India and offices around the world. Under his leadership, Sierra Atlantic has become a Best-in-Class Global Services company. Before founding Sierra Atlantic in 1993, he spent 10 years at Intel in software development, marketing and general management.\r\n\r\nRaju holds a Bachelor of Science degree in electrical engineering from BITS Pilani and a Master of Science degree in computer science from Virginia Tech.\r\n\r\nRaju is a member of the BITS Pilani Board of Directors and a Charter member of TiE Silicon Valley. He also served as a member of the Board of Trustees for Puente, a Wharton School non-profit program which helps under-privileged communities worldwide gain access to technology. Raju also co-founded SIPA (Silicon Valley Indian Professional Association) along with other young Indian engineers from Silicon Valley in 1987.','Raju.Reddy@SierraAtlantic.com','6522 Kaiser Drive, Fremont, CA 94555'),(50,'Chandra Bhople','Director, Business Development, Osellus\r\nBE(Hons) EEE, MMS, BITS Pilani, 1981','Chandra has 20 years of U.S. and international experience in sales, business development, and marketing for software, hardware and services companies in financial, telecommunications, government, manufacturing and education sectors. He has held executive and management positions at Formulasys, TechSpan (now Headstrong), Sun Microsystems, SysScan Asia, and Digital Equipment. Chandra earned his Bachelor\'s degree in Electrical and Electronics Engineering, and MBA with distinction from BITS Pilani, India.','cbhople@gmail.com','19400 Sorenson Avenue (#107), Cupertino, CA 95014'),(51,'Deelesh Mandloi','Product Engineer, ESRI, Redlands <br> \r\nM.S Geography with specialization in Geographical Information Systems (GIS) and Science , State University of New York, Buffalo <br>\r\nB.E(Hons) Civil , BITS Pilani (\'99 Batch)','Deelesh is currently working with Network Analyst team at ESRI Redlands,  that builds the Network Analyst extension for ArcGIS. He helps in design and testing of software, prepare software documentation, create developer code samples and assist software users with technical questions.  Earlier at ESRI, he has worked with ArcWeb Services group at the ArcWeb Content team building new data sources for the product, updating existing data sources and evaluating the suitability of the data from new data providers for future ArcWeb content.  He holds an MS from SUNY Buffalo with GPA of 4.0/4.0.','',''),(52,'Team BITS2MSPHD','','Team BITS2MSPHD consists of Karthik Narayanan, Addala Bhargav, Mayur K Siddana, BITSian alumni who have pursued various graduate courses abroad after their BITS Bachelor\'s degree.','',''),(53,'Shampa Kandoi','Ph.D. Chemical Engineering (University Of Wisconsin -Madison) <br>\r\nB.E (Hons.) Chemical Engineering, BITS Pilani (\'97)',NULL,'',''),(54,'Amit P. Sheth','Professor: Computer Science & Engineering, Wright State University, \r\nDirector: Kno.e.sis Center<br/>\r\nPhD CS, Ohio State, 1985<br/> BE(Hons) Computer Science, BITS Pilani,1981','Amit Sheth is an educator, researcher, and entrepreneur. He is the LexisNexis Ohio Eminent Scholar for Advanced Data Management and Analysis, an endowed faculty position funded by LexisNexis and the Ohio Board of Regents at Wright State University. He directs the Kno.e.sis center for Knowledge enabled Information & Services Science. The Center and Eminent Scholar\'s activities are housed on the third floor of the WSU College of Engineering and Computer Science\'s new $10 million Joshi Research Center, which is the focal point for statewide research in advanced data management, visualization, bioinformatics, sensor technologies, and more.\r\n<p>\r\n<a href=\"http://knoesis.wright.edu/amit/\">http://knoesis.wright.edu/amit/</a>','amitpsheth@yahoo.com',''),(55,'Mr. Karthik N.Subramania','BE(Hons)Electronics & Instrumentation, BITS\r\nPilani(\'01 batch) <br>\r\nM.S. Electrical Engineering, Stanford\r\nUniversity','','',''),(56,'Mr. Anupam Mathur','B.E.(Hons)Mechanical Engineering,\r\nBITS Pilani(\'99 batch) <br>\r\nMBA,IIM Ahmedabad <br>\r\nBoston Consulting Group, Singapore',NULL,'',''),(57,'Mr. Deepak Kapur','IIM Indore & BITS Graduate(\'95\r\nbatch) <br>\r\nVisiting Faculty, Finance & Acc.(IIM\r\nIndore)',NULL,'',''),(58,'Kaushik Subramanian','Cypress Semiconductors',NULL,'',''),(59,'Pankaj Nathani','BE(Hons) CS from BITS Pilani, 1998-2002 \r\n\r\nMS Computer Science University of Utah 2005-07.','Pankaj did his BE(Hons) CS from BITS Pilani(1998-2002). He did his MS Computer Science from University of Utah (2005-07). He is currently working with Adobe Systems, Seattle.','',''),(60,'Ayusman Sarangi & Pankaj Nathani','Ayusman Sarangi: M.Sc (Hons) Biology with BE(Hons) CS from BITS Pilani, 2003.                           Pankaj Nathani: BE(Hons) CS from BITS Pilani, 1998-2002. MS Computer Science University of Utah 2005-07.','Ayushman did his M.Sc (Hons) Biology with BE(Hons) CS from BITS Pilani, 2003. After working with Sun Microsystems, Bangalore for a short period, he has been working with Adobe Systems, Noida .              Pankaj did his BE(Hons) CS from BITS Pilani(1998-2002). He did his MS Computer Science from University of Utah (2005-07). He is currently working with Adobe Systems, Seattle.','',''),(61,'Anyesha Mookherjee','Traffic Engineer at URS<br/>\r\nMSCE Civil Engg, UMA 2003, BE(Hons) Civil Engg, BITS Pilani, 2001\r\n','http://www.blogger.com/profile/12828631537050815636\r\n\r\n','anyesha@gmail.com',''),(67,'Pranesh A Sundararajan','M.Sc. (Hons.) Physics with B.E. (Hons.) EEE(2005) from BITS, Pilani.\r\nPurusing Ph.D. at Massachusetts Institute of Technology, Boston.\r\n','The author obtained his bachelors degree in Physics and Electrical Engineering at BITS, Pilani in 2005. He is now pursuing a Ph.D in Physics at MIT.','pranesh@mit.edu',''),(68,'Prof. Naba Mandal','Dept. of High Energy Physics,\r\nTata Institute of Fundamental Research\r\n','Prof. Mondal, a very well known experimental particle physicist, is a member of the Department of High Energy Physics, Tata Institute of Fundamental Research, Mumbai India. An ex-chairman of the department, he is a leading contributor in many national and international experimental collaborations. Notable among them are the D0 collaboration at Fermilab, Batavia, Illinois, and CMS at CERN, Geneva. Currently he is leading a very ambitious project \"India-based Neutrino Observatory (INO)\". The project is under the review of Govt. of India. INO will be one of the biggest venture of Govt. of India, in Science.','',''),(69,'Karthik Krishna',NULL,NULL,'',''),(70,'Krishna Hegde','MBA, Tuck Business School, Dartmouth <br/>\r\nBE(Hons) Computer Science, BITS Pilani, 2000.\r\n','Krishna Hegde (\'96) currently works at Lehman Brothers, New York in the Credit Strategy team. Before joining Lehman, Krishna earned his MBA from the Tuck School of Business at Dartmouth College. From BITS, he joined Hindustan Unilever as a Business Leadership Trainee and subsequently worked as an IT manager handling business intelligence systems for sales and supply chain. At Pilani, he did his BE (Hons) in Computer Science. He lives in New Jersey with his wife Priya. Krishna co-founded BITS2Bschool and coordinated the public-relations efforts within India for BITSConnect.','',''),(71,'Prasenjit Bhowmik','Design Engineer, Cosmic Circuits, BE(Hons) EEE BITS Pilani Class of 1998','Prasenjit has 6 years of experience at ST Microelectronics and 2 years at Texas Instruments before joining Cosmic Circuits as a Design Engineer.','',''),(64,'Naveen Bisht','Co-Founder & Managing Partner, Luxmi Ventures, LLC<br>\r\nFounder, President & CEO, Nayna Networks<br>\r\n','<p> Naveen Bisht is a successful technology entrepreneur in Silicon Valley and brings expertise and entrepreneurial success in launching, developing and investing in high technology companies across multiple industries. His, over 18 years of experience in high growth technology and services sectors include Cross-Border Team Building & Management, Operations, Business/Product Development, Mergers and Acquisitions, Turnarounds, Startup Strategic Advisory Services and Strategic Planning and Negotiation Skills.  </p>\r\n\r\n<p>\r\nNaveen is Co-founder and Managing Partner of Luxmi Ventures, LLC - a seed stage angel fund, to focus on networking, internet, software and services market.\r\nSome of the successful exits from this fund have included Netscaler Inc (acquired by Citrix Systems, NASDAQ: CTXS), Speedera Networks (acquired by Akamai Technologies, NASDAQ: AKAM), Paxonet Communications\r\n(Conexant, NASDAQ: CNXT),  and Valicert (Tumbleweed Communications, NASDAQ: TMWD. He is also an advisor to several startup companies including Kirusa, Inc. - a mobile application company.\r\n</p>\r\n\r\n<p> Most recently, he was Founder, President & CEO, of Nayna Networks, Inc.; a networking solutions and services company, where he was resonsible for the overall strategic direction and general management of the company. At Nayna, Naveen raised over $80 Million dollars from VC and PIPE Funds and completed five strategic acquisitions of technology and Services Company for Nayna in addition to completing a reverse merger of Nayna into a public company. </p>\r\n\r\n<p> Prior to this, he founded Ukiah Software, Inc. - a leader in policy-based bandwidth and security management software systems for service provider and\r\nenterprise networks. He served as its President and CEO since its inception till its acquisition by Novell, Inc. in 1999. Ukiah received a number of awards including Top 10 companies to watch in 1999 by Network World and Top 25 Hot Startups of 1998 by Data Communications Magazine, 1999 and 1998 Hot Product Awards by Data Communications Magazine, 1999 Product of the Month Award by Telecommunications Magazine and\r\nNetwork World\'s Blue Ribbon Award. Previously, he  was Founder and President of NeoGlobal, Inc, a Software\r\nConsulting Services company focused on internet, enterprise software and networking market.   </p>\r\n\r\n<p> He holds MS from Texas Tech University, MS and BSME from Birla Institute of Technology & Science, Pilani. He also attended Ph.D. program at University of California, Santa Barbara and holds several patents in  the area of Quality of Service and security management  in IP Networks. He has published a number of papers on the trends and issues in networking industry and is a  member of The Indus Entreprenuers , a global non-profit organization focused on entrepreneurs. </p>','navbis@yahoo.com',''),(66,'Urvashi R.V.','Programming Engineer,NRAO,New Mexico<br>\r\nM.Sc.(Hons) Physics with B.E.(Hons) Computer Science (2002). <br>MS in Computer Science from University of California, San Diego','Urvashi completed her M.Sc.(Hons.) in Phy along with B.E. (Hons.) Computer Science from BITS Pilani in 2002. She did one PS-II at the National Centre for Radio Astrophysics where \r\nshe got a chance to work with the Radio Telescope operated there. <p>Subsequently, she joined the University of California, San Diego and did her MS in Computer Science with specialization in scientific and parallel computing.<p> In 2004, she joined the New Mexico Tech (Physics dept) for a PhD. She has\r\nworked part-time as a programmer in the scientific computing group at the National Radio Astronomy Observatory for the past 3 years and is now doing\r\nfull-time work on her thesis - \"Multi-Frequency Synthesis Imaging in Radio Interferometry\" relating to Wide-band Image Reconstruction\r\nalgorithms.','',''),(72,'Keerthivasan','Pursuing Masters at Texas A&M, B.E. (Hons) Electronics & Instrumentation BITS Pilani (2005)','Mr.Keerthivasan is an Electronics and Instrumentation graduate (Class of 2005) currently pursuing his Masters at Texas A&M University. He is also one of the moderators of BITS2MSPHD yahoogroups with a subscription of over 2000 BITSians accross serving as a discussion forum on all aspects of higher education in the US.\r\n\r\n','',''),(73,'Saayan Sarkar',NULL,NULL,'saayansarkar@gmail.com',''),(74,'Anand Agarwal',NULL,'Mr Anand Mohan Agarwal, CEO SAMVARDHAN is an Engineering graduate from\r\nBITS Pilani, having done B.E. (Hons) in Electrical and Electronics\r\nfrom 1975 – 80.\r\nHe is a professional Consultant and a Motivational Speaker. He has\r\nalready made over 469 presentations (including 1 at BITS Pilani last\r\nyear) to over 23,000 employees of a large number of Corporate all over\r\nIndia.\r\nAs a Financial Consultant his objective is to spread awareness among\r\nthe audience regarding Financial Risk Mitigation, Profitable\r\nInvestments,Personal Wealth Management & General Financial well being\r\nfor young adults\r\n\r\n.','',''),(75,'Dr Brij Bhushan',NULL,NULL,'',''),(76,'Aparajit Pratap','TechPassion Technologies<br/>\r\nM.S., The University of Texas at Austin<br/>\r\nBE (Hon\'s) Mechanical, BITS Pilani, 2000','Mr Aparajit Pratap graduated from BITS Pilani with a B.E. (Hons) degree in Mechanical Engineering in the year 2000. He subsequently did his MS from the University of Texas at Austin. He is currently working in TechPassion Technologies.','',''),(77,'Dr.Nilay Yajnik','Professor of Information Systems , School of Business Management , NMIMS University, Mumbai','Dr.Nilay Yajnik is a Ph.D. in Management Studies from NMIMS (University of Mumbai), a Master of Science (Technology) from the Birla Institute of Technology and Science (BITS), Pilani and Master of Management Studies from\r\nNMIMS (Mumbai University). He has worked with Companies such as Wipro Infotech and Digital Equipment (HP) in areas spanning Business Development, Learning Services and Program Management. At NMIMS University, he has taught courses in Information Technology, Marketing and Perspective Management. He has several publications to his credit at the National and International level.<p>\r\nHe is also a Corporate Trainer and has served on the Executive Boards of Information Technology and Management forums of India. In April 2003, he was awarded the NMIMS Best Faculty award for the year 2002-03. <p>\r\nDr. Nilay Yajnik is on the Editorial Board of Innovate Journal of Online Education of the Fischler School of Education of the Nova Southeastern University, Florida, USA and is also on the Editorial Board of the AIMS International Journal of Management, Texas, USA. He has been appointed as a paper reviewer for the 68th Annual Meeting of the Academy of Management, Anaheim, California, the 14th Americas Conference on Information Systems, Toronto, Canada and the 1st World Summit on the Knowledge Society, Athens, Greece where he is also on the Scientific Program Committee.<p>\r\nDr. Yajnik is on the Executive Committee of the Management Education Division of the Academy of Management USA, the Executive Committee of the Bombay Management Association, India, the National Council of the Indian Society for Training and Development, the Managing Committee of the Computer Society of India (Mumbai Chapter) and the IT Committee of the Indian Merchants Chamber. He is also a Visiting Professor at the Indian Institute of Technology Bombay SJM School of Management.<p>\r\nDr.Yajnik has around 15 years of experience in the IT industry and also around 15 years of teaching experience. His teaching and research interests include Information Systems applications across industry verticals, Innovation , Marketing of High Technology, IT Strategy and the Digital Divide.','',''),(78,'Jai Natrajan','EVP - Business Development, Maya Entertainment Ltd. <br/>\r\nEx-BITSian (89B4A7690)','Mr Jai Natrajan is presently the \"EVP - Business Development\" at Maya Entertainment Ltd. While Technical Director at George Lucas\' studio, Industrial Light and Magic (ILM), he worked on movies like \'Star Wars: Episode 1 The Phantom Menace\', \'The Perfect Storm\', \'Wild Wild West\', \'Flubber\' and \'Mighty Joe Young\'. He is currently working on \'Ramayana the Epic\' and \'Noddy\' television series. He was recently awarded the \'Wheel of Honor\' by the AITS.','',''),(79,'Chaitanya Kalapatnipu','Entrepreneur, Founder of KENVIRON<br/>\r\nBITS Pilani, Information Systems Class of 1997','Mr Chaitanya Kalapatnipu passed out of BITS Pilani in Information Systems Class of 1997. He worked for an year in the Web Server Development Team at Sun Microsystems, Bangalore. Later, he moved to INSEAD Business School to work initially in the development of Business Simulations and later in business development of their executive education. He completed his MBA from INSEAD in 2006\r\n<p>\r\nAn entrepreneur, Mr Chaitanya Kalapatnipu launched KENVIRON, delivering world-class executive education programmes to Indian Corporates.\r\n','',''),(80,'Dr.Anand Nilekar',NULL,NULL,'',''),(81,'Arun Ravindran','PhD Candidate, Department of Cognitive and Neural Systems, Boston University, Boston, MA, USA','Arun Ravindran completed his BE in Electrical and Electronics from BITS Pilani. He graduated from BITS in 2002 and is currently a PhD candidate at the Department of Cognitive and Neural Systems at Boston University, Boston, Massachusetts','',''),(82,'Dr`Sridhar Ramanathan','ReaMetrix India Pvt. Ltd','Sridhar Ramanathan graduated from the Birla Institute of Technology and Science (BITS), Pilani , India with a M.Sc (Honors) in Chemistry and a B.E (Honors) in Instrumentation Engineering. He completed a Ph.D in Analytical Chemistry from the University of Kentucky , Lexington , Kentucky and spent a couple of years in post-doctoral research at the US Environmental Protection Agency and University of Kentucky .  He then joined the General Electric Company (GE) to be a part of GE John F Welch Technology Center in Bangalore . He helped set-up the state of the art Analytical Chemistry Laboratory and build the Analytical Chemistry team there. After the stint at GE, Sridhar joined Harita Infoserve, a start-up engineering design services company which is a part of the TVS group as the Quality Head.  He helped build the delivery and business processes at Harita. From business quality, Sridhar went on to initiate the PCMM journey at Harita as the HR-Head.  Sridhar is a Six Sigma Black Belt and a Senior Professional in Human Resources (SPHR) as certified by the Human Resources Certification Institute (HRCI). Sridhar has been with ReaMetrix for the last 2.5 years. ReaMetrix is an innovation driven medical diagnostic solutions company. Sridhar currently is the Director of Product Development and is also responsible for the India Operations of the company.','',''),(83,'Prem Talreja','BS EEE from BITS-Pilani (1975), and MSEE from University of Wisconsin and an MBA from Duke University','Prem Talreja is based in the heart if Silicon Valley, California and has over 25 years of experience in marketing, sales and engineering in the electronics industry. He is currently Director of Advance Products at Sigma Designs, a leading supplier of chipsets for IPTV, DVD/Blu-Ray Players, and Digital TVs. Prem has worked in marketing roles in startups and mid-size successful companies including HP, Infineon, Cirrus Logic, Dazzle and Moschip Semiconductor. He lead the successful start up of Dazzle Multimedia to over $60 million in revenue and its acquisition in 2001.','prem@sdesigns.com',''),(84,'Dr.Paromita Goswami',NULL,NULL,'',''),(85,'Dr.Anand Nilekar',NULL,NULL,'',''),(86,'Dr.Rangarajan','Associate Professor, IIA. Designed and\r\n fabricated a low cost polarimeter along with my Ph.D. student Nagaraj; Solar observations were carried out from Kodaikanal, India with this instrument to measure magnetic fields on sun. Playing an active role in th','Schooling in Chennai. Obtained Merit Scholarship, Studied in BITS, Pilani from 1973-78; five year integrated M.Sc (Hons) in Physics; Ph.D. from Indian Institute of Astrophysics (IIA), Bangalore  on Radiative Transfer transfer and spectral line formation theory. Joined the same institute as Scientist. Have published several papers in leading international journals.Worked in Colorado Research\r\n Associates and University Center for atmospheric Research, Boulder,\r\n Colorado from 2000 to 2002 on Sabbatical from IIA.','rangaraj@iiap.res.in',''),(87,'Adarsh','Adarsh is a MBA candidate at the Wharton School in University of Pennsylvania . After graduation, he will be joining McKinsey & Company as a strategy consultant in their North American operations. Previously he was a lead engineer at Microsoft Corporation',NULL,'',''),(88,'Sudip Dutta','Director, Sales, Persistent Systems','Sudip is currently working as a Director , Sales, at Persistent Systems. He has close to ten years of combined experience in the management of technology based efforts and sales. He has worked in different roles including sales and optimizing the sales tracking process in a multi-billion dollar organization. He is currently managing , cross selling and up selling into clients. He has exposure in International Market including USA, China, Tiwan & India for close to ten years at Middle and Senior Management levels.','',''),(89,'Mr. Arun Maharajan','Manager Communications, BITSAA Int.','Current : Development Engineer at Huber Automotive AG\r\n\r\nEducation :\r\n\r\nFachhochschule Esslingen - Hochschule für Technik\r\nM.Sc., Automotive Engineering\r\n2005 – 2007\r\n\r\nBirla Institute of Technology and Science, Pilani\r\nB.E.(Hons)., Electronics and Instrumentation\r\n1999 – 2003 ','arun.maharajan@gmail.com',''),(90,'Padmanabhan Seshaiyer','Associate Professor,\r\nDepartment of Mathematical Sciences,\r\nGeorge Mason University\r\n','Dr Seshaiyer is an Associate Professor at Department of Mathematical Sciences in George Mason University. His projects are funded by National Science Foundation, Department of Defense and a project will be supported by National Institute of Health as well.\r\n<p>His homepage can be found at\r\nhttp://math.gmu.edu/~pseshaiy/','','4400 University Drive, MS: 3F2 Phone: (703) 993-9787'),(91,'<p>None</p>','','<p>Something</p>','',''),(92,'Mr Vasan','Co-Founder and Director, SANAT Technologies','Mr Vasan is a BITS alumnus frok the 1989-92 batch. He handled the various engineering divisions of Cisco Systems\' offshore development centre in Chennai in the areas of networking, network management and network storage for around six years. He is the co-founder and director of SANAT Technologies. He is a member of the SNIA and is also a member of the Board of Directors of Sahasra Solutions.','',''),(93,'Mr. Jai Natarajan','EVP - Business Development, Maya Entertainment Ltd.\r\nBITSian (89B4A7690)','Brief Profile:\r\nCurrent: Group EVP (Business Development and Marketing), Maya Entertainment Ltd.\r\nPreviously: Technical Director at Industrial Light and Magic (ILM)\r\nEducation: MS in Computer Graphics (UCLA), Maths+ CS dual from BITS-Pilani\r\n','',''),(94,'Aman Shaikh','Working at AT&T labs.','MSc. (Hons) Mathematics and B.E. Computer Science, BITS-Pilani\r\nMS(Comp. Engg.) from Univ. of California\r\nWorking at AT&T labs','',''),(95,'Dr. Urvashi Rau','Working on completing thesis in “Multi Frequency Synthesis Imaging in Radio Interferometry\"','BITS-Pilani graduate, B.E. Computer Sc.  (\'97 batch)\r\nPhD. in “Multi Frequency Synthesis Imaging in Radio Interferometry\"','',''),(96,'Avinash Modi','Avinash Modi joined BITS, Pilani in 1997 and graduated in 2002 with B.E.\r\n(Hons.) Chemical Engineering and Master of Management Studies. He then\r\npursued his Masters in Chemical Engineering at University of Louisiana\r\nfocusing on corrosion. ','Since 2004, Avinash has been with General\r\nElectric\'s Water and Process Technologies business and has worked in the\r\nareas of experimental design, simulation studies, membrane performance\r\nand process improvement for refining and water treatment applications.In his spare time Avinash enjoys quizzing, writing and attempting to run\r\nthe half marathon.','',''),(97,'Dr. SR Jayaprakash','Dr. SR Jayaprakash is a Lead Scientist and has been working with GE Water\r\nand Process Technologies, Bangalore since 2006.He has a PhD from Clarkson University, New York and a Bachelors degree in\r\nChemical Engineering from Anna University, Chennai. His ar','Dr. Jayaprakash provides\r\ntechnical leadership on using Computational Fluid Dynamics to design better\r\nindustrial water filtration systems. During his time at GE he has also led\r\nthe development of an analysis based approach for designing water treatment\r\nplants and fouling in refineries.\r\nPrior to joining GE, Dr. Jayaprakash worked with Chevron Energy Technology\r\nCompany, Houston. At Chevron he worked for the Oil Exploration and\r\nProduction Industry, on applications such as multiphase flow in pipelines\r\nand optimization studies for oil and gas fields.','',''),(98,'Vinay Deo','joined Microsoft in Redmond to work in the newly formed personal devices group developing early versions of information organizers and email devices. In his 15+ years with Microsoft','Vinay Deo graduated from BITS Pilani in 1984 with BE (Hons) in Electrical & Electronics Engineering. After completing M Tech in Computer Science and Engineering from IIT Kanpur, he joined Center for Development of Telematics (CDoT) a key R&D startup that took the challenge to design state of the art telephone switching system in 3 years to kick start India\'s telecom revolution. In 1990 he moved to Sydney Australia and joined Alcatel to work on payphone management systems and multi-function phones. in 1994, Vinay joined Microsoft in Redmond to work in the newly formed personal devices group developing early versions of information organizers and email devices. In his 15+ years with Microsoft, Vinay has worked in a variety of technologies (Smart cards, Windows server management, Developer tools) and roles (Developer, program manager, engineering manager) and has over 35 patents to his credits. Currently, Vinay is working in adCenter, the ad engine behind Bing, focusing on technologies that improve relevance of ads. ','',''),(99,'Mr. Rajiv Gupta','Director, Ultrahigh Resolution Lab CT laboratory\r\nHarvard Medical school, Boston, USA.','MS+PhD from New York State University.\r\nBITS-Pilani (\'76) EEE+Physics.','',''),(100,'Samayita choudhuri','Manager at Business Development & Operation BioXcel Corporation \r\nIndia.specializes in Molecular cloning, pharmaceutical and biotechnology business research, SWOT analysis and intellectual property related studies','Birla Institute of Technology and Science \r\nME , Biotechnology , 2003 — 2005 \r\nParticipated in Biotech annual fest of Anna University, chennai. I was awarded first prize in bioinformatics studies for pharmacophore generation and docking studies.','',''),(101,'Dhruv Balwada','Pursuing MS from Florida University in Oceanography.research interests in ‘Simulation of Tsunami’s using the FMS Shallow water model’ (Ongoing project),‘Modeling of Internal Waves over Continental Slope’ (Ongoing project).','B.E (Hons.) Chemical Engineering,Birla Institute of Technology and\r\nScience–Pilani,Goa.Founder President of Environment Protection and Awareness Club (EPAC)','dhruvbalwada@gmail.com',''),(102,'Soumyadeep Ghosh','Soumyadeep Ghosh(2006A7PS018P) 2010-BITS Pilani Pass-out  is currently pursuing his PhD at Princeton University. He holds interests in Computer Systems - Compilers and Operating Systems, Parallel Computing','Soumyadeep Ghosh(2006A7PS018P) 2010-BITS Pilani Pass-out  is currently pursuing his PhD at Princeton University. He holds interests in Computer Systems - Compilers and Operating Systems, Parallel Computing','',''),(103,'Vijay Kedia','Jalmitra Mr. Vijay Kumar Kedia is basically a Mechanical Engineer from BITS Pilani (1977 Batch), born and brought up at Lachhamangarh Town of Sikar District in Rajasthan (India).','Jalmitra Mr. Vijay Kumar Kedia is basically a Mechanical Engineer from BITS Pilani (1977 Batch), born and brought up at Lachhamangarh Town of Sikar District in Rajasthan (India).','info@varshajal.com',''),(105,'Marc Koska','The inventor of disposable Syringes. Apart from that, he also runs a charity called SafePoint Trust which promotes disposable syringes.','The inventor of disposable Syringes. Apart from that, he also runs a charity called SafePoint Trust which promotes disposable syringes. He is the guy who actually convinced the State Minister of Health Mr. Anbumani Ramadoss to ban the ordinary syringes in Indian hospitals. ','',''),(106,'Luca Turin','Luca Turin (1953 – ) is a biophysicist with a long-standing interest in the sense of smell, the art of perfume, and the fragrance industry.His current project : Developing an artificial nose.','Luca Turin (1953 – ) is a biophysicist with a long-standing interest in the sense of smell, the art of perfume, and the fragrance industry.His current project : Developing an artificial nose.','',''),(107,'Shilpa Sambashivan','Shilpa Sambashivan is a BITS 30under 30 award winner. She is a PhD from UCLA and has published a paper in Nature also.','Shilpa Sambashivan is a BITS 30under 30 award winner. She is a PhD from UCLA and has published a paper in Nature also.','',''),(108,'Madhur Khandelwal','Senior Software Engineer TheFind Inc. BITS Pilani, ‘98 Computer Science',NULL,'',''),(110,'Mreenal Chakraborty','Motivational Speaker ','Attached with various Corporates.','',''),(111,'Priya Jadhav','PhD Scholar,MIT','BE in EEE and MSc. Physics,BITS Pilani\r\nMS in Electrical Engg.Boston University ','',''),(112,'Kiran Karnik','NASSCOM Head','Kiran Karnik is the present Head of NASSCOM. He has brought about many revolutionary changes in its functioning and framed many new policies.','',''),(113,'Steve Jobs','CEO Apple INC.',NULL,'fef',''),(114,'egvdjhmd','rfvhurh ','kdgyew ','dgbkyufg',''),(115,'egvdjhmd','rfvhurh ','kdgyew ','dgbkyufg',''),(116,'Karthika Periyathambi','Stanford University, California : MS in Electrical Engineering, specialization in VLSI and Comp Arch','Birla Institute of Technology & Science (BITS), Pilani, India : B.E. (Hons.) Electrical and Electronics<br/><br/>\r\n<b>Relevant Course Work:</b><br/> Electronic Devices and Integrated Circuits, Digital Electronics and Computer Organization, Communication Systems, Analog Electronics, Comp. Networks, Control Systems, Microelectronics, Analog and Digital VLSI Design \r\n',' karthipd@stanford.edu',''),(117,'Dr. Roop Mallik','Reader (F) and Welcome Trust International Senior Research Fellow\r\nDepartment of Biological Sciences,\r\nTata Institute of Fundamental Research,\r\nMumbai','Dr. Roop Mallik earned his Masters degree in Physics from the University of Allahabad. He did his Ph.D. from the Tata Institute of Fundamental Research, Mumbai. His Ph.D. work was in the field of Condensed Matter Physics. After that he did his post doctoral work, first on the topic of \'Rapid laser-induced pH jump techniques to study protein dynamics of Green Fluorescent Protein\' for a joint appointment at TIFR, Mumbai and the National Center for Biological Sciences, Bangalore, and then on \'in vitro studies of Molecular motors cytoplasmic Dynein and Kinesin\' from the University of California at Irvine. His present work focuses on studying different molecular motors and their co-operative behavior inside the cytoplasm. His work is multi-disciplinary and spans fields such as Molecular Biology, Physics, Biochemistry, Chemistry and Computational analysis. Also a lot of high precision techniques (like an optical trap) are used by him to measure forces developed on the molecular level in real time.\r\n<br>Know more about his work at <a href=\"http://www.tifr.res.in/~roop/\" target=\"_blank\">http://www.tifr.res.in/~roop/</a>','',''),(118,'Aubrey de Grey','Biomedical gerontologist, a Fellow of the IEET, and the Chief Science Officer of the SENS Foundation.','Dr. Aubrey de Grey is a biomedical gerontologist, a Fellow of the IEET, and the Chief Science Officer of the SENS Foundation. \r\nThe editor of Rejuvenation Research, the world’s only peer-reviewed journal focused on intervention in aging, he is an advocate of research seeking answers to how molecular and cellular metabolic damage brings about aging and ways humans can intervene to repair and/or obviate that damage.\r\nHe argues instead that aging is a disease -- one that can be cured if it\'s approached as \"an engineering problem.\" \r\nHis plan calls for identifying all the components that cause human tissue to age, and designing remedies for each of them — forestalling disease and eventually pushing back death. \r\nHe calls the approach Strategies for Engineered Negligible Senescence (SENS).\r\n\r\nThe central goal of Aubrey de Grey’s work is the expedition of developing a true cure for human aging. In his view, the main obstacle to developing such technology is the position of biogerontology at the boundary between basic science and medicine. \r\nHe believes that the fundamental knowledge necessary to develop truly effective anti-aging medicine mostly exists, but the goal-directed frame of mind that is best suited to turning research findings into tools is very different from the curiosity-driven ethos that generated those findings in the first place.\r\nAs a scientist with a training in an engineering discipline, specifically that of computer science, Dr. De Grey believes himself to be well placed to bridge this gap. \r\nHe attempt to do so in three main ways: by doing basic biogerontology research, identifying and promoting specific technological approaches to the reversal (not merely the prevention) of various aspects of aging, and by arguing in a wide range of forums, extending beyond biologists, for the adoption of a more proactive approach to extending the healthy human lifespan sooner rather than later. ','',''),(119,'Vasant Manohar','Scientist, Speech and Language Group\r\nRaytheon BBN Technologies, Cambridge, MA','B.E.(Hons)Computer Science & Engineering (BITS Pilani)<br>M.S. and PhD in Computer Science(University of South Florida)<br/><h4>Research Interests:</h4><ul><li>Using Dynamic Strain Pattern from Video to Recognize Faces</li><li>Performance Evaluation of Object Detection and Tracking Algorithms</li></ul><p>Visit him at his<a href=\"http://figment.csee.usf.edu/~vmanohar/home.htm\" target=\"_blank\"> homepage.</a></p>','',''),(120,'Suhail Kassim','Specialist with World Bank','Suhail Kassim is a Specialist and Fellow with the World Bank Group in Washington DC. He was part of the\r\ncore World Bank team which worked with the Ministry of Finance, Government of India, to respond to\r\nthe recent global financial crisis, where he participated in providing a record-size US$ 2 billion loan to\r\ncapitalize India’s public sector banks. He has earlier been a private equity investor with Tata Industries, a\r\nmanager with the Tata Administrative Service, and an equities analyst with JP Morgan. He has launched\r\nseveral social initiatives, serves as an advisor to social and hi-tech startups, and has published on\r\nmicrofinance and investment climate. Suhail holds a Gurukul certificate from the London School of\r\nEconomics, an MBA from the Indian Institute of Management Ahmedabad where he was a Surrendra\r\nPaul Merit Scholar, and an engineering degree with distinction from BITS Pilani. He was conferred\r\nthe Chevening Senior Scholarship by the British Government as a \"Young Indian Leader\" in 2009, and\r\nthe “BITSAA Global 30 Under 30 Award” for all-round leadership in 2005.','suhailkassim@yahoo.com',''),(145,'Vidyashankar M. Vellal','Business Analyst at McKinsey and Company','<ul><li>M.Sc. Economics and B.E. Computer Science Engineering from BITS Pilani Goa Campus</li><li>Received a deferred admission to Harvard Business School through the HBS 2+2 Program</li><li>Interned at the Reserve Bank of India</li></ul>\r\n','',''),(121,'WebTeam','html','gfyu','ghfg@dsg.com',''),(122,'Abhinav Khushraj','Strategy & Business Development Manager\r\nNokia\r\n','Abhinav drives strategy for Nokia Messaging, a key service that is driving Nokia’s transformation into a service company. As a business development manager, he is responsible for partnering with social media companies, scouting for white space opportunities in BRIC countries and driving operator and retail strategy. Prior to Nokia, Abhinav was an associate at General Catalyst Partners assisting a portfolio company with growth strategy. He has consulting experience at Booz Allen Hamilton, a mobile startup in New Zealand and a European seafood company. He has spent 5 years at Citrix Systems as release program manager for the Internet security business and was awarded the leadership and team achievement awards. \r\nAbhinav has an MBA from MIT Sloan School of Management where he worked on startup ideas in social media and mobile and was a semi-finalist in the MIT $100k competition. He also has a Master of Science degree in Computer Science from University of Florida and bachelors from BITS, Pilani. Besides founding the Sparks New Ventures program, he is also establishing the TiE Leadership Program in Silicon Valley.\r\n','',''),(123,'Vasant Manohar','Scientist in BBN Raytheon Technologies','BE(Comp science),1999 Batch\r\n','',''),(124,'Shivkumar Ganeshan','Former VP of flipkart.com','BE Hons.(Comp sci),2000 Batch\r\n','shivku@roopit.com',''),(125,'Neeraj Kedar','Associate in Frost and Sullivan','BE Hons.(Electrical and Electronics),2005 Batch\r\n','',''),(126,'Amit Sheth','Founder and Director of Mind’s Eye Design Pvt Ltd','Amit Sheth graduated from BITS Pilani (78 Batch) with a BE (Hons) in Elelctrical & Electronics Engineering. His PSII was lab and research work on holography (Applied Optics) at CSIO Chandigarh where he wrote and published a paper on White Light Holography. On the BITS Campus, Amit taught photography through EWYLP and was the Cactus Flower Photo Editor and also through the EDC directed 7 plays and acted in as many. Amit was also in charge of all auditorium lighting systems and upgradation .\r\nPost BITS, Amit did his PG from the National Institute of Design, Ahmedabad in Industrial Design (Products) and has also attended courses on Specialized Tooling for Medical Plastic Products (L&T McNeil Chennai), Product Design for India at the AOTC, Osaka, Japan and is till learning new technologies and process even today.\r\nAmit is the founder and director of Mind’s Eye Design Pvt Ltd, a design and engineering consultancy involved in a wide range of design  areas varying from product design to signage systems. More details can be had by visiting the website:\r\nhttp://www.mindseyedesign.org\r\nHe is also a Member if the Indian Roads Congress (IRC) and a Member of the Indian Society of Lighting engineers (MISLE) besides various design bodies and CII committees.\r\nIn addition to professional design consultancy, Amit is also a Visiting faculty at a number on institutions including the National Institute of Design, MICA, CEPT University (Ahmedabad), MIT (Pune) and Srishti (Bangalore). His subjects are design management, universal design, signage & wayfinding design, materials and processes (from wood to plastics) and systems design. He has developed the syllabus for both UG and PG programmes in Furniture & Interior Design as well as PG and XPG programmes in Design Management for NID and MICA respectively.\r\n\r\nEssentially, Amit is a tinkerer and is on a perpetual mission to try and improve products and product systems around us to make our lives more exciting, sensible, safe & fun.\r\n','',''),(127,'DR. B S Ramachandra','Director, Life Coach and Peak Performance Consultant,Centre for Fundamental Research and Creative Education, Bangalore','DR.B S Ramachandra,is a Mathematical Physicist and Educationist. He is currently Director, Life Coach and Peak Performance Consultant,Centre for Fundamental Research and Creative Education, Bangalore. He is also life Member of Karnataka Association for the Advancement of Science (KAAS), Bangalore,Indian Association of Physics Teachers (IAPT),Indian Institute of World Culture (IIWC), Bangalore and is also a visiting faculty at Research Education Advancement Program (REAP), Bangalore Association for Science Education and Jawaharlal Nehru Planetarium, Bangalore. \r\nHe did his B.E in Mechanical Engineering from Bangalore University, PhD from Indian Institute of Astrophysics, Bangalore. He did Post-doctoral fellowship from the Indian Institute of Astrophysics, Bangalore,and Inter-University Centre for Astronomy and Astrophysics, (IUCAA), Pune.\r\nHis research interests are Classical General Relativity,Loop Quantum Gravity and Geometric Quantum Mechanics and Quantization. Much of his work is focused on exploring the physical universe via the domain of Theoretical Physics and Mathematics and the inner universe of the human Brain-Mind-Consciousness via Cognitive Neuroscience and Ancient Wisdom. His other interests are Cognitive Sciences,Neuroscience ,Indian Culture, Spirituality and Yogic Tradition and History of Civilizations.','',''),(128,'Anand Agarwal','Professional Consultant and a Motivational\r\nSpeaker','He is a professional Consultant and a Motivational Speaker. He has already made over 540 presentations (including 69 at Infosys) to over 27,000 employees of a large number of Corporate all over India. His aim is to address over 100,000 and ensure that those who attend will take stock of their present situation in life, consolidate their gains and strive for higher levels of success.\r\nPlease visit http://fitnessfundas.googlepages.com/home to get the complete picture.','',''),(129,'Abhinav Khushraj','Strategy & Business Development Manager\r\nNokia\r\n','Abhinav drives strategy for Nokia Messaging, a key service that is driving Nokia’s transformation into a service company. As a business development manager, he is responsible for partnering with social media companies, scouting for white space opportunities in BRIC countries and driving operator and retail strategy. Prior to Nokia, Abhinav was an associate at General Catalyst Partners assisting a portfolio company with growth strategy. He has consulting experience at Booz Allen Hamilton, a mobile startup in New Zealand and a European seafood company. He has spent 5 years at Citrix Systems as release program manager for the Internet security business and was awarded the leadership and team achievement awards. \r\nAbhinav has an MBA from MIT Sloan School of Management where he worked on startup ideas in social media and mobile and was a semi-finalist in the MIT $100k competition. He also has a Master of Science degree in Computer Science from University of Florida and bachelors from BITS, Pilani. Besides founding the Sparks New Ventures program, he is also establishing the TiE Leadership Program in Silicon Valley.\r\n<br>\r\n<a href=\'http://www.celbits.org/ target=\'blank\'>www.celbits.org</a>\r\n\r\n','',''),(130,'Vinod Khosla','Founding Partner\r\nKhosla Ventures','Vinod grew up dreaming of being an entrepreneur, despite growing up in an Indian Army household with no business or technology connections. Since age 16, when he first heard about Intel starting up, he dreamt of starting his own technology company.\r\n\r\nUpon graduating with a Bachelors in Electrical Engineering from the Indian Institute of Technology, Delhi, he failed, at age 20, to start a soy milk company to service the many people in India who did not have refrigerators. He came to the US and got his Masters in Biomedical Engineering at Carnegie-Mellon University. His startup dreams attracted him to Silicon Valley where he got an MBA at Stanford University in 1980.\r\n\r\nUpon graduation he was one of the three founders of Daisy Systems, which was the first significant computer aided design system for electrical engineers. The company went on to significant revenue, profits and an IPO, but Khosla, driven by the frustration of having to design the computer hardware on which the Daisy software needed to be built, started the standards based Sun Microsystems in 1982 to build workstations for software developers. At Sun he pioneered \"open systems\" and RISC processors. Sun was funded by long time friend and board member John Doerr of Kleiner Perkins Caufield & Byers.\r\n\r\nIn 1986 he switched sides and joined Kleiner Perkins where he was and continues to be a general partner of KPCB funds through KP X. There, through the years, with other partners, he took on Intel\'s monopoly with Nexgen/AMD (the only microprocessor to have significant success against Intel, sold to AMD for 28% of AMD), incubated the idea and business plan for Juniper to take on Cisco\'s dominance of the router market, to formulate the very early advertising based search strategy for Excite, and to transform the moribund telecommunications business and its archaic SONET implementations with Cerent (sold to Cisco for $7B), and many other ventures. He helped in creating value, having fun, succeeding, failing (remember Dynabook?) and driving impact in partnership with entrepreneur, and the partners at KPCB.\r\n\r\nIn 2004, Khosla, driven by the need for flexibility to accommodate four teenage children and a desire to be more experimental, to fund sometimes imprudent \"science experiments\", and to take on both \"for profit\" and for \"social impact\" ventures, formed khoslaventures, funded entirely with family funds. His goals remain the same - work and learn from fun and knowledgeable entrepreneurs, build impactful companies through the leverage of innovation, and spend time as a partnership making a difference. He has a passion for nascent technologies that can have a beneficial effect and economic impact on society. \r\n\r\nVinod\'s greatest passion is being a mentor to entrepreneurs, assisting entrepreneurs and helping them build technology based businesses. Vinod assists or serves on the boards of a number of the companies including EASIC (programmable ASIC platform), Infinera (optical communications), Kovio (printed electronics), Skyblue (internet PC), Spatial Photonics (Micromirror displays), Xsigo (datacenter switch), among others.\r\n\r\nKhosla is a charter member of TiE, a not-for-profit global network of entrepreneurs and professionals founded in 1992 that now has more than forty chapters in nine countries. He is also a Founding Board member of the Indian School of Business. His current passion is Social Entrepreneurship with a special emphasis on Microfinance as a poverty alleviation tool. He is a supporter of many microfinance organizations in India and Africa. He has been experimenting with global housing. Vinod is also passionate about alternative energy, petroleum independence, and the environment. He can be reached at vk@khoslaventures.com.\r\n<br>\r\n<a href= \'http://www.celbits.org/\' target = \'blank\'>www.celbits.org</a>','',''),(131,'Prasanna Krishnan','Associate\r\nDraper Fisher Jurveston\r\n','Prasanna is an Associate and Kauffman Fellow at Draper Fisher Jurvetson. Prior to joining DFJ, Prasanna worked as a Program Manager at Microsoft on WinFS - a new storage system for next generation Windows PCs.  She defined the product design for storage and search capabilities, managed cross-functional teams, and worked with leading media software and document management companies to persuade them to adopt WinFS.  Prasanna was selected into the Microsoft Select Fast-track Program as one of 15 employees who demonstrated potential to be future leaders at the company.  She also worked at McKinsey & Company in their Philadelphia office, at Internet Capital Group and at Novell Software Development Ltd in India.\r\nPrasanna holds an MBA from the Wharton School where she graduated as a Palmer Scholar.  She has an MS in Computer Science from the University of Illinois at Urbana-Champaign where she was a Siebel Scholar, and received the C.W.Gear Outstanding Graduate Student award for research and service.  Prasanna holds a B.E. in Computer Science from BITS, Pilani, India where she received the University Fellowship awarded to the top 10 undergraduates each semester.  She was also awarded the BITS Alumni Association\'s \"30 under 30\" award.\r\n<a href=\'http://www.celbits.org/\' target =\'blank\'>www.celbits.org</a>','',''),(132,'Nickhil Jakatdar','CEO and Co-Founder\r\nVuclip','Prior to Vuclip, Nickhil was the President and COO of Praesagus, a MIT incubated start-up that he helped grow to becoming the most widely used design-to-manufacturing modeling software in its class, before its acquisition by Cadence Design Systems. Post-acquisition, Nickhil became Engineering Group Director at Cadence where he ran the entire Manufacturing Modeling Group. Prior to Praesagus, Nickhil helped found and served on the board of directors of CommandCAD, an electrical CAD company that was acquired two years after its founding. Prior to CommandCAD, Nickhil co-founded Timbre Technologies, a semiconductor manufacturing start-up, that won the first-ever Berkeley Business Plan competition, leading to a successful venture-backed financing. Nickhil served as CTO and VP of Marketing and Products as the company grew to become the industry standard in the field of scatterometry, before being acquired by Tokyo Electron Ltd. Nickhil remained at TEL for 3 years as Sr. Director of Technology and Marketing.\r\nNickhil received his M.S. and Ph.D. from UC Berkeley and has been the recipient of many awards from various organizations, including the IEEE Best Paper Award in the area of Transactions in Semiconductor Manufacturing for 2001, the Berkeley Distinguished Pioneer Award, the NSF and MICRO fellowships and the Most Outstanding Student award at the College of Engineering, Pune. He has been featured in several articles published in the United States and in India. He has to his credit more than 30 patents and 20 conference papers.\r\n<br>\r\n<a href=\'http://www.celbits.org/\' target =\'blank\'>www.celbits.org</a>','',''),(133,'Bob Meese','Business Development\r\nGoogle\r\n','Bob currently works as a business development manager at Google and is responsible for strategic partnerships with small and large companies for Google TV Ads. Prior to Google, he obtained an MBA at MIT Sloan School of Management. At MIT he was the President of the MIT Venture Capital Club and also won the International Venture Capital Competition. Prior to MIT, he was an associate at Millenia Partners, a leading venture capital firm in Boston. He also has extensive consulting experience in the wireless and digital media industry.\r\n<br>\r\n<a href=\'http://www.celbits.org/\' target =\'blank\'>www.celbits.org</a>','',''),(134,'Seph Skerritt','Founder/CEO\r\nProper Cloth\r\n','Seph lives in New York where he is running Proper Cloth, a custom clothing label providing premium quality, tailor-fit dress clothing via the internet.\r\nPrior to starting Proper Cloth (in reverse order), Seph received an MBA from MIT Sloan, completed consulting projects in Argentina (Popego), India (Infosys), China (Nicobar Group), consulted for the wireless startup Prince Edge, worked as a product manager for Northrop Grumman, founded Sfinx Productions, and studied electrical engineering at UCSD. \r\nSeph is especially interested in combining technology, aesthetic design and disruptive business strategies to create new and sustainable ventures.\r\n<br>\r\n<a href=\'http://www.celbits.org/\' target =\'blank\'>www.celbits.org</a>','',''),(135,'Ajay Kulkarni','Founder/CEO\r\nSensobi\r\n','Ajay is CEO and Co-Founder of Sensobi, a Blackberry application to help professionals organize and manage their business relationships, slated to launch in early 2009. He is also a recent MBA graduate from the Entrepreneurship and Innovation Program at the MIT Sloan School of Management, and holds Bachelors and Masters degrees in Computer Science, both also from MIT. Ajay’s 5+ years of experience in the mobile and financial industries includes time spent at Microsoft, Citigroup, 4INFO, and other startups, as well as a researcher at the MIT Artificial Intelligence Lab (now part of CSAIL).\r\nWhile in business school, Ajay organized and led the first ever MIT M-Prize for Mobile Entrepreneurship, securing sponsorship from Nokia and two leading Venture Capital firms, helping 15 teams of students develop their business plans targeted at the wireless industry. He is also a Co-Founder of Emerginvest, a financial startup that was a Finalist in the 2007 MIT $100K Entrepreneurship Competition, and that was selected as one of the 50 hottest new startups in 2008 by TechCrunch. He currently lives in Cambridge, Massachusetts.\r\n<br>\r\n<a href=\'http://www.celbits.org/\' target =\'blank\'>www.celbits.org</a>','',''),(136,'Anil Advani','Attorney\r\nOrrick, Herrington & Sutcliffe LLP, Silicon Valley\r\n','Mr. Advani, an attorney in Orrick\'s Silicon Valley office, is a member of Orrick\'s Emerging Companies Group and head of Orrick\'s India Practice Group.  Mr. Advani\'s practice focuses on the formation, financing and general corporate counseling of emerging companies and technology businesses.\r\nMr. Advani also has an active practice representing India-focused emerging companies, investment banks, financial institutions and venture funds, both in the United States and in India.\r\nBefore joining Orrick, Mr. Advani was General Counsel and Vice President of SemIndia, a pioneering effort to establish semiconductor manufacturing in India.  As General Counsel for SemIndia, Mr. Advani was responsible for coordinating with the Government of India in formulating a comprehensive semiconductor policy for India as well as with the State of Andhra Pradesh in structuring Fab City on the outskirts of the city of Hyderabad. \r\nPrior to joining SemIndia, Mr. Advani was a Senior Associate in the Silicon Valley offices of Cooley Godward where his practice focused on representation of emerging companies and the venture funds and banks that finance those companies.  Mr. Advani began his legal career as an attorney in India where he practiced for a number of years at the High Court of Delhi.\r\nMr. Advani has a Bachelor of Laws from the Faculty of Law, Delhi University, and a Master of Laws from Georgetown University Law Center, Washington, D.C.\r\n<br>\r\n<a href=\'http://www.celbits.org/\' target =\'blank\'>www.celbits.org</a>','',''),(137,'Diaz Nesamony','Founder, President & CEO\r\nJivox\r\n','Diaz Nesamoney founder of Jivox has had two prior successful ventures. Before founding Jivox, he founded Celequest, raised over $20M in venture capital, and served as its CEO until early 2007, when the company was acquired by Cognos Corporation. Celequest introduced the market\'s first BI appliance, a disruptive innovation that led to its acquisition by Cognos. He was previously co-founder, President and Chief Operating Officer at Informatica (NASDAQ:INFA), which he took from a startup to a publicly traded company in 1999 with a market capitalization of over a billion dollars. Informatica pioneered data integration software as a category and is now the market leader with over $400M in revenue.Diaz is a trustee of the American India Foundation, a leading international development organization charged with the mission of accelerating social and economic change in India. Diaz holds a Masters degree in Computer Science from the Birla Institute of Technology and Science in India.\r\n<br>\r\n<a href=\'http://www.celbits.org/\' target =\'blank\'>www.celbits.org</a>','',''),(138,'VT Bharadwaj','Vice President\r\nSequoia India\r\n','VT is a Vice President with Sequoia Capital India. Prior to joining Sequoia Capital India, VT worked at McKinsey & Company serving energy, automotive and retail clients. VT received an MBA from the Indian Institute of Management, Ahmedabad where he was awarded the President\'s Gold Medal. He also holds a BS in engineering from BITS Pilani.\r\n<br>\r\n<a href=\'http://www.celbits.org/\' target =\'blank\'>www.celbits.org</a>','',''),(139,'Rahul Chandra','Director – Investment Advisor\r\nHelion Venture Partners\r\n','Rahul is a co-founder of Helion and has 13 years of venture capital investing and corporate development experience in technology product and services companies in India and the US. He serves on the Board of UnitedLex and Mindworks. \r\nBetween 2000 and 2006, Rahul was based in Silicon Valley as part of the investment team at Walden International, a global venture capital firm with more than $2B under management. Between 2004 and 2005 he also led the M&A efforts at e4e Inc., a Santa Clara, CA based BPO company with more than 4,000 employees across the globe.\r\nRahul started Venture Capital investing in 1996 in India as the first hire at Walden\'s India office. In this role he managed investments for Walden\'s India dedicated Fund between 1996 and 2000. \r\nRahul has invested in more than 30 early-to-mid-stage companies such as Mindtree, Ikanos (IKAN), e4e Inc and Techspan (Headstrong). Prior to Walden, he worked in the Capital Markets Group at Lazard India, and in the Primary Market Department at the Securities Exchange Board of India. \r\nRahul has an MBA from University of California, Berkeley and graduated from Birla Institute of Technology & Science, Pilani in 1993.\r\n<br>\r\n<a href=\'http://www.celbits.org/\' target =\'blank\'>www.celbits.org</a>','',''),(140,'Anand Morzaria','Founder/CEO – Pennywise Solutions','Anand has founded two startups since he graduated from BITS, Pilani. The first is Pennywise Solutions and the other one is Tolmolbol.com. As a young entrepreneur, he has a lot of experience in creating a startup with a young team and minimal resources.\r\nAnand completed his Masters in Finance from BITS,Pilani, where he was also President of the University Students\' Union. He spearheads the business development, client relationships, and overall strategy of the company. When not charting out the growth plan for the company, he claims to serve up magic on the cooking range.\r\n<br>\r\n<a href=\'http://www.celbits.org/\' target =\'blank\'>www.celbits.org</a>','',''),(141,'Raju Reddy','Chairman & CEO, Sierra Atlantic','Raju is the founder and CEO of Sierra Atlantic. With over 2000 employees, Sierra Atlantic is headquartered in Silicon Valley, California and has Global Development Centers in Hyderabad, India and Guangzhou, China. Under his leadership, Sierra Atlantic has become a Best-in-Class Global IT Services company, and consistently ranked amongst best managed companies including the top 75 most Admired companies in Silicon Valley, Top 25 great places to work in India and Top 10 best employers in South China. Before founding Sierra Atlantic in 1993, he spent 10 years at Intel in software development, marketing and general management.\r\nRaju holds a Bachelor of Science degree in electrical engineering from BITS Pilani and a Master of Science degree in computer science from Virginia Tech.\r\nRaju is a member of the BITS Pilani Board of Directors and a Charter member of TiE Silicon Valley. He also served as a member of the Board of Trustees for Puente, a Wharton School non-profit program which helps under-privileged communities worldwide gain access to technology. Raju also co-founded SIPA (Silicon Valley Indian Professional Association) along with other young Indian engineers from Silicon Valley in 1987.\r\n<br>\r\n<a href=\'http://www.celbits.org/\' target =\'blank\'>www.celbits.org</a>','',''),(142,'Tania Aidrus','Director & Co-Founder','Tania started her career in consulting at Booz Allen Hamilton and First Consulting Group, where she organized and led teams to solve complex business problems for both government and commercial clients. Her work was primarily focused in the healthcare vertical. Prior to attending business school she was involved in setting up a Business Process Outsourcing operation within the mortgage industry. She currently works in advertising sales and operations at Google, Inc. in Cambridge, MA. Tania also serves on the executive committee of the Organization of Pakistani Entrepreneurs of North America (OPEN) where she actively works on promoting entrepreneurship within the local community. \r\nTania holds an MBA from the MIT Sloan School of Management and a BS in Biology and Economics from Brandeis University where she was a Presidential Scholar.\r\n<br>\r\n<a href=\'http://www.celbits.org/\' target =\'blank\'>www.celbits.org</a>','',''),(143,'Anurag Jain','Head of Applications Solutions Group\r\nPerot Systems','Anurag Jain leads Perot Systems’ Applications Solutions group and Insurance and Business Process Solutions group.  In these roles, he is responsible for the management, sales, and operations for these groups. Mr. Jain has more than 15 years of management, operations, consulting and business start-up experience.\r\nMr. Jain began his career as a management consultant with Gemini Consulting, where he launched wireless operations for telecom carriers worldwide.  He then founded two India-based outsourcing businesses.  Mr. Jain co-founded and served as head of operations for Brigade Corporation, a customer support company with 1,300 customer support employees across centers in the U.S., Europe, and India.  Mr. Jain then founded Vision Healthsource, a business focused on providing outsourcing services to healthcare providers and payers that was sold to Perot Systems in 2003.  Since 2003, Mr. Jain has been a senior leader of Perot Systems.\r\nFrom 2003 to 2005, he was a member of the Healthcare unit’s leadership team, where he had direct responsibility for business process outsourcing sales and operations and helped the organization to develop and operate integrated BPO and technology solutions.  In 2006, Mr. Jain led Perot System’ successful entrance into the Life Insurance industry, where Perot Systems today provides a wide range of technology and policy administration solutions.  He is also the architect of Perot Systems’ state of the art and comprehensive workflow management system.\r\nMr. Jain holds an M.B.A. from the University of Michigan and a B.S. degree in electronics and electrical engineering from the Birla Institute of Technology and Sciences, Pilani, India.  With his in-depth background and thought leadership in establishing globally-delivered workflow-system-based operations, he speaks at a numerous key business conferences each year.\r\n<br>\r\n<a href=\'http://www.celbits.org/\' target = \'blank\'>www.celbits.org</a>','',''),(144,'Anand Ramamurthi','PhD','<ul><li>Associate Professor, Department of Biomedical Engineering, Cleveland Clinic, Cleveland, OH</li><li>\r\nAdjunct Associate Professor of Biomedical Engineering, Case Western Reserve University, Cleveland, OH</li><li>\r\nAdjunct Associate Professor of Bioengineering, Clemson University, Clemson, SC</li></ul>\r\n','',''),(146,'Vasudev Shyam','Research Scholar at the Centre for Fundamental Research and Creative\r\nEducation (CFRCE), Bangalore','Formally in his 10th grade studying at the PSBB Learning Leadership\r\nAcademy, Bangalore.\r\nMastered Landau and Lifshitz Course of Theoretical Physics\r\n<ul><li>Vol 1 Mechanics along with Mathematical Methods (Complex Function Theory)</li>\r\n<li>Vol 2 The Classical Theory of Fields.</li>\r\n<li>Vol 3 Quantum Mechanics</li>\r\n</ul>\r\n<li>','',''),(147,'Naveen Goel','Managing Director of Naveen Goel Law Offices, a law firm based in New Delhi, India','<ul><li>MMS from BITS, Pilani</li>\r\n<li>LLB from Delhi University.</li>','naveen@naveenlaw.com',''),(148,'Santhosh Kasavajjala','Senior design engineer in National Semiconductors\r\nAlso worked at ST Microelectronics in India for 1 year','<ul><li>BE(hons) Mechanical Engineering and BE(hons) Electricals and Electronics Engineering from BITS PIlani in 2002</li>\r\n<li>Masters in Electrical Engineering from Stanford University</li>\r\n</ul>','',''),(149,'Raj R. Rao','<ul>\r\n<li>Associate Professor of Chemical and Life Science Engineering in the VCU School of Engineering</li>\r\n<li>Director of VCU’s International Partnership with the Indian Institute of Technology, Kharagpur</li>\r\n<li>Affiliate faculty appointment in t','<ul>\r\n<li>\r\n[BE(Hons)]Chemical Engineering and [MSc(Hons)]Biology from BITS, Pilani (1993)\r\n</li>\r\n<li>MS in Biotechnology from the University of Texas, San Antonio (1996)\r\n</li>\r\n<li>Ph.D in Biological Engineering from the University of Georgia (2001)</li>\r\n<li>US National Science Foundation (NSF)-CAREER award (2008)</li>\r\n<li>Qimonda Professorship (2009)</li>\r\n<li>VCU Engineering Student Council Outstanding Professor Award (2011)</li>\r\n</ul>','rrrao@vcu.edu',''),(150,'Dhruv Balwada','Currently working on Southern Ocean dynamics and its effects on the world climate','<ul>\r\n<li>B.E. Chemical Engineering, BITS Pilani, Goa Campus</li>\r\n<li>Practice School at Center for Mathematical Modeling and Computer Simulations(CMMACS) in Bangalore</li>\r\n<li>Founding memeber of the Environment Protection and Awareness Club at BITS Pilani, Goa Campus</li>\r\n</ul>','',''),(151,'Rahul Viswanath','Analog Design Engineer in Texas Instruments India Pvt. Ltd.','MSc. Maths and Electronics and Instrumentation Engineering from BITS Pilani(2010)','',''),(152,'Srini Swaminathan','Teach For India Fellow, 2010-12 (Teaching at the Dharavi Transit Camp Municipal School http://tfijourney.wordpress.com)','<ul>\r\n<li>B.E.(Hons.) EEE, BITS, Pilani (1997-2001)</li>\r\n<li>Worked in 7 countries at Schlumberger, 2001-2009</li>\r\n<li>UNDP Volunteer in Tsumani affected villages (\r\n     http://together-we-can.blogspot.com/)</li>\r\n<li>At BITS :Department of Photography, Pilani Tamizh Mandram, English\r\n     Press Club</li>\r\n<ul>','',''),(153,'Madhukar Banuri','<ul>\r\n<li>Government relations and program manager, Teach For India, Pune</li>\r\n<li>Teach For India Fellow, 2009-11</li>\r\n<li>Product Marketing Manager, Electrical Business Group, Larsen and Toubro, Mumbai</li>\r\n</ul>','<ul>\r\n<li>B.E. (Hons.) EEE, BITS, Pilani (2003-2007)</li>\r\n<li>At BITS: Executive Committee-EEE Association, Editorial Board-Yearbook, Center for Entrepreneurial Leadership</li>\r\n</ul>','',''),(154,'Saurav Patyal','<ul>\r\n<li>Co-Founder, The Parivartan Foundation.</li>\r\n<li>Business Developer at Laurus Edutec.</li>\r\n<li>Young India Fellowship.</li>\r\n<li>StartingBloc Fellow, 2010</li>\r\n</ul>','<ul>\r\n<li>Intern at Sunborne Energy Technologies</li>\r\n<li>B.E(Hons.) Electrical & Electronics Engineering, M.Sc(Hons.) Economics 2006 – 2011,BITS - Pilani</li>\r\n</ul>','',''),(155,'Nina G. Jablonski','<ul>\r\n<li> TED speaker</li>\r\n<li>Ph.D., FSB, Distinguished Professor of Anthropology, Pennsylvania State University, USA</li>\r\n</ul>',NULL,'',''),(156,'Gary C Kessler','Editor-in-chief,Journal of Digital Forensics, Security and Law.','<ul><li>Independent consultant and and practitioner in the areas of computer and network forensics, mobile device forensics, computer and network security, TCP/IP and the Internet, and communications protocols and standards.</li>\r\n<li>Interim associate prof at Norwich University in Northfield, VT</li>\r\n<li>Member of Vermont Internet Crimes Against Children (ICAC) Task Force</li> <li>Editor-in-chief of the Journal of Digital Forensics, Security and Law.</li></ul>','',''),(157,'Dr.Nilay Yajnik','Professor and Chairman - Information Systems Area Narsee Monjee Institute of Management Studies , Mumbai','BITS Pilani 78-83 batch','',''),(158,'Mihir Sarkar','<ul>\r\n<li>PhD candidate in Media Arts and Sciences</li>\r\n<li>research assistant in Music, Mind and Machine Group at the MIT Media Lab</li>\r\n<li>Head of Media Lab\'s India Initiatives, which aims to foster collaborations between the Media Lab and Indian org','<ul><li>Computer Science, Electronics, and Automatic Systems from ESIEA, France</li>\r\n<li>\r\nMaster of Science degree in Media Technology from MIT</li>\r\n</ul>','',''),(159,'Eva Nemeth','Physical therapist/Movement Educator',' national gymnastics school','',''),(160,'Srivarsha Rajshekar','<ul>\r\n<li> Indian Institute of Science Education and Research (IISER)-Pune\r\n</li><li>Will begin PhD in Fall 2012 at the Weill Cornell Graduate School of Medical Sciences of the Cornell University in New York</li></ul>','<ul><li>M.Sc. (Hons.) Biological Sciences at BITS-Pilani</li>\r\n<li>Thesis work at the Max Planck Institute of Dresden, Germany</li>\r\n</ul>','',''),(161,'Piyush Gupta','','<ul>\r\n<li>\r\nMS, Civil Engineering, University of Illinois\r\n</li>\r\n<li>\r\nB.E. (Hons), Civil Engineering,  BITS Pilani\r\n</li>\r\n</ul>','',''),(162,'Sandeep Sripada','Internet Services Advanced Data Analytics team at Apple Inc., Cupertino','<ul>\r\n<li>Masters in Computer Science from Stanford University with Specializing in Artificial Intelligence</li>\r\n<li>B.E.(Hons) BITS Pilani 2007</li>\r\n</ul>','',''),(163,'Rishikesh Vaidya','Assistant Professor, Physics department, Birla Institute of Technology and Science Pilani, Pilani campus','<ul>\r\n<li>Ph.D. from Physical Research Laboratory(PRL), Ahmedabad, in May 2002</li>\r\n<li>Post Doctoral work at PRL (6 months),  National Central University, Taiwan, (two and a half years) and the Tata Institute of Fundamental Research, Mumbai, (one and a half year)</li>','rishikesh@bits-pilani.ac.in',''),(164,'Prof Mark Gabel','Assistant Professor of Computer Science at the University of Texas at Dallas','<ul>\r\n<li>Ph.D. at UC Davis</li>\r\n<li> B.S. and M.S. degrees in Computer Science from California Polytechnic State University, San Luis Obispo</li>','mark.gabel@utdallas.edu',''),(165,'Anurag Jaipuriar',NULL,'<ul>\r\n<li>Engineer, Global Reaserch Centre, GE</li>\r\n<li>M.S Engineering Mechanics, Penn State University</li>\r\n<li>Reserch in Fibre Reinforced Polymer and Applications</li>\r\n<li>B.E Civil Engineering, BITS Pilani</li>\r\n</ul>\r\n','',''),(166,'Harshad Deshmukh','Graduate student in the Department of Computer Sciences at the University of Wisconsin - Madison','<ul>\r\n<li>M.Sc Maths and B.E.(Hons) Computer Science, BITS Pilani</li>\r\n<li>Member of the BITS2MSPhD team</li>\r\n<li>Worked for Cisco Systems, Bangalore</li>\r\n</ul>','',''),(168,'Dr.Paul Ormerod','Economist, Author, Entrepreneur </br>\r\n Author of 3 Bestselling books including “Why Most Things Fail” </br>\r\n','<ul>\r\n<li>Economist, Author, Entrepreneur</li>\r\n<li>Author of 3 Bestselling books including “Why Most Things Fail”</li>\r\n<li>Graduate from Christ\'s College Cambridge</li>\r\n<li>M.Phil, St Catherine\'s College Oxford</li>\r\n<li>Honorary Doctor of Sciences degree by University of Durham </li>','',''),(169,'Dr. Murat Kantarcioglu','<ul>\r\n<li> Associate Professor in the Computer Science Department</li>\r\n<li>Director of the UTD Data Security and Privacy Lab at the University of Texas at Dallas</li>\r\n</ul>','<ul>\r\n<li>B.S. in Computer Engineering from Middle East Technical University</li>\r\n<li>M.S. and Ph.D degrees in Computer Science from Purdue University</li>\r\n<li>Recipient of NSF CAREER award and Purdue CERIAS Diamond Award for Academic excellenc</li>\r\n</ul>','',''),(170,'Yash Gandhi',NULL,'<ul>\r\n<li>Masters student,Department of Industrial Engineering,Purdue University</li>\r\n<li>B.E(hons.)Chemical Engineering,BITS Pilani</li>','',''),(171,'Mr Rahul Dutt Avasthy',NULL,'<ul>\r\n<li>Director, Zapak Digital Entertainment</li>\r\n<li>Has been a cyber forensic expert for the UP Police Special Task Force</li>\r\n<li>Recently Conferred with Star Youth Achiever Award by Star news</li>\r\n</ul>\r\n','',''),(172,'Anyesha Mookherjee',NULL,'<ul>\r\n<li>B.E. Civil from BITS, Pilani (2001)</li>\r\n<li>M.S in Transportation Engineering from the University of Massachusetts, Amherst (2003)</li>\r\n<li>Licensed Professional Engineer (P.E.) and Professional Traffic Operations Engineer (P.T.O.E.) in the State of Maryland</li>\r\n<li>Traffic Engineer with the Maryland State Highway Administration.</li>\r\n</ul>','',''),(173,'Madhavan Venkatesh','Class XI student','Working on frontiers of theoretical physics ','',''),(174,'Chinmay Kulkarni',NULL,'Chinmay Kulkarni is a PhD student in Stanford’s Computer Science department, advised by Professor Scott Klemmer. Chinmay’s research focuses on peer processes in massive online learning. Chinmay has also worked at Microsoft Research on projects that enabled tools for end-user interactive storytelling, and on search technology for Bing, and interned with the Google+ team on social computing research.','',''),(175,'Laxmanan Krishnamurthy','','Lakshmanan Krishnamoorthy, is the Director Reporting Centre of Excellence of PayPal in India. Lakshmanan has 22+ years of experience in building, leading and managing global product development teams that have developed medium to large scale complex real time solutions. His passion is to take concepts to reality in many different areas like fingerprinting, Airline reservations, CallCenter and Airline Operations. Lakshmanan has deep industry knowledge in the operations of Airline, Call Center and is bringing his technical skills to the finance industry. Lakshmanan got his Bachelor\'s Degree in EEE from BITS Pilani in 1990 and has fond memories of his days in this great institution. Lakshmanan joined PayPal in Oct 2012 and moved to Chennai after living 20 years in Europe and USA. He lives with his wife and two boys.','',''),(176,'Rakesh Komuravelli ',NULL,'Rakesh Komuravelli is a 5th year Computer Science Ph.D. student at University of Illinois at Urbana-Champaign (UIUC) working with Prof. Sarita Adve on rethinking today\'s hardware for safe parallelism. His research interests include computer architecture, compilers, and parallel computing. He graduated from BITS Pilani in 2006 with a bachelors in Computer Science and was awarded the Institute\'s gold medal award. He interned at Microsoft Research and worked at Oracle for couple of years before joining the graduate school at UIUC. He recently interned at Intel where he worked on cutting edge heterogeneous architecture projects. Rakesh is a 2012 Qualcomm Innovation Fellow, a one in eight $100,000 award given by Qualcomm Incorporated that supports his research to address various hardware challenges in heterogeneous architectures.','',''),(177,'Arpit',NULL,'Arpit graduated from Pilani in 2011 with a degree in Computer Science. At Pilani he did some cool projects, which were presented in Apogee 2010. One of those won the Innovation Award by General Electric, and others went ahead for a patent. He converted his PS-2 to a thesis, to do research at National University of Singapore. Following that he went to University of Illinois at Urbana-Champaign (UIUC), for a really awesome Master\'s program. At Illinois, he hacks, and breaks things. He killed the Facebook Hackathon just one month into the program, and now works with Prof. Klara Nahrstedt on tele-immersive systems (really cool!). He is also a Siebel Scholar\'13, awarded to 85 students from the top-most universities around the world. ','',''),(178,'Vishwa',NULL,'Vishwa graduated from Pilani in 2011 with a bachelors in Computer Science and is currently pursuing his Masters from Johns Hopkins University. He has been a national swimmer and Goldman Sachs global leader. His principal areas of research are in topics that lie at the interface of Computer Science and Health Care. Back then at Pilani, he spent most of his time understanding human brain and developing devices that could assist the blind, paralyzed and other differently disabled people in living a better life. During his time at Hopkins, he has worked on multiple interesting challenges like developing brain computer interfaces that enable humans to control robots directly via their brain, methodologies to improve cancer diagnosis, and surgical devices and robots that drive the modern day surgeries. ','',''),(179,'Rizwan',NULL,'Rizwan graduated from the Pilani campus in 2010 with Bachelors in Computer Science and a special respect from half of the 06A7 batch for his help in building the 50% PLCC assignment. Rizwan is perhaps one of the few prolific BITSian programmers who toiled away many nights acing CodeChef and TopCoder challenges. He also deployed his skills building interesting projects with the Computer Science Association. Rizwan worked at DE Shaw for one year and is currently pursuing an MTech in CS at IIT Kanpur, where his research work focuses on Randomized Algorithms and Machine Learning. With his passion towards theory, he will be the perfect person to talk about Algorithms at ART','',''),(180,'Rajat Tibrewal',NULL,'Rajat Tibrewal passed out from BITS Pilani in 2011, with a dual degree in Physics and Computer Science. One of the brightest students in his batch, he was involved in a lot of extracurriculars as well - be it the Department of Backstage, the English Press Club and the English Languages Activities Society. For the Computer Science Association, he did an exceptional job as the APOGEE coordinator, guiding several prize-winning projects in a variety of technical areas. He landed himself a brilliant internship at IBM Research where he worked on the SyNAPSE project, and a highly coveted PS-2 at INSEAD where he spent his time touring Europe. Post his graduation, he\'s been working with Google on multiple backend systems, developing critical infrastructure for Google Apps for Business','',''),(185,'John C Mather','','<ul>\r\n<li>American astrophysicist, cosmologist</li>\r\n<li>Nobel Prize in Physics laureate for his work on the Cosmic Background Explorer Satellite (COBE)</li>\r\n<li>Ph.D. (Physics), University of California, Berkeley (4.0 GPA )</li>\r\n<li>(NRC Postdoctoral Fellow), Columbia University Goddard Institute for Space Studies</li>\r\n<li>B.Sc. (Physics), Swarthmore College (Highest Honors)</li>\r\n</ul>','',''),(186,'Subramanian Sundaram','','<ul>\r\n<li>Subra joined MIT as an ABB-MIT Energy Fellow in 2011.</li>\r\n<li>He is with the EECS department where he builds MEMS oscillators.</li>\r\n<li>Earlier, he worked on tunable MEMS gratings at the EPFL in Switzerland, and carbon nanotube based bio-sensors at the Max Planck Institute for Solid State Research in Germany.</li>\r\n<li>He received the B.E. degrees in Electrical Eng. and Mechanical Eng. from BITS Pilani (2005A3A4550P).</li>\r\n<li>During his free time he enjoys taking pictures and spends time coding, biking, running, sailing or ice skating.</li>\r\n</ul>','',''),(187,'Ashok Ajoy','','<ul>\r\n<li>Ashok Ajoy graduated from BITS-Goa in 2010 with a dual degree in Physics and EEE.</li>\r\n<li>He spent his final year in thesis school in IISc. Bangalore and Uni. Dortmund, Germany.</li>\r\n<li>In Sep 2010, he joined MIT\'s Research Lab of Electronics as a PhD student, where he works on exploiting spin defects for quantum computation.</li>\r\n</ul>','',''),(193,'Andrea Colaco','','<ul>\r\n<li>Andrea Cola&ccedil;o is a PhD student at the MIT Media Lab and an affiliate with the Research Laboratory of Electronics at MIT.</li>\r\n<li>Her research interests include statistical signal processing and optimization with applications to 3D sensing.</li>\r\n<li>She graduated with a B.E in EE from BITS, Pilani in 2007. She was a LG Electronics fellow (2009) for her work in connected experiences for television viewing.</li>\r\n<li>For her work on miniaturized 3D sensors for portable devices, she was the winner of the MIT $100K Entrepreneurship Competition\'s Pitch Contest in 2012 and a two time winner of the Qualcomm innovation research competition (2011, 2012).</li>\r\n<li>Prior to starting graduate studies, Andrea worked at HP Labs, Bangalore on low cost information access devices and validation of paper documents using mobile phones.</li>\r\n</ul>','',''),(189,'Ajay K Bhat','','<ul>\r\n<li>Ajay is a graduate student at Cornell University pursuing a PhD in Physics.</li>\r\n<li>He is working with Prof. Sunil Bhave (OxideMEMS Labs) in the ECE department.</li>\r\n<li>Ajay graduated from the Pilani campus obtaining a Dual Degree in M.Sc.(Honors) Physics and B.E.(Honors) Electrical &amp; Electronics Engineering.</li>\r\n<li>For his year long master\'s thesis, Ajay worked at Tata Institute of Fundamental Research, Mumbai under the guidance of Dr. Mandar Deshmukh in the Nanoelectronics Lab (TIFR-Nano).</li>\r\n<li>His current research is the field of interaction between MEMS and cold atoms</li>\r\n</ul>','',''),(190,'Prahar Mitra','','<ul>\r\n<li>Currently pursuing a PhD in Physics at Harvard University.</li>\r\n<li>He has previously completed an Integrated Master of Science (M.Sc.) Physics (Hons.) with a dual degree in Bachelor of Engineering (B.E.) Electronics and Electrical (Hons.) from the Pilani campus</li>\r\n<li>Prahar completed a one year Masters Thesis at the Tata Institute of Fundamental Research, Mumbai under Dr. Shiraz Minwalla, Department of Theoretical Physics during his final &nbsp;year at BITS.</li>\r\n<li>His Research Interests include Theoretical High Energy Physics, especially String Theory; with particular emphasis on the AdS/CFT Correspondence.</li>\r\n</ul>','',''),(194,'Dr. Abhishek Singh','<p><span style=\"text-decoration: underline;\"><strong>The man with PERFECT GRE score</strong></span></p>','<p>Senior Environmental Scientist at Intera Inc.<br /> B.E(Hons) Civil Engineering-BITS Pilani<br /> Ph.D,M.S. Civil and&nbsp;Environmental Engineering-University of Ilinois&nbsp;</p>','',''),(195,'Gaelen Pereira','<p>Currently working at Silvus Technologies<br /> Interned with Qualcomm and Bharti Airtel</p>','<p>B.E(hons) Electrical And Electronics Engineering, BITS Pilani</p>\r\n<p>MS.Electrical Engineering, UCLA</p>','',''),(196,'Satish Polisetti','<ul>\r\n<li>Currently runs&nbsp;Adsnative,Picatcha Inc.</li>\r\n<li>Internet at ISRO, Qualcomm and Cypress USA.</li>\r\n</ul>','<p style=\"text-align: justify;\"><span style=\"text-align: start;\">B.E(Hons.) Mechanical Engineering &amp; B.E(Hons.) Electrical Engineering</span></p>\r\n<p style=\"text-align: justify;\">MS, Information Systems, UC Berkley</p>','',''),(197,'Siddhartha Nath','<ul>\r\n<li>Worked at Intel Technology India Pvt. Ltd.</li>\r\n<li>Has six patents under his name</li>\r\n</ul>','<ul>\r\n<li>B.E(Hons) Electrical and Electronics Engineering</li>\r\n<li>PHD CS, UCSD</li>\r\n</ul>','',''),(198,'Tarun Khanna','','<ul>\r\n<li>Professor Economics, Strategy and Innovation, Harvard Business School.</li>\r\n<li>Director, South Asia Initiative Harvard University.</li>\r\n<li>Former Board Member of AES Corporation, SKC Microfinance,GVK Bio Sciences and TVS Logistics</li>\r\n</ul>','',''),(199,'Amlan Mukherjee','','<ul>\r\n<li>B.E(Hons.) Civil Engineering BITS Pilani</li>\r\n<li>PhD, University of Washington</li>\r\n<li>Associate Professor, Department of Civil and Environmental Engineering, Michigan Technological University</li>\r\n</ul>','',''),(200,'Nandini Vaidyanathan','<ul>\r\n<li>Founder of CARMa (Creating Access to Resources and Markets)</li>\r\n</ul>','<ul>\r\n<li>Delhi School of Economics</li>\r\n</ul>','',''),(201,'Samay Kohli','<ul>\r\n<li>CEO and Co-Founder, Grey Orange Robotics Pvt Ltd.</li>\r\n<li>Founder and Team leader, &nbsp;Team AcYut at Centre for Robotics and Intelligent Systems.</li>\r\n<li>Birla Institute of Technology and Science, Pilani.</li>\r\n</ul>','<p>Samay is one of the masterminds behind building India\'s first indiginious Humanoid Bot, our very own AcYut. He has also Co-Founded the company <a href=\"http://www.greyorangerobotics.com/\">Grey Orange Robotics</a> which aims to be India\'s answer to Honda\'s Asimov. He has been a researcher at C &amp; C Tachnologies and has been a research intern at ROBOTIS. For complete profile visit <a href=\"http://www.linkedin.com/in/ksamay\">Samay Kohli\'s LinkedIn Profile</a>.</p>','',''),(202,'Christian Sarkar','<p>Co-founder, The $300 House Project<br />CEO, Ecosystem Intelligence<br />CEO, Double Loop Marketing LLC<br />Director, Innovation for a sustainable world</p>','<p><span style=\"font-family: Arial, sans-serif; font-size: 13px; line-height: 15px;\">Emory University, Thunderbird, Babson, UCLA, Dartmouth, and Michigan</span></p>','',''),(203,'Chandra Prakash Khatri','<p>Application Developer, Oracle<br />Reasearch Assistant, Structural Engineering Research Centre, CSIR<br /><br /></p>','<p>Computational Science and Engineering, Georgia Tech<br />B.E. (Hons), Civil Engineering, BITS Pilani, India</p>','',''),(204,'Kiran Bedi','<ul>\r\n<li>Founded Navjyoti India Foundation for welfare and preventative policing.</li>\r\n<li>India Vision Foundation for prison reformation, drug abuse prevention and child welfare.</li>\r\n<li>Prominent member of the India Against Corruption (IAC)</li>\r\n<l','<p>For furthur details visit: <a href=\"http://www.kiranbedi.com/\">Dr. Kiran Bedi\'s website.</a></p>','',''),(205,'Yashkumar Gandhi','<p>Masters student at Purdue University<br />Chemical Engineering, BITS Pilani</p>','<p><a href=\"http://www.linkedin.com/in/ydgandhi\">LinkedIn Profile</a></p>','',''),(206,'Adwait Gandhe','<p>Masters student at Carnegie Melon University<br />Electrical and Electronics Engineering, BITS Pilani<strong><br /></strong></p>','<p><a href=\"http://www.linkedin.com/in/adwaitgandhe\">LinkedIn Profile</a></p>','',''),(207,'Varsha Rajashekar','<p>PhD Student at Weill Cornell Medical College<strong><br /></strong></p>','<p><a href=\"http://www.linkedin.com/pub/srivarsha-rajshekar/65/a79/aa8\">LinkedIn Profile</a></p>','',''),(208,'Amit Mukherjee','<p>1. Senior Planning Engineer, Petrofac International Limited<br />2. Project Control Manager and Senior Engineer, Larsen &amp; Toubro Limited&nbsp;<br />3. Senior Project Controls Engineer, Foster Wheeler India Private Limited&nbsp;<br /><br /></p>','<p>Visit <a href=\"http://ae.linkedin.com/pub/amit-mukherjee-pmp%C2%AE/20/a85/2b3\">LinkedIn</a> Profile for more information.</p>','',''),(209,'Shivakumar Ganesan','<div style=\"color: #222222; font-family: arial, sans-serif; font-size: 13px;\">\r\n<ul>\r\n<li>Co-founder at Exotel Techcom Private Limited</li>\r\n<li>B.E.(Hons.),C.S (2000-2004) &nbsp;</li>\r\n</ul>\r\n</div>','<p>Visit <a href=\"http://www.linkedin.com/in/shivku\">LinkedIn</a> profile for more information.<br /><br />Other speakers:&nbsp;<br /><br />1. Siddharth Ramesh:</p>\r\n<ul>\r\n<li>CTO, Exotel Techcom Private Limited</li>\r\n<li>B.E.(Hons), Computer Science, BITS Pilani (2000-04)</li>\r\n<li>M.S., Computer Science, University of Utah (2004-06)</li>\r\n</ul>\r\n<p>2. Karthikeyan Krishnamurthy:</p>\r\n<ul>\r\n<li>Head of Products, Exotel Techcom Private Limited</li>\r\n<li>B.E.(Hons), Computer Science, BITS Pilani (2000-04)</li>\r\n<li>PGDM, Marketing, IIM Lucknow</li>\r\n</ul>','',''),(210,'Gaurav Tekriwal','<p><span style=\"color: #222222; font-family: arial, sans-serif; font-size: 13px;\">Gaurav Tekriwal is a TED speaker and is the founder President of The Vedic Mathematics Forum(India). He has also the author of a 10 hour 5 DVD set which educates students on','<p>President, Vedic Maths Forum, India<br />TED Speaker<br />Dyanamic, AIESEC</p>','',''),(211,'Bandan Jot Singh','<p>Joined BITS Pilani in 2005 and completed Physics with E&amp;I Dual Degree in 2010 (2005B5A8813) . As a BITSian , he served as:</p>','<ol>\r\n<li>President , Punjab Cultural Association.&nbsp;</li>\r\n<li>Senior Core Member , Department of Theatre</li>\r\n<li>5000m Long Run Athlete , BOSM 2007 (finished 5th)</li>\r\n</ol>\r\n<p>In March 2013, he was part of the International Antarctic Expedition led by Sir Robert Swan. He was backed by three corporate sponsors for the expedition : RedBull, DataWind and Balkar Combines. After the leadership experience at the expedition , he came back to India and I has been delivering talks to universities. Right now, he\'s working on kick-starting a non-profit organization \'HumanFirst Global\' along with fellow BITSians . The aim is to help women rights and promote environmental sustainability among youngsters.</p>','',''),(212,'Kartik Kumar','<ol><ol>\r\n<li>Astrodynamics and Satellite missions (AS)</li>\r\n<li>Faculty of Aerospace Engineering</li>\r\n<li>Delft University of Technology</li>\r\n</ol></ol>','<p>For furthur details <a href=\"http://www.kartikkumar.com/\">Click here</a> to see speakers profile.</p>','',''),(213,'Suman Kapur','<p>Dean, International Programmes and Collaboration Division(University wide)<br />Professor, Biological Sciences Department <br />Birla Institute of Technology &amp; Science, Pilani,<br /> Hyderabad Campus</p>','<p>1. B.Sc Zoology from Delhi University, Delhi, 1977.<br /> 2. M.Sc Medical biochem from AIIMS, New Delhi, 1980.<br /> 3. Ph.D from AIIMS , New Delhi, 1986.<br /><br /> Scholarly Publications:<br /><br /> Articles in reviewed journals :&gt; 80 papers<br /> Presentations and Invited Lectures :&gt; 150 talks</p>','',''),(214,'M G Parameswaran','<p>ED &amp; CEO&nbsp;Draftfcb Ulka Advertising Mumbai</p>','<p>General Manager Sales at UDI Yellow Pages<br /> Marketing Services Manager at Boots Company India<br /> AE at Rediffusion DY&amp;R</p>','',''),(215,'Aswath Damodaran','<p>Kerschner Family Chair in Finance Education <br /><br /> The speaker is Dr. Aswath Damodaran, a professor of Finance at the Stern Business School, New York University. He is a finance top-shot, and has authored several books on finance.</p>','<ul>\r\n<li>Ph.D., Finance, 1985, UCLA&nbsp;<br /><br /></li>\r\n<li>M.B.A., Finance, 1981, UCLA<br /><br /></li>\r\n<li>M.S., Management, 1979, Indian Institute of Management&nbsp;<br /><br /></li>\r\n<li>B.Com., Accounting, 1977, Madras University&nbsp;</li>\r\n</ul>','',''),(216,' Dinkar Nandwana','<p>Mechanical Engineer at Schlumberger, Rosharon, TexasOil &amp; Energy<br /> Master of Science (M.S.), Mechanical Engineering, University of Illinois at Urbana-Champaign<br /> Bachelors of Engineering(Honors), Mechanical Engineering, BITS Pilani</p>','<p>A dedicated and enthusiastic professional with over 3 years of experience in product design (CAD), analysis (CAE) and optimization. Highly skilled in developing and handling computational software (ANSYS, NASTRAN) for modeling and analysis along with strong leadership &amp; teamwork skills, strong written and verbal communication skills</p>','',''),(217,'Manu Amitabh','<p>Mr. Manu Amitabh<br /> IES, Delhi PWD<br /> 1983 Batch, B.E.(Hons.) Civil Engineering</p>','<p>Central Engineering Service, CPWD, 1989 Batch</p>\r\n<p><strong>Previous:</strong> Management Development Institute, Gurgaon, J.K. Synthetics Ltd.</p>\r\n<p><strong>Education:</strong> Management Development Institute</p>','',''),(218,'Balaji Viswanathan','<ol>\r\n<li>Co-Founder at Zingfin.com</li>\r\n<li>Co-Founder at Agni Innovation Labs</li>\r\n<li>Founder at NalandaU</li>\r\n<li>Software Design Engineer at Microsoft- Core Operating System Division,<br />developing the RPC component for Windows 7.</li>\r\n</ol>','<ul>\r\n<li>Teaching Assistant at University of Maryland Baltimore County</li>\r\n<li>Software Design Engineer Intern at Cougaar Software, Inc.</li>\r\n</ul>','',''),(219,'Gayle Laakmann Mcdowell','<p><strong>Gayle Laakmann McDowell</strong> is the <strong>founder / CEO of CareerCup</strong>, and the author of <strong>Cracking the Coding Interview</strong> and <strong>The Google Resume</strong>.&nbsp;</p>','<p>Gayle has worked as a software engineer for <strong>Microsoft, Apple and Google.</strong> She holds a <strong>bachelor\'s and master\'s degree</strong> from the <strong>University of Pennsylvania in Computer Science</strong>, and an <strong>MBA from the Wharton School</strong>. She currently resides in Palo Alto, CA.</p>\r\n<ol>\r\n<li>HIGHLIGHTS\r\n<ul>\r\n<li>Founder / CEO of two profitable companies: CareerCup and Seattle Anti-Freeze.</li>\r\n<li>Former software engineer at Google, Microsoft, and Apple.</li>\r\n<li>Author of two books, Cracking the Coding Interview and The Google Resume. These books have been translated to 5 and 4 foreign languages respectively.</li>\r\n<li>Cracking the Coding Interview is Amazon&rsquo;s #1 book in &ldquo;Interviewing&rdquo; and averages around #250 on Amazon out of all books. It is still ranked at 5 stars after 150+ reviews.<br /><br /></li>\r\n</ul>\r\n</li>\r\n<li>ENTREPRENEURIAL EXPERIENCE\r\n<ul>\r\n<li>CareerCup.com:<br /> Founder / CEO / Software Engineer, 2005 &ndash; Present Helps software engineers prepare for interviews at technology firms through a Q&amp;A forum, videos, books, mock interviews, and resume review. CareerCup is monetized primarily through the sale of products, such as books and videos.</li>\r\n<li>Seattle Anti-Freeze:<br /> Founder / Co-CEO / Event Planner, 2008 &ndash; Present Organizes events of 100 &ndash; 500 people for young professionals in the Seattle area. Read more from the Seattle PI.<br /><br /></li>\r\n</ul>\r\n</li>\r\n<li>PROFESSIONAL EXPERIENCE\r\n<ul>\r\n<li>Keenscreen, Inc.:<br /> VP of Engineering, 2008 &ndash; 2009</li>\r\n<li>Google:<br /> Software Engineer, 2005 &ndash; 2008</li>\r\n<li>Apple:<br /> Software Engineer Intern, 2004</li>\r\n<li>Microsoft: <br />Software Design Engineer Intern, 2001, 2002, 2003</li>\r\n</ul>\r\n</li>\r\n</ol>','',''),(220,'Dr Deirdre Barrett','<p><strong>Deirdre Barrett, Ph.D.</strong> is an <strong>author</strong> and <strong>psychologist</strong> who teaches at <strong>Harvard Medical School</strong>. She is known for her <strong>research on dreams, hypnosis and imagery</strong> and has writt','<ol>\r\n<li>Psychologist at the Harvard Medical School.</li>\r\n<li>Past President of the International Association for the Study of Dreams and The Society for Psychological Hypnosis.</li>\r\n<li>She has interviewed modern artists and scientists including Nobel Laureates whose ideas originated in dreams.</li>\r\n<li>Dr. Barrett has appeared on Good Morning America, The Today Show, CNN, Fox, PBS, The Discovery Channel, and the BBC and her work has been featured in the <strong>Washington Post</strong>, <strong>The New York Times</strong>, <strong>The Wall Street Journal</strong>, <strong>Life</strong>, <strong>Time</strong>, and <strong>Newsweek</strong>.</li>\r\n</ol>','',''),(222,'Ankur Gupta','<p>MBA from IIM Ahmedabad<br />Author of The Seed of Genius<br />B. Pharma (Hons), BITS Pilani</p>','<p>An alumnus of IIM-Ahmedabad &amp; BITS-Pilani, the author shares his vast knowledge, experience &amp; learnings from his Mind ManagementTM workshops. He firmly believes that each individual is a Seed of Genius, waiting to sprout her/his true inner potential. Self-awareness is the key towards triggering this process. This book, therefore, includes iTry &amp; iQuiz exercises. These trigger self-discovery to enable an individual recognize his/her uniqueness and realize their natural multiple intelligences. Once identified, they can be wholistically nurtured. The results can be surprisingly motivating for unimaginable achievements.</p>','',''),(223,'Sarathbabu Elumamlai','<p>Sarathbabu Elumalai is an <strong>Indian entrepreneur</strong>, <strong>social worker</strong> and <strong>politician</strong>. He is an alumnus of Indian Institute of Management Ahmedabad and Birla Institute of Technology and Science(Pilani).</p>','<p>Winner of several awards such as <strong>CNN-IBN Award for Young Indian Leader, Pepsi-MTV Youth Icon</strong> and <strong>Example to Youth Award</strong>.<br /><br /><strong>Entrepreneurship:<br /></strong>After completing his management education, Sarathbabu decided to become an entrepreneur with the aim of providing employment to as many people as possible. In 2006, he started his venture \"Food King Catering services Private Limited\" with a capital of Rs 2000 to cater to banks, software companies and educational institutions.It is now located in 6 locations around India with a turnover of 8 crore.<br /><br /><strong>Social Work:<br /></strong>Sarathbabu has been actively motivating young people across the country with positiveness of his story and involved in various social activities like adopting education of needy meritorious students.In 2010,he started the \'Hunger Free India\' foundation, an initiative to free India of hunger in 20 years.</p>\r\n<p><strong>Politics:</strong></p>\r\n<p>Sarathbabu decided to take part in active politics with a mission to be a part of a cleaner system. He contested as an independent candidate from the South Chennai constituency during the 2009 Lok Sabha Elections 2009. Although he did not win, he secured over 15,000 votes.In 2010, he joined Desiya Murpokku Dravida Kazhagam, a regional political party, but quit the party later when his ideology didn\'t match with the party\'s. In the 2011 Tamil Nadu assembly elections,he contested again as an Independent candidate from the Velachery constituency (comprising Adyar, Thiruvanmiyur, Taramani, Velachery, Besant Nagar). He lost the elections, ending up third with 7472 votes. In 2011, Sarathbabu contested for the post of Chennai mayor.</p>','',''),(224,'Anjishnu Kumar','','<p>Anjishnu Kumar is an alumnus of BITS Pilani with B.E (Hons.) Chemical Engineering. He is currently pursuing MS Computer Science from Columbia University.</p>','',''),(225,'Ishaan Gupta','','<p>Master of Science(Biology), BITS Pilani<br />BE Hons Computer Science, BITS Pilani<br />Pursuing his Ph.D from European Molecular Biology Laboratory, Heidelberg, Germany</p>','',''),(226,'Vishnu Prasad','','<p>CEO/Janitor of Law Pundits<br /> LAW PUNDITS<br /> Saprev, Tavistock Law Ltd, Regent\'s College<br /> London School of Economics and Political Science</p>','',''),(230,'Prof. Krishna Saraswat','','<ul>\r\n<li>B.E. in Electronics in 1968 from BITS Pilani</li>\r\n<li>M.S. in Electrical Engineering in 1969 from Stanford University.</li>\r\n<li>Ph.D. in Electrical Engineering in 1974 from Stanford University.</li>\r\n<li>He has an honorary appointment of an Adjunct Professor at BITS Pilani.</li>\r\n<li>He has been a technical advisor, board member and consultant to several industrial organizations in USA, Asia and Europe.</li>\r\n</ul>','',''),(231,'Dr. Michele Mosca','','<ul>\r\n<li><span><span class=\"fsl\">Co-founder and Deputy Director of the Institute of Quantum Computing at the University of waterloo</span></span></li>\r\n<li><span><span class=\"fsl\">Researcher and founding member of the Perimeter Institute For Theoretical Physics.</span></span></li>\r\n<li><span><span class=\"fsl\">Professor of mathematics in the Department of Combinatorics and Optimization in the University of Waterloo</span></span></li>\r\n<li><strong>B.Maths</strong> degree from the University of Waterloo.</li>\r\n<li><strong>M.Sc.</strong> degree in mathematics and foundations of computer science from Oxford University<a title=\"Wolfson College, Oxford\" href=\"http://en.wikipedia.org/wiki/Wolfson_College,_Oxford\"><br /></a></li>\r\n<li style=\"text-align: left;\"><strong>D.Phil</strong> degree on the topic of quantum computer algorithms from Oxford University<a title=\"Wolfson College, Oxford\" href=\"http://en.wikipedia.org/wiki/Wolfson_College,_Oxford\"><br /></a></li>\r\n</ul>','mmosca@iqc.ca',''),(232,'Dr. Mandar Deshmukh','<ul>\r\n<li>A faculty member at TIFR since January 2006 in the Department of Condensed Matter Physics and Materials Science</li>\r\n</ul>','<ul>\r\n<li>A postdoctoral researcher in group of Hongkun Park at Harvard.</li>\r\n<li>B.Tech. in Engineering Physics from IIT Bombay.</li>\r\n</ul>','','<p>For more info :<a href=\"http://www.tifr.res.in/%7Edeshmukh/\" target=\"_blank\">http://www.tifr.res.in/~deshmukh/</a></p>'),(233,'Mr Soumitra Dutta','','<ul>\r\n<li>\r\n<p style=\"text-align: left;\"><span style=\"font-family: arial,sans-serif;\">Academic Dean,&nbsp;</span><span style=\"color: #252525; font-family: Helvetica Neue,Helvetica,Arial,sans-serif;\"><span style=\"line-height: 21px;\">Samuel Cortis Johnson Graduate School of Management, Cornell University</span></span></p>\r\n</li>\r\n<li style=\"text-align: left;\">\r\n<p>Previously served as the Dean of external relations, Insead Business School, France</p>\r\n</li>\r\n<li style=\"text-align: left;\">\r\n<p>Has worked as an Engineer with General Electrics(USA) and Schlumberger (Japan)</p>\r\n</li>\r\n<li style=\"text-align: left;\">\r\n<p><span style=\"line-height: 19px; font-family: sans-serif;\">His works get published very frequently in Harvard Business Review, Forbes, Mckinsey Quarterly and other leading Journals.</span></p>\r\n</li>\r\n<li style=\"text-align: left;\">\r\n<p>B.Tech. in Electrical Engineering and Computer Science from the IIT Delhi.</p>\r\n</li>\r\n<li>\r\n<p style=\"text-align: left;\">MS and PhD in Computer Science from the <span class=\"mw-redirect\">University of California at Berkeley</span>.</p>\r\n</li>\r\n</ul>','',''),(234,'Dr Philip Moriarity','<p>Dr Philip Moriarity a Professor of Physics in the School of Physics and Astronomy, University of Nottingham. His research interests span a number of topical themes in nanometre scale science with a particular current focus on single atom/molecule manip','<ul>\r\n<li>Professor of Physics, School of Physics and Astronomy, University of Nottingham [EPSRC Leadership Fellow from 2008 - 2014]</li>\r\n<li>Reader, School of Physics and Astronomy, University of Nottingham</li>\r\n<li>Lecturer, Department of Physics, University of Nottingham</li>\r\n<li>Postdoctoral researcher, Dept. of Physics, University of Nottingham [Research supervisor: Prof. PH Beton]</li>\r\n<li>PhD, School of Physical Sciences, Dublin City University [Supervisor: Prof. Greg Hughes]</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>He has also given a TEDx talk:&nbsp;<a href=\"https://www.youtube.com/watch?v=HvgomEfQfKc\">Guilty confessions of a YouTube scientist</a></p>','',''),(235,'Malvika Iyer','<p>Malvika iyer is a bilateral amputee from a freak bomb blast in 2002. She was the state topper in class 10th in 2004. Presently, she is a junior research fellow at madras school of social work.</p>\r\n<p>&nbsp;</p>','<p>She has worked with differently abled children at the centre for child and adolescent well being in delhi. She also undertook research projects in PEHEL, Schizophrenia research foundation (SCRAF). An alumnus of St.Stephens college , Delhi and Delhi school of social work, she is a recipient of \"outstanding model student\" from wisdom international magazine and \"Rolling cup\" for the best M.Phil Thesis in 2012.</p>\r\n<p>Talk given by her at TEDxYouth@Chennai:</p>\r\n<center><iframe class=\"youtube-player\" title=\"Malvika Iyer TEDx\" src=\"http://www.youtube.com/embed/9el_A5O9ZQI\" frameborder=\"0\" width=\"640\" height=\"390\"></iframe></center>','',''),(236,'Manoj Kumar Dora','<p>Manoj Kumar Dora is a Ford Foundation fellow. He was involved in several projects at the World Bank, UNCTAD and Maastricht University. Currently, he is working on operational efficiency improvement in organizations in Europe at Ghent University, Belgiu','<p>As a young child, Manoj wondered if his village would ever see a reason to prosper. He made his way from a small village in India and later to the United States. His tireless initiatives in India empowered several households to escape poverty. He believes that \"dream and persistence\" can bring the right \"change\" in people\'s life.</p>\r\n<p>Talk given by him at TEDxGhent:</p>\r\n<p>&nbsp;</p>\r\n<center><iframe class=\"youtube-player\" title=\"Manoj Kumar Dora TEDx\" src=\"http://www.youtube.com/embed/lxLHp3k8dJw\" frameborder=\"0\" width=\"640\" height=\"390\"></iframe></center>','',''),(237,'Lokesh V','','<p>Lokesh is Managing Director and Innovation &amp; IP Practitioner at Innomantra. He brings with him more than 20 years of professional experience in innovation management, intellectual property management, New Product Development.</p>\r\n<p>&nbsp;</p>\r\n<p>Prior to Innomantra, he led and managed innovation and intellectual property activities at Larsen &amp; Toubro. He began his career with the Medical Equipment and Systems Group at L&amp;T where he spent 12 years in mechanical design and development, Strategic Planning. At Innomantra, Lokesh has worked with clients in a wide range of sectors including Automotive, Industrial Equipment Manufacturing, Information Technology, Engineering Services, Medical Electronics and Consumer Goods in the areas of Intellectual Property Management and Innovation Management. He has also advised educational institutions, entrepreneurs, industry associations and government agencies in these areas. He has also the winner of India Innovation Challenge Award in 2008 at India Innovation Summit organised by CII and Govt. of Karnataka. He mentored several start-ups and participated as a juror at Economic Times &ndash;&lsquo;Power of Ideas&rsquo; twice.</p>\r\n<p>&nbsp;</p>\r\n<p>Lokesh has chaired and participated as speaker, juror in several Innovation &amp; IPR conferences and seminars. He has delivered guest lectures at institutions like IISc Bangalore, IIM Indore and BITS-Pilani. Lokesh, a Mechanical Engineer and Member and Secretary at Institution of Engineering &amp; Technology has an MBA in Marketing and PG Diploma in Intellectual Property Law from National Law School of India University (NLSIU).</p>\r\n<p>&nbsp;</p>\r\n<p>Talk given by him on TedxVelammal:</p>\r\n<p>&nbsp;</p>\r\n<center><iframe src=\"http://player.vimeo.com/video/27293537\" width=\"500\" height=\"375\"></iframe></center>','',''),(238,'Henry Reich','','<p>Henry Reich is an American physicist, mathematician and filmmaker. He created the popular educational and scientific YouTube channel MinutePhysics and MinuteEarth. The channels feature simple, concise and interesting facts and information about physics and the world around us. As of January 2014, Reich\'s MinutePhysics channel has over 2.1 million subscribers and 145 million video views.</p>','',''),(239,'Pradeep Kashyap','','<p>Pradeep Kashyap, known as the father of rural marketing has advised many Fortune 100 companies including GE, Google and Unilever (he co-created the world famous Project Shakti) on developing appropriate products, processes and sustainable business models. He will draw on his 45 years corporate experience and share dozens of practical examples to enrich his talk. &nbsp;</p>','',''),(240,'Roger C Hunter','','<p>Roger Hunter is the project manager for NASA\'s Kepler Mission, the first mission capable of finding potentially habitable planets in the Milky Way Galaxy, outside our solar system.</p>\r\n<p>Prior to joining NASA, Roger was with the Boeing Company as Site Manager in Colorado Springs, Colorado. In that position, he directed the efforts of over 250 Boeing engineers and technicians in sustaining the Global Positioning System (GPS) satellite constellation and the Air Force\'s GPS command and control system.</p>\r\n<p>He holds a bachelor of science in mathematics from the University of Georgia; a master of science in space operations and physics from the US Air Force Institute of Technology; and a master of airpower art and science from the US Air Force School of Advanced Airpower Studies. He is also a graduate of the US Air Force Air War College, and US Air Force Air Command and Staff College.</p>','',''),(241,'Preeti Monga','','<p>Preeti is today the founder director of Silver Linings Synergies Pvt. Ltd. and The Silver Linings Foundation. In addition she is a celebrated Motivation Speaker, an accomplished Corporate Trainer, a Trauma Counselor, a Fitness Consultant, a PR Professional, a Disability Rights Activist, an Author, a successful Business Woman and specializes in business development and influencing all with her powerful and positive personality. .</p>','',''),(242,'Viraj Voditel','','<p>Viraj Voditel,2010B3A2577Pis the Ex-president of Civil Engineering Assocition,BITS Pilani.He is the Founder,CEO of Techture&nbsp;Structures Pvt. Ltd. which a a startup in the&nbsp;Architecture, Engineering and Construction (AEC) industry. He was also the&nbsp;National Winners in the 3D Student Design Competition (AEC Category) conducted in October 2013 by Autodesk.</p>','',''),(243,'Dr. Arun Ross','','<p>Prof. Arun Ross is a BE(Hons) Computer Science passout of the 1996 batch. He is currently an associate professor in the Computer Science Department of the Michigan State University. His research interests include pattern recognition, classifier fusion, machine learning, computer vision and biometrics. Arun is a recipient of NSF&rsquo;s CAREER Award and was an invited speaker at the Frontiers of Science Symposium organized by the National Academy of Sciences in November 2006. He is the co-author of the book &ldquo;Handbook of Multibiometrics&rdquo; (Springer, 2006) and co-editor of the book &ldquo;Handbook of Biometrics&rdquo; (Springer, 2007).</p>','',''),(244,'Tushar vashisht','','<p>Prior to drinking the start up cool-aid, Tushar helped initiate Government of India\'s Unique ID (UID) project for almost two years. While at UID, he advised the Chairman, Mr. Nilekani, on project strategy, besides working on various business development aspects of the project. Before UID, Tushar spent nearly three years in investment banking/corporate finance with Deutsche Bank, spread between Silicon Valley and Singapore. He started his career on Wall Street with BlackRock. Tushar graduated from University of Pennsylvania in 2007 with a Bachelor of Applied Sciences, majoring in Computer Science with a minor in Electrical Engineering.</p>\r\n<p>While the UID project will likely bring about a lot of good to Indian residents, one big negative impact it had was Tushar\'s tremendous weight gain! But he worked hard over the last one year to lose most of it. Losing 18kg wasn\'t easy, especially without any gym access; and he owes a lot of it to friends\' guidance and support. He now wants to replicate a similar experience and more for others through his startup.</p>\r\n<p>Tushar is also a passionate musician/singer and loves to write and record songs in his free time.</p>','',''),(245,'Philip Moriarty','','<p>Prof Moriarty is a professor of Physics at the University of Nottingham. He is popular in Youtube channels Numberphile and Sixty Symbols where he along with other professors from Nottingham University talk about different things in the field of Maths and Physics.</p>\r\n<p>&nbsp;</p>\r\n<p>He also has given a TEDx talk :<a href=\"https://www.youtube.com/watch?v=HvgomEfQfKc\">Guilty confessions of a YouTube scientist.</a></p>','',''),(246,'Chaitanya Giri','','<p>Dr. Chaitanya Giri is a PostDoctoral Scientist and Co-Investigator in the COSAC team at the Max Planck Institute for Solar System Research in Germany. He is currently working on the European Space Agency&rsquo;s (ESA) Rosetta mission. Some of his research interests include exploration of extra-terrestrial organic matter, space instrumentation, exploration of planetary analogues on Earth, and space technology forecasting.</p>','',''),(247,'Sarathbabu Elumalai','','<p>He is the founder of our very own Food King Catering services Pvt. Ltd. He is a BITS Pilani graduate and also an IIM Ahmadabad alumnus.He is the recipient of several awards like the CNN-IBM Award for young Leadership and Pepsi-MTV Youth Icon</p>','',''),(248,'Pradeep Kumar V','','<p>He is the Director at HP Global Analytics. He is also an IIM Bangalore Alumnus. His&nbsp;</p>','',''),(249,'Dr. Nasir Memon','','<p>Nasir Memon is a professor in the Department of Computer Science and Engineering and director of the Information Systems and Internet Security (ISIS) laboratory at NYU-Poly and the founding director of the Center for Interdisciplinary Studies in Security and Privacy (CRISSP), a collaborative initiative of multiple schools within NYU including NYU-Steinhardt, NYU-Wagner, NYU-Stern and NYU-Courant. His research interests include digital forensics, data compression, and multimedia computing and security. Memon earned a Bachelor of Engineering in Chemical Engineering and a Master of Science in Mathematics from Birla Institute of Technology and Science (BITS) in Pilani, India. He received a Master of Science in Computer Science and a PhD in Computer Science from the University of Nebraska. He is Fellow of IEEE and SPIE and a Distinguished Lecturer of the Signal Processing Society.He has over 250 reserach papers and more than 12 US patents to his credit.He has received research grants over 15 million USD from NSF and other funding agencies. He is a recipient of several awards including the National Science Foundation&rsquo;s CAREER Award and the Jacobs Excellence in Education Award.</p>','',''),(250,'Dr Guha Manogharan','','<p>Dr. Guha Manogharan is an Assistant Professor in the Department of Mechanical and Industrial Engineering, College of STEM. &nbsp;Dr. Guha is also an Entrepreneur in Residence for Additive Manufacturing at the Youngstown Business Incubator. His research interests in additive and hybrid manufacturing including: material development, process modeling and inter-disciplinary mechanical and aerospace applications. He is also involved in the implementation and development of curriculum for Siemens PLM suited at YSU</p>','',''),(251,'Anand Singh Bhal','','<p>He is the Economic Advisor at Ministry of Urban Development, Government of India. He has previously provided his services at the Ministry of Finance, Government of India and the Department for International Development.</p>','',''),(252,'Joshua Engel','<p>Joshua Engel, holds a BS in computer science, with minors in math, physics, philosophy, and English, from Virginia Tech and master&rsquo;s in CS, with a bunch of work towards a master\'s in linguistics. Neither this nor his interest in juggling,baking w','<p>Joshua Engel, holds a BS in computer science, with minors in math, physics, philosophy, and English, from Virginia Tech and master&rsquo;s in CS, with a bunch of work towards a master\'s in linguistics. Neither this nor his interest in juggling,baking wedding cakes, professionally, being a pro marathon runner truly, donning on the caps of a software developer, author of &nbsp;\'Programming for the Java Virtual Machine\', actor/director of Shakespearean plays captures who he really is, he is indeed a man of many talents. With a strong following of over 26,000 people and having written over 7000 answer on Quora, he is also a three time top Quora Top Writer winner.&nbsp;</p>','',''),(253,'Joshua Engel','','<p>Joshua Engel, holds a BS in computer science, with minors in math, physics, philosophy, and English, from Virginia Tech and master&rsquo;s in CS, with a bunch of work towards a master\'s in linguistics. Neither this nor his interest in juggling,baking wedding cakes, professionally, being a pro marathon runner truly, donning on the caps of a software developer, author of &nbsp;\'Programming for the Java Virtual Machine\', actor/director of Shakespearean plays captures who he really is, he is indeed a man of many talents. With a strong following of over 26,000 people and having written over 7000 answer on Quora, he is also a three time top Quora Top Writer winner.&nbsp;</p>','',''),(254,'Mr. Sujit Lalwani','','<p>He is the Founder of IU Training, IUeMagazine, i3, ADAD, IU Cares Foundation &amp; 36Meals Trust.He has been One Young World Ambassador, World Merit Mentor For Asia &amp; Your Big Year 2012 Global Finalist and addressed 2.5 Million People globally. He was invited to \'VISIT Russia\' Forum in 2012 by Plenipotentiary Of President Of Russia to Inspire Ideas to Improve Tourism He has trained the members of CLIK - Consortium Of Electronic Industries Of Karnataka and has addressed the plenary Session on Education at One Young World Conference in Pittsburgh which housed Youth from 183 Countries &amp; Eminent personalities like Fatima Bhutto, Sir Mohd Yunus, Bob Geldoff, James Chau &amp; More. He also addressed Politicians, Bureaucrats &amp; Business Leaders in Nepal on Social Entrepreneurship, &nbsp;and GSAS, SPARR Electronics &amp; more companies of leadership development, marketing &amp; sales &amp; effective business development.</p>\r\n<p>&gt; &bull; Was invited to C3W conference in Jaipur to address on climate change.</p>\r\n<p>&gt; &bull; Inspires Leadership, better work ethics, personal leadership, business leadership, team spirit &amp; better management of resources.</p>\r\n<p>&gt; &bull; Namma Bengaluru Award Nominee in Top 7 under Youth Category.</p>\r\n<p>&gt; &bull; Featured in Top 40 Under 40 list of Potential Matrix published in Malaysia by Thriving Talents Company.</p>','',''),(255,'Manish Gurwani','','<p>Manish Gurwani is a bits pilani alumni (ID - 2008B4A3798P).He secured AIR-2 in the Indian Engineering Services Exam 2014.</p>','',''),(256,'Suhas Kashyap','<p>B.E(hons), Electrical and electronics Engineering &nbsp;BITS PILANI, Msc Physics BITS PILANI</p>','<p><span style=\"color: #333333; font-family: Arial, sans-serif; font-size: 13px; line-height: 17px;\">A professional, with demonstrated leadership skills, thriving in complex environments solving business problems with scientific rigour, and open to creative approaches.&nbsp;</span><br style=\"color: #333333; font-family: Arial, sans-serif; font-size: 13px; line-height: 17px;\" /><br style=\"color: #333333; font-family: Arial, sans-serif; font-size: 13px; line-height: 17px;\" /><span style=\"color: #333333; font-family: Arial, sans-serif; font-size: 13px; line-height: 17px;\">Global sales professional with experience(4+ years) in the technology sector (Enterprise software, High performance computing, IT hardware/services, Cloud software, Web acceleration, Web security) and has handled/handling accounts in enterprise, education &amp; research, government and media &amp; entertainment verticals.</span><br style=\"color: #333333; font-family: Arial, sans-serif; font-size: 13px; line-height: 17px;\" /><br style=\"color: #333333; font-family: Arial, sans-serif; font-size: 13px; line-height: 17px;\" /><span style=\"color: #333333; font-family: Arial, sans-serif; font-size: 13px; line-height: 17px;\">Product and project management(18+ months) experience in building &amp; managing end to end product life cycle along with introducing systems/processes for software development while managing a cross geographic team.</span></p>','',''),(257,'Anupam Purwar','<p>Anupam Purwar is a scientist at IISC Bangalore.</p>','<p>Anupam Purwar had been a student of mechanical engineering of batch 2009 at BITS PILANI,pilani campus.He graduated in the year 2013 and since then has been working as a scientist at IISC Bangalore.&nbsp;</p>','',''),(258,'ROHAN S. PURI','<p>Rohan S. Puri used to work at TechStars Boston.He has been teaching and prototyping wearable electronics at the MIT Media Lab.On occasion he also builds mobile apps.He also mentors at Harvard i-lab,Startup Weekend,Startup Institute. &nbsp;</p>','<p>Rohan Puri is an entrepreneur, a researcher and a mobile app developer at the MIT Media Lab.</p>','',''),(259,'Kovid Goyal','','<p>Founder of Calibre, a leading e-book management software and PH.D. in Quantum Computing from CALTECH</p>','',''),(260,'Jatin Rastogi','','<p>co-founder Wildbeez creative services</p>','',''),(261,'Samir Mathur','','<p>Physicist specialising in string theory and black holes, Ohio state university</p>','',''),(262,'Roman Saini','','<p>IAS officer</p>','',''),(263,'Robert Waggoner','','<p>Author of Lucid Dreaming</p>','',''),(264,'Steve G Jones','','<p>Expert on Astral Projections</p>','',''),(265,'Mandar Chaphalkar','','<p>Civil Engineer</p>','',''),(266,'Sharmila Chatterjee','','<p>senior lecturer in marketing and academic head for enterprise management track at MIT sloan</p>','',''),(267,'John Horner','','<p>Build a Dinosaur project</p>','',''),(268,'Newsha Ghaeli','','<p>MIT senseable city lab</p>','',''),(269,'Nikhil Sachan','','<p>Author</p>','',''),(270,'Newsha Ghaeli','','<p>MIT researcher</p>','',''),(271,'Steve G Jones','','<p>Hypnotherapist</p>','',''),(272,'Jatin Rastogi','','<p>Alumni, Founder WildBeez creative services</p>','',''),(273,'Sudhir Raniwala','','<p>Professor Sudhir Raniwala teaches in the University of Rajasthan. He pursues his experimental research programs at European Organisation for Nuclear Research, CERN, which is the largest particle physics laboratory in the world. &nbsp;CERN is also known for creating the world-wide-web, and for the discovery of Higgs boson (popularized in the media as God particle) at the Large Hadron Collider. He also participates in the STAR experiment at Brookhaven National Laboratory.</p>','',''),(274,'Dr. Rupak Mahapatra','<p>Experimental Particle Physicist,Associate Professor Texas University</p>','<p>Professor</p>','',''),(275,'Dr Kavita Vachaknavee','<p>MA HIndi,</p>\r\n<p>Phd Hindi</p>','<p>Professor, Cambridge University</p>','',''),(276,'Vijay Verma','<p>Currently pursuing PhD in Physics in California Institute of Technology (CalTech).</p>\r\n<p>Vijay Varma is currently a Ph.D. student at the Caltech Physics department. His main research interests are Numerical Relativity and Gravitational Waves. Vijay c','<p>The talk will also feature Samarth Hedge who is currently pursuing his PhD in Biology in University of Washington.</p>','',''),(282,'Phanindra Sama','<p>CEO &amp; Co-Founder, redBus.in.</p>','<p>www.redBus.in is India\'s largest bus ticketing company.&nbsp;</p>\r\n<p>The company has been acquired by Naspers ( http://knowledge.wharton.upenn.edu/article/the-redbus-acquisition-a-boost-for-indias-startup-ecosystem/ ) in Jun\'2013.</p>\r\n<p>For more details: http://foundora.com/post/phanindra-sama-co-founder-of-redbus-tells-his-startup-story/</p>','',''),(280,'Suhas Kashyap','<p>Suhas Kashyap, is a notable BITS alumni, who has recently launched a platform called Career Centre on BGM 2014</p>','<p>https://www.linkedin.com/in/suhaskashyaps</p>','',''),(281,'Dipankar Bhattacharya','<p>Professor, Inter-University Centre for Astronomy and Astrophysics, (IUCAA)</p>','<p>Prof Bhattacharya works mainly in the area of High Energy Astrophysics. His specific interests are Neutron Stars, Supernova Remnants and Gamma Ray Bursts. &nbsp;Of late his focus has been on the effect of matter accretion on the magnetic fields of Neutron Stars. Along with his students he is investigating the distortion of magnetic fields caused by accretion, the spreading of matter on the surface, and the use of cyclotron lines as a probe of these processes.</p>\r\n<p>He has been closely involved in developmental work related to the Indian space astronomy mission ASTROSAT. His contributions have mainly been in the design of Coded Mask imaging elements and data pipeline and analysis software.&nbsp;</p>','','<p>http://www.iucaa.in/~dipankar/Welcome.html</p>'),(283,'Pruthvi Reddy','<p>Co-Founder, think3D.in</p>','<p>Started think3d, one of the first 3D printing companies in India, with a mission to bring the fruits of this technology to the masses. think3d.in is a one stop portal providing latest news in 3Dprinting space, an online store for selling 3D printers,and a dedicated training platform. Visit www.think3d.in to find more information.</p>','','<p>Alumnus of IIM-C and BITS Pilani.</p>'),(284,'Rohan Puri','<p>Rohan Puri both teaches and build devices for health and human-computer interaction at the MIT Media Lab. He used to work at TechStars Boston, and on occasion he gives talks and build mobile apps. He also mentors at Harvard i-Lab, Startup Weekend, Star','<p>http://www.rohanspuri.com/</p>','',''),(285,'Anupam Purwar','<p>Anupam Purwar is a 2013 graduate from BITS and is currently a scientist at IISc Bangalore.</p>','<p>Anupam Purwar had been a student of mechanical engineering of batch 2009 at BITS PILANI,pilani campus.He graduated in the year 2013 and since then has been working as a scientist at IISC Bangalore.&nbsp;</p>','',''),(286,'Sam Rafus Nallaraj','<p>CEO at Mxit India&nbsp;</p>','<p>Find him @&nbsp;http://www.samrufus.com/</p>','',''),(287,'Dr Nasir Memon','<p>Professor and Department Chair &amp; Director of the Information Systems and Internet Security at NewYork University</p>','<p>Nasir Memon is a professor in the Department of Computer Science and Engineering at NYU Polytechnic School of Engineering and director of the Information Systems and Internet Security (ISIS) laboratory . He is one of the founding members of the Center for Interdisciplinary Studies in Security and Privacy (CRISSP) , a collaborative initiative of multiple schools within NYU including NYU-Steinhardt, NYU-Wagner, NYU-Stern and NYU-Courant. His research interests include digital forensics, biometrics, data compression, network security and security and human behavior. Memon earned a Bachelor of Engineering in Chemical Engineering and a Master of Science in Mathematics from Birla Institute of Technology and Science (BITS) in Pilani, India. He received a Master of Science in Computer Science and a PhD in Computer Science from the University of Nebraska.&nbsp;</p>\r\n<p>Prof. Memon has published over 250 articles in journals and conference proceedings and holds a dozen patents in image compression and security. He has won several awards including the Jacobs Excellence in Education award and several best paper awards. He has been on the editorial boards of several journals and was the Editor-In-Chief of Transactions on Information Security and Forensics.&nbsp;</p>\r\n<p>He is an IEEE Fellow and a distinguished lecturer of the IEEE Signal Processing Society. Memon is the co-founder of Digital Assembly and Vivic Networks, two early-stage start-ups in NYU-Poly\'s business incubators.</p>','',''),(288,'Sujit Lalwani','<p>Sujit Lalwani is a Serial Entrepreneur, Business Coach, an International Inspirational Speaker &amp; an Author. He has addressed more than 3.5 Million People globally. He is on board companies that include startups like i3 Training Platform, iUeMagazin','<p>Sujit Lalwani envisions empowerment of youth globally towards excellence &amp; self leadership through experiential education by engaging them in activities that involve social impact.</p>\r\n<p>&nbsp;</p>\r\n<p>Find more at:&nbsp;http://www.sujitlalwani.com/</p>','',''),(289,'Wing Huen Ip','','<p><span class=\"collapseTables\">Wing-Huen Ip was born in Nanjing, China (1947). He grew up in Macau. After his college education in the Chinese University of Hong Kong, he went to University of California at San Diego (UCSD), for his PhD study in 1974. His doctoral thesis is on the study of small solar system bodies. After three postdoctoral fellowships at UCSD, he went to Germany in 1978 to work at the Max-Planck-Institute for Aeronomy (now MPI for Solar System Research). After 20 years in Europe, he was appointed professor of astronomy and space science at the Institute of Astronomy and Space Science, National Central University (NCU) in Taiwan and served for six years (1998-2004) as dean of science and three years as vice-president (2006-2008). He is also professor at the Space Science Institute, Macau University of Science and Technology, Macau. His main research fields are solar system plasma physics, planetary dynamics and planetary exospheres. He has participated in several major planetary missions including Giotto to comet Halley, Galileo to Jupiter, Cassini to Saturn and Titan, Mars Express and Rosetta. Prof. Ip was awarded the Axford Medal by the Asia-Oceania Geosciences Society in 2011</span></p>','',''),(290,'Carla Diana','','<p>Internet of things researcher</p>','',''),(291,'Patrick dasgupta','','<p>Physicist</p>','',''),(292,'Samarth Hegde','<p>Alumni, PhD. Molecular Biology at Washington University<span style=\"font-family: arial, sans-serif; font-size: 12.8px;\"><br /></span></p>','<p class=\"MsoNormal\" style=\"margin: 0px; font-family: arial, sans-serif; font-size: 12.8px; font-stretch: normal;\"><span style=\"font-size: 12.8px;\">Samarth is from the 2009 Batch of the Pilani campus, and received a Master&rsquo;s in Biological&nbsp;</span><span style=\"font-size: 12.8px;\">Sciences from the University in 2013.</span><span style=\"font-size: 12.8px;\">Currently, he is a Ph.D. student in Molecular Cell Biology at the Division of Biology &amp; Biomedical&nbsp;</span><span style=\"font-size: 12.8px;\">Sciences (DBBS), Washington University School of Medicine in St. Louis, Missouri (USA). His&nbsp;</span><span style=\"font-size: 12.8px;\">research interests involves understanding aberrant immune responses in pancreatic cancer.</span></p>\r\n<p><span style=\"font-size: 12.8px;\">&nbsp;</span></p>','',''),(293,'Ashwin Naik','<p>Alumni, Masters at Georgia Tech</p>','<p class=\"MsoNormal\" style=\"margin: 0px; font-family: arial, sans-serif; font-size: 12.8px; font-stretch: normal;\"><span style=\"font-size: 12.8px;\">Ashwin attended BITS Pilani, Pilani campus from 2008 to 2012 and received a Bachelor&rsquo;s of&nbsp;</span><span style=\"font-size: 12.8px;\">Engineering in Electrical and Electronics.&nbsp;</span><span style=\"font-size: 12.8px;\">Currently, he is a second year master&rsquo;s student at the Georgia Institute of Technology. His&nbsp;</span><span style=\"font-size: 12.8px;\">research interests are broadly in the fields of Computer Architecture and VLSI design.</span></p>\r\n<p><span style=\"font-size: 12.8px;\">&nbsp;</span></p>','',''),(294,'Leslie Rogers ','<div style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"font-size: 12.8px;\">Prof. Rogers is a Hubble Fellow at&nbsp;</span><a style=\"color: #1155cc;\" href=\"http://www.caltech.edu/\" target=\"_blank\">Caltech</a></div>','<div style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px;\">&nbsp;</span><span style=\"font-size: 12.8px;\">Dr. Leslie Rogers is currently a NASA Sagan Fellow at UC Berkeley, and has also joined as a faculty in the Department of Astronomy and Astrophysics, University of Chicago. She earned her PhD from Massachusetts Institute of Technology in 2012 (advised by Sara Seager), and the same year joined California Institute of Technology as Hubble Fellow. Her primary research interests are- Formation, structure, composition, and evolution of super-Earth and sub-Neptune exoplanets, Statistical Methods for Exoplanet Characterization, Gravitational Microlensing, Interacting binary stars and Meteoroid ablation in the Earth&rsquo;s atmosphere. During the course of her research career, she has worked with prominent planetary scientists including Sara Seager and Jack Lissauer. She holds professional memberships of American Astronomical Society (AAS), Division for Planetary Sciences (DPS), Canadian Astronomical Society/Soci&eacute;t&eacute; Canadienne d&rsquo;Astronomie (CASCA) and American Geophysical Union (AGU). &nbsp;</span></div>\r\n<p><span style=\"font-size: 12.8px;\">&nbsp;</span></p>\r\n<div style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px;\">&nbsp;</div>','',''),(295,'Hima Kiran Illadi','<p>Working with Advanced data analytics division of IBM</p>','<p>BITS Alumni, MS from Carnegie Mellon University</p>','',''),(296,'Jaideep Prabhu','<p><span style=\"color: #252525; font-family: sans-serif; font-size: 14px; line-height: 17.92px;\">Professor of Business and Enterprise at the&nbsp;</span><a style=\"color: #0b0080; text-decoration: none; font-family: sans-serif; font-size: 14px; line-height','<p><span style=\"color: #252525; font-family: sans-serif; font-size: 14px; line-height: 17.92px;\">Jaideep Prabhu&nbsp;is the&nbsp;</span><span style=\"color: #252525; font-family: sans-serif; font-size: 14px; line-height: 17.92px;\">&nbsp;Professor of Business and Enterprise at the&nbsp;</span><a style=\"color: #0b0080; text-decoration: none; font-family