,'Dr. Harry Cliff','<p><span style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px;\">Harry Cliff works on the Large Hadron Collider at CERN and is a member of the LHCb collaboration, a large international team searching for signs of new particles.</span></','<p>Education : University of Cambridge</p>','cliff@hep.phy.cam.ac.uk',''),(302,'Dr. Harry Cliff','<p><span style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px;\">Harry Cliff works on the Large Hadron Collider at CERN and is a member of the LHCb collaboration, a large international team searching for signs of new particles and force','<p>Education: University of Cambridge</p>','cliff@hep.phy.cam.ac.uk',''),(303,'Sir Anthony J. Leggett','<p class=\"MsoNormal\" style=\"margin: 0px 0px 0.0001pt; color: #222222; font-family: arial, sans-serif; font-size: 12.8px;\"><strong><span style=\"font-size: 9.5pt; font-family: Verdana;\" lang=\"EN-IN\">2003 Nobel Prize</span></strong><span style=\"font-size: 9.','<p><span style=\"color: #222222; font-family: Verdana; font-size: 12.6667px;\">He set directions for research in the quantum physics of macroscopic dissipative systems and use of condensed systems to test the foundations of quantum mechanics. His research interests lie mainly within the fields of theoretical condensed matter physics and the foundations of quantum mechanics.</span></p>','',''),(304,'Sir Anthony J. Leggett','<p class=\"MsoNormal\" style=\"margin: 0px 0px 0.0001pt; color: #222222; font-family: arial, sans-serif; font-size: 12.8px;\"><strong><span style=\"font-size: 9.5pt; font-family: Verdana;\" lang=\"EN-IN\">2003 Nobel Prize</span></strong><span style=\"font-size: 9.','<p><span style=\"color: #222222; font-family: Verdana; font-size: 12.6667px;\">He set directions for research in the quantum physics of macroscopic dissipative systems and use of condensed systems to test the foundations of quantum mechanics. His research interests lie mainly within the fields of theoretical condensed matter physics and the foundations of quantum mechanics.</span></p>','',''),(307,'Yash Mulgaonkar','','<div style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px;\">\r\n<div><a style=\"color: #1155cc; font-size: 12.8px;\" href=\"http://yashmulgaonkar.com/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://yashmulgaonkar.com/&amp;source=gmail&amp;ust=1471763576817000&amp;usg=AFQjCNH1DP2tZVzXSRELWaquPq_1-PqTnA\"><span style=\"font-family: verdana, sans-serif;\">Yash Mulgaonkar</span></a><span style=\"font-size: 12.8px;\"><span style=\"font-family: verdana, sans-serif;\">&nbsp;is a research scientist at the&nbsp;<strong>University of Pennsylvania</strong>, currently pursuing his PhD on Multi-Robot Systems, under the famous Vijay Kumar of GRASP Labs, Upenn. Early in his career, Mulgaonkar developed the world&rsquo;s smallest autonomous drone. He&rsquo;s since been focused on how to make drones and other robots accessible to everyone by developing rapid fabrication methods for them. His research is also focused on training robots to work together so they can accomplish tasks more efficiently. He has also been listed in \'<strong>2016 Forbes 30under30</strong>&nbsp;list for Science\'</span>.</span><strong style=\"color: #444444; font-family: verdana, sans-serif; font-size: 12.8px;\"><br /></strong></div>\r\n<div><strong style=\"color: #444444; font-family: verdana, sans-serif; font-size: 12.8px;\">&nbsp;</strong></div>\r\n</div>','',''),(306,'David Kaiser','<p>NA</p>','<div class=\"gmail_default\" style=\"font-size: 12.8px; font-weight: normal;\"><span style=\"font-family: verdana, sans-serif;\"><span style=\"color: #444444;\"><a style=\"color: #1155cc;\" href=\"http://t.sidekickopen60.com/e1t/c/5/f18dQhb0S7lC8dDMPbW2n0x6l2B9nMJW7t5XYg644b_WW4X9_h08rBKpMW2zq5cM56dGrhf3byTSl02?t=http%3A%2F%2Fweb.mit.edu%2Fphysics%2Fpeople%2Ffaculty%2Fkaiser_david.html&amp;si=6527416327733248&amp;pi=766014f3-6cd7-48aa-8a19-ee808ee234ed\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://t.sidekickopen60.com/e1t/c/5/f18dQhb0S7lC8dDMPbW2n0x6l2B9nMJW7t5XYg644b_WW4X9_h08rBKpMW2zq5cM56dGrhf3byTSl02?t%3Dhttp%253A%252F%252Fweb.mit.edu%252Fphysics%252Fpeople%252Ffaculty%252Fkaiser_david.html%26si%3D6527416327733248%26pi%3D766014f3-6cd7-48aa-8a19-ee808ee234ed&amp;source=gmail&amp;ust=1471747076140000&amp;usg=AFQjCNFMI3GFEarLysXEZFDkYXkb8ap4kw\"><strong>Sir David I. Kaiser</strong></a>, has been&nbsp;</span><span style=\"color: #444444;\">a</span><span style=\"color: #444444;\">&nbsp;</span><span style=\"color: #000000;\">Germeshausen Professor of the History of Science&nbsp;</span><span style=\"color: #000000; line-height: 19.2px;\">and&nbsp;</span><span style=\"color: #000000; line-height: 19.2px;\">Department</span><span style=\"color: #000000; line-height: 19.2px;\">&nbsp;Head of Program in Science, Technology &amp; Society at the&nbsp;</span><span style=\"color: #000000;\">Massachusetts Institute of Technology. He has also been a Professor of Physics at MIT. His</span><span style=\"color: #000000; line-height: 19.2px;\">&nbsp;physics research is in particle cosmology, working at the interface of particle physics and gravitation. In particular, most of his work has focused on inflationary cosmology.</span></span></div>\r\n<p><span style=\"font-family: verdana, sans-serif;\"><span style=\"color: #000000; line-height: 19.2px;\">&nbsp;</span></span></p>','','<p>NA</p>'),(308,'Mark Bowden','','<p class=\"MsoNormal\" style=\"margin: 0px 0px 7.5pt; color: #222222; font-family: arial, sans-serif; font-size: 12.8px; line-height: 19.2px;\"><span lang=\"EN-CA\"><span style=\"color: #000000;\">Mark Bowden is&nbsp;recognized&nbsp;as one of the world&rsquo;s foremost authorities on nonverbal communication, voted the #1 Body Language Professional in the world by Global Gurus in 2014 and 2015.</span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0px 0px 7.5pt; color: #222222; font-family: arial, sans-serif; font-size: 12.8px; line-height: 19.2px;\"><span style=\"color: #000000;\"><span lang=\"EN-CA\">A sought after keynote speaker and trainer globally, Mark helps groups and individuals use their body language to stand out, win trust and gain credibility every time they communicate.</span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0px 0px 7.5pt; color: #222222; font-family: arial, sans-serif; font-size: 12.8px; line-height: 19.2px;\"><span style=\"color: #000000;\"><span lang=\"EN-CA\">As the founder of communication training company TRUTHPLANE&reg;, his business and political clients include Presidents and CEOs of Fortune 500 companies and Prime Ministers of G8 powers.</span></span></p>\r\n<p style=\"color: #222222; font-size: 12.8px; margin: 1em 0px; padding: 0px; border: 0px; font-family: arial, helvetica, sans-serif;\" dir=\"ltr\"><span style=\"color: #000000;\"><span style=\"font-family: arial, sans-serif;\" lang=\"EN-CA\">Mark is a bestselling author of 3 books on the subject of body language and human&nbsp;behavior, with his first book&nbsp;<em>Winning Body Language</em>&nbsp;translated into five different languages.&nbsp;</span></span></p>','',''),(309,'K.V.S. Dileep','<p>Mr.<span style=\"color: #444444; font-family: verdana, sans-serif; font-size: 12.8px;\">&nbsp;KVS Dileep has completed his PhD and M.Tech in Computer Science from IIT Madras and he is associated with the&nbsp;</span><a style=\"font-family: verdana, sans-s','<div style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"color: #444444; font-family: verdana, sans-serif;\">His research interests include Memory Based Reasoning in Artificial Intelligence, Machine Learning and Natural Language Processing. He has also worked in research unit of IBM, Bangalore with the Human Language Technologies Group and has published several research papers including one on &ldquo;Learning Data Dependent Composite Kernels for Robust Image Retrieval - A Genetic Programming Approach&rdquo;. He joined FLICKR in 2011.</span></div>\r\n<p><span style=\"color: #444444; font-family: verdana, sans-serif;\">&nbsp;</span></p>','',''),(310,'K.V.S. Dileep','','<div style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"color: #444444; font-family: verdana, sans-serif;\"><span style=\"color: #444444; font-family: verdana, sans-serif;\">Mr. KVS Dileep has completed his PhD and M.Tech in Computer Science from IIT Madras and he is associated with the&nbsp;</span><a style=\"font-family: verdana, sans-serif; font-size: 12.8px; color: #1155cc;\" href=\"http://aidblab.cse.iitm.ac.in/new/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://aidblab.cse.iitm.ac.in/new/&amp;source=gmail&amp;ust=1473941794722000&amp;usg=AFQjCNFMrkDDTI-66MTtn2T1Av9QgPSsww\">Artificial Intelligence and Databases(AIDB) Lab</a><span style=\"color: #444444; font-family: verdana, sans-serif;\">&nbsp;at IIT Madras.&nbsp;</span>His research interests include Memory Based Reasoning in Artificial Intelligence, Machine Learning and Natural Language Processing. He has also worked in research unit of IBM, Bangalore with the Human Language Technologies Group and has published several research papers including one on &ldquo;Learning Data Dependent Composite Kernels for Robust Image Retrieval - A Genetic Programming Approach&rdquo;. He joined FLICKR in 2011.</span></div>\r\n<p><span style=\"color: #444444; font-family: verdana, sans-serif;\">&nbsp;</span></p>','',''),(311,'Gurvinder Singh','<p>Gurvinder Singh is an electrical engineer who is&nbsp;<strong>&nbsp;Professor of Robotics and Autonomous Systems, Professor of Robotics and the Built Environment and &nbsp;a Professor of Robotics.</strong></p>','<h4 class=\"item-title\" style=\"margin: 0px 100px 5px 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: 18px; font-family: Arial, sans-serif; font-size: 16px; vertical-align: baseline;\"><span style=\"font-family: inherit;\"><span style=\"border-style: initial; border-color: initial; border-image: initial; font-variant: inherit; font-stretch: inherit; position: relative; display: inline-block;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;He has done&nbsp;</span></span>PhD and DIC, Control Theory from Imperial College London .</h4>','gurvinder.virk@innotecuk.com',''),(312,'Tripti Chitkara','','<div><span style=\"background-color: #ffffff; color: #000000; font-family: arial,helvetica,sans-serif;\">Tripti Chitkara is an astrologer, numerologist, metaphysicist and a tarot reader. <span style=\"text-align: justify;\">Tripti Chitkara originates from a long line of Natural Clairvoyants. Even in childhood she astounded her family and friends with the gift that she had been given. She helps in all matters; Love, Money, Business, Health. Her skills have been used to help many people including doctors, army officers, media people, businessmen, people wanting to start their own organizations, MNC employees, friends and family and has been consulted in the writing of articles in the national print media. <br /></span></span></div>','tripti@tarotcardindia.com',''),(313,'Stan Whitcomb','','<div class=\"gmail_default\" style=\"font-size: 12.8px;\"><span style=\"color: #444444; font-family: tahoma,sans-serif;\">Stan Whitcomb is currently the chief scientist of the Laser Inferometer gravitational-wave laboratory(LIGO).The LIGO Lab is operated by Caltech and MIT through funding from National Science Foundation.It comprises observatories in Livingstone,Louisiana and Hanford in addition to groups at MIT and Caltech.The LIGO Scientific collaboration currently includes approximately 500 scientists,engineers and students from more than 50 institutions in 9 countries.</span><span style=\"color: #444444; font-family: tahoma,sans-serif; font-size: 12.8px;\">Stan received his undergraduate education at Caltech. He had one year of graduate study at Cambridge University before completing his Ph.D at the University of Chicago in far-infrared and submillimeter astronomy.</span></div>','whitcomb_s@ligo.caltech.edu',''),(314,'Prof. Jess H Brewer','<div style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px;\">He is a&nbsp;Professor at Emeritus, Dept. of Physics &amp; Astronomy.</div>','<p><span style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px;\">He has particularly researched in Muon Spin Rotation/Relaxation/Resonance,Condensed Matter and Muon Physics.</span></p>','',''),(315,'Dr. Rajesh Gopakumar','','<p><span style=\"font-size: 13px;\">Dr.Rajesh Gopakumar a theoretical physicist is director of the International Centre for Theoretical Sciences in Bangalore, India. He was previously a professor at Harish-Chandra Research Institute in Allahabad, India.He has been acknowledged with these awards. </span><span class=\"m_-329448083021594921gmail-_Xbe m_-329448083021594921gmail-kno-fv\" style=\"font-size: 13px;\"><a class=\"m_-329448083021594921gmail-fl\" style=\"text-decoration: none; color: #1a0dab;\" href=\"https://www.google.co.in/search?espv=2&amp;biw=1366&amp;bih=623&amp;q=ICTP&amp;stick=H4sIAAAAAAAAAOPgE-LSz9U3MCrKrirJUeIEsZMKLJLMtFQyyq30k_NzclKTSzLz8_QLUvMLclKt8vJLEpNyUhUSyxOLUooBPcAl7T8AAAA&amp;sa=X&amp;ved=0ahUKEwi5k47GtKXRAhXMpI8KHWfkAjAQmxMIpAEoAjAb\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=https://www.google.co.in/search?espv%3D2%26biw%3D1366%26bih%3D623%26q%3DICTP%26stick%3DH4sIAAAAAAAAAOPgE-LSz9U3MCrKrirJUeIEsZMKLJLMtFQyyq30k_NzclKTSzLz8_QLUvMLclKt8vJLEpNyUhUSyxOLUooBPcAl7T8AAAA%26sa%3DX%26ved%3D0ahUKEwi5k47GtKXRAhXMpI8KHWfkAjAQmxMIpAEoAjAb&amp;source=gmail&amp;ust=1486564229884000&amp;usg=AFQjCNHAPKDgG5a_0bqR8oR3C9-pSZ2N3A\"><br /></a></span></p>\r\n<div>&nbsp;</div>','gopakumr@hri.res.in',''),(316,'Dr. Ashwin R. Vasavada','','<p><span style=\"font-size: 11pt; font-family: calibri;\">Dr. Vasavada is a <strong>planetary scientist at the NASA Jet Propulsion Laboratory</strong> in Pasadena, California.&nbsp; Currently he is the <strong>Project Scientist for NASA\'s Curiosity rover </strong>that successfully reached Mars in August, 2012.&nbsp; His research interests include the climate history of Mars, the weather on Jupiter and Saturn, and the possibility of ice at the poles of the Moon and Mercury.&nbsp; He has participated in the operation and analysis of data from several NASA spacecraft missions, including the Galileo mission to Jupiter and the Cassini mission to Saturn.&nbsp; He holds a B.S. in Geophysics from UCLA and a Ph.D. in Planetary Science from Caltech.</span></p>','',''),(317,'Shobhit Agarwal','','<div style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px;\">\r\n<div style=\"font-size: 12.8px;\">He is a 2005 batch alumnus, was part of initial BITSAA team to start this Embryo program at BITS Pilani and Goa campus, back then.</div>\r\n<div style=\"font-size: 12.8px;\">He is a Founder of Artificial Intelligence research firm, Adoro for past two years, working with Amazon, Flipkart, Jabong, Snapdeal, Vero-Moda, etc. in Indian fashion space.<br /><br /></div>\r\n<div style=\"font-size: 12.8px;\">Prior to this, he was leading global technology practices in AI, Mobility &amp; Cloud for another BITSian startup, Kony, based out of Orlando, USA. He has developed AI, Personalization &amp; Enterprise mobility products, used by 50+ of Fortune 500 companies (viz. Mercedez-Benz, JLR, HSBC, CitiBank, JP Morgan, Hilton, Marriott, United, Scottrade etc.).</div>\r\n<p>&nbsp;</p>\r\n</div>','','');
